          <td id="L148" class="blob-num js-line-number js-code-nav-line-number js-blob-rnum" data-line-number="148"></td>
          <td id="LC148" class="blob-code blob-code-inner js-file-line">INSERT INTO `places` VALUES (&#39;02d9a2b5-7dca-423f-8406-707bc76abf7e&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;1721b75c-e0b2-46ae-8dd2-f86b62fb46e6&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;The Lynn House&#39;,&#39;Our place is 2 blocks from Vista Park (Farmer\&#39;s Market), Historic Warren Ballpark, and about 2 miles from Old Bisbee where there is shopping, dining, and site seeing. We offer continental breakfast. You get the quiet life with great mountain and garden views. This is a 100+ year old cozy home which has been on both the Garden and Home tours. You have access to whole house, except for 1 restricted area (She-Shack).  Hosts are on site in a casita in the back from 8pm until 7am when we are in town.&lt;BR /&gt;&lt;BR /&gt;Our home has two bedrooms, one king and one queen.  There are 2 bathrooms, 1  1950\&#39;s soak tub with shower and 1 with shower only.  Guests have access to the living/dining room area, and the kitchen (except for use of stove/oven).  Each morning, coffee/tea, and muffins are ready for guests.  A small frig is available in the dining room with water/juice and an area for guest items.  1 parking space is directly across the street.  There is a large back patio with a grill for guests to u&#39;,2,2,4,82,31.4141,-109.879),(&#39;0675a2d6-f64c-4be7-9a8a-f55341f09d4b&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;4a0c57bb-60da-450c-afcf-c59be4c05e67&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Cozy, Bright Studio in GOLD COAST w/Rooftop&#39;,&#39;This lovely, sunny studio is in the beautiful Gold Coast neighborhood of downtown Chicago. Bars, restaurants, parks, shopping and public transport are within walking distance. Steps away from the Loop. Prime nearby attractions include Lake Michigan, Oak Street Beach, Lincoln Park, Museum of Contemporary Art and the Lyric Opera. Rush Street, which offers great dinning, shopping and entertainment, is a short block away.&lt;BR /&gt;&lt;BR /&gt;Apartment has shared rooftop with beautiful views of Chicago\&#39;s skyline.&lt;BR /&gt;&lt;BR /&gt;This 250 sq. ft. studio is cozy, warm, and with lots of light. The small kitchen has a stove, a microwave, a toaster, and an espresso machine loaded with good coffee. Our apartment has a queen-sized mattress, and two-person sofa: altogether they can accommodate three persons. Plenty of closet space.&lt;BR /&gt;&lt;BR /&gt;You will have an access to a shared rooftop, and a laundry room. Free street parking is available very close to the building on LaSalle Street (except 4PM - 6:30 PM on week&#39;,0,1,2,65,41.9009,-87.6298),(&#39;073084e1-1d9d-49e6-8383-42ef6f4325b5&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;f3923bdf-81f2-45e9-a5e1-fd128e122d45&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Fairpark. Downtown Tupelo&#39;,&#39;A private bedroom with a queen size bed and private bathroom is available in my 3 bedroom home in Tupelo\&#39;s Downtown Fairpark. Access to Living area, laundry and kitchen included. One block from downtown shopping, restaurants, BancorpSouth Arena and the Farmer\&#39;s Market. This is a friendly and quiet neighborhood. There are 2 bedrooms available for up to 4 guests.&lt;BR /&gt;&lt;BR /&gt;Parking is available at house. One block from downtown tupelo, Lots of restaurants, shopping and entertainment within 1 block of house.&#39;,1,1,2,54,34.2546,-88.7022),(&#39;09b4888f-0e06-4ab1-abbc-05e9865634d0&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;e4e40a6e-59ff-4b4f-ab72-d6d100201588&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Spanish Town Historic District, Heart of Downtown&#39;,&#39;Our home is a block away from parks, art and culture, including several museums and the Capitol district,  and restaurants and bars within walking distance. Very safe, quiet, in the bustle of downtown but the privacy of a neighborhood. The location, the people, and the ambiance of our funky neighborhood, Spanish Town, make this a perfect spot when visiting. My place is perfect for couples, solo adventurers, business travelers, and pets.&#39;,1,1,2,65,30.4557,-91.1827),(&#39;0a454f9a-eaac-488b-8443-23cf58f7ae37&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;5e061866-d4ad-4aa7-befe-2bf5f8698e29&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Beautiful, Bungalow steps to Beach!&#39;,&#39;Looking for a cozy, beach house? Well this is it!&lt;BR /&gt;Steps from the most beautiful beachs.&lt;BR /&gt;Shared home with 2 cool roommates.&lt;BR /&gt;Comfy corner bedroom with a full bed &amp; amazing sea breezes.&lt;BR /&gt;Cable, WiFi, plenty of yard for parking a car or hanging out!&lt;BR /&gt;House is 30 minutes by car from airport, Honolulu &amp; Waikiki.&lt;BR /&gt;It\&#39;s BEST to rent a car if staying here, especially if you don\&#39;t want to spend a large amount of your time getting places.&lt;BR /&gt;&lt;BR /&gt;The house has a great vibe that invites you in to hangout.&lt;BR /&gt;It\&#39;s a 3 bedroom 1 bath home.&lt;BR /&gt;Steps from Kailua beach.&lt;BR /&gt;Two people currently live in the house but are not always home. &lt;BR /&gt;Very friendly, Ohana style.&lt;BR /&gt;Kitchen to make coffee &amp; very light food prep &amp; living room  are available for your use.&lt;BR /&gt;Make yourself at home. &lt;BR /&gt;There is TV, Cable, Wifi.&lt;BR /&gt;Small workout area outside if you like to lift weights.&lt;BR /&gt;Large yard for hanging out also.&lt;BR /&gt;&lt;BR /&gt;Rented room, family room, kitchen, bath&#39;,1,1,2,79,21.4088,-157.745),(&#39;0b96262f-2c72-464c-a182-8f58afde4288&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;45903748-fa39-4cd0-8a0b-c62bfe471702&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Freetown Artist Loft&#39;,&#39;The Freetown Artist Studio is situated  in the heart of  Downtown Lafayette and is only a few blocks from live music and great food. Living space is approximately 1000 square feet and comes with all of the amenities for a creative, relaxing getaway.&lt;BR /&gt;&lt;BR /&gt;The apartment measures 1000 square feet and has been newly renovated.  I\&#39;m using this space strictly for airbnb. There are a total of 5 rooms, a dining room/utility room has table and chairs, serving utensils and artwork with folding doors hide the washing machine and dryer. The kitchen is complete with refrigerator, cast iron sink, dishwasher, cooking utensils  and gas stove. The bathroom has a cast iron tub/shower, toilet sink, towels and toiletries. The living room has a large picture window overlooking a pond, a sleeper sofa, media armoire, bookshelves, table and chairs and secretary. The bedroom has a queen size bed, chest of drawers, ceiling fan and closet. The apartment has many pieces of original art and small, private ba&#39;,1,1,4,100,30.2216,-92.0143),(&#39;0d10682b-5bd4-4fde-9427-0067fe6ff63c&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;f14fefb3-c6e4-42f6-8a5a-ee704a101f8b&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Large, sunny room&#39;,&#39;This is a large room on the second floor of a 1925 two-story house. With 5 large windows, it faces southwest and gets a lot of afternoon sun; the room has an air-conditioning unit in the summer, though the house itself is not air-conditioned. There is a queen-sized bed and a single bed in the room, and there is also a table and chair and lamp for lap-top work. The bathroom has a shower and is usually shared with other guests.&lt;BR /&gt;&lt;BR /&gt;This is a larger older house (1925) in a residential neighborhood on Red Mountain. The house has two living rooms that are fairly large and a front and back porch, a fairly big kitchen and a back room with a washer and dryer.&lt;BR /&gt;&lt;BR /&gt;Guests are welcome to use the living rooms. They are welcome as well to use the kitchen (and washing machine for longer stays), but we would appreciate it if you would let us know in advance your wishes for using the kitchen so we can coordinate.&lt;BR /&gt;&lt;BR /&gt;We will be around the house during guest stays, and we are glad &#39;,1,1,3,36,33.4884,-86.8079),(&#39;0feb3595-1c64-4bad-816c-769446217d4f&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;14e49d0b-7363-40e3-8854-a89e96481f67&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Sugar Creek Hills&#39;,&#39;My place is close to Chicagoland speedway, public transport. You’ll love my place because of the comfy bed and the coziness. My place is good for couples, business travelers, families (with kids), and furry friends (pets).Broker owned. no garage or basement use.can go month to month or year lease.&lt;BR /&gt;&lt;BR /&gt;Walk around the pond nearby or trail for exercise or just fresh air.&lt;BR /&gt;&lt;BR /&gt;entire home and yard&lt;BR /&gt;&lt;BR /&gt;Available by phone&lt;BR /&gt;&lt;BR /&gt;near metra,major highways&#39;,2,1,4,100,41.4921,-88.069),(&#39;1014dfdf-fa7a-487c-bba8-2d3076d570dc&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;5481bd82-04ab-4a58-ae01-d67443aec20c&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Private Studio with Mini Kitchen and Sauna&#39;,&#39;Private walk-out studio off beautiful backyard with mini kitchen, sauna, jetted tub, fireplace and your own laundry facilities. In the heart of the city, we are close to bus routes, National Jewish Hospital, Rose Medical Center and Cherry Creek Shopping District. An easy three miles west to downtown.&lt;BR /&gt;&lt;BR /&gt;It is cozy and yet has a number of creature comforts, including a Casper mattress (No. 1 rated by Consumer Report), a great soaking tub, an indoor sauna, heated tile floor in bathroom, fireplace, and a rain shower type shower head.&lt;BR /&gt;&lt;BR /&gt;The space is very self-contained, with its own private entrance, laundry facilities, bathroom, kitchen, outside sitting area and more, but guests can make use of the large backyard, deck, and additional sitting area.&lt;BR /&gt;&lt;BR /&gt;I really enjoy interacting with people but realize each guest will have his or her own natural preferences in that regard or priorities based upon the purpose of the trip. I am able to run the gamut from remaining av&#39;,0,1,2,75,39.7362,-104.929),(&#39;10974581-bff8-4ba6-9a00-2ae42d521162&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;dacec983-cec4-4f68-bd7f-af9068a305f5&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;SOBE Refined Studio 2 min to Beach &amp; Ocean Drive&#39;,&#39;Enjoy South Beach in one of the best locations in my clean, quiet &amp; remodeled studio!&lt;BR /&gt;&lt;BR /&gt;You\&#39;re only 2 blocks from the beach and 1 block from fashionable retailers, restaurants, bars, convenience stores, bike rentals &amp; parking structure! &lt;BR /&gt;&lt;BR /&gt;FREE WiFi!&lt;BR /&gt;&lt;BR /&gt;My place is close to News Cafe, Wet Willie\&#39;s, Otentic Fresh Food Restaurant, Cafe Del Mar, and Larios on the Beach. My place is good for couples and solo adventurers.&lt;BR /&gt;&lt;BR /&gt;My condo is permitted under a condo hotel license available at check in.&lt;BR /&gt;&lt;BR /&gt;Enjoy the convenience of a great location in a clean and quiet updated studio! The building is no frills, but you can\&#39;t beat the location for the price. It\&#39;s located on the calm side of a hotel - which also means you get access to a 24 hours front desk ( say you lost your key at the beach...).&lt;BR /&gt;&lt;BR /&gt;It\&#39;s just been tastefully renovated too! While it is 270 sqft, you can comfortably enjoy a luxurious queen size bed ( 3 inch memory foam topper mattress&#39;,0,1,2,89,25.7778,-80.1327),(&#39;12ff7d06-9910-41cd-9eee-bdc21476d119&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;79ff14a4-1888-4cd3-8a31-230fa34bfa00&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;#Private Studio - Waikiki Dream&#39;,&#39;At beginning Waikiki, the tourist center of Honolulu, this charming studio is about 10min walking distance from the beach, and all happenings.  Across the bridge to Convention Center and 15min walk to Ala Moana mall. Bus line is across the street.&lt;BR /&gt;Studio is fully furnished - full size bed,TV, Wifi, mid size fridge, full bath, microwave, coffee maker, induction hot plate. Building has laundry, pool, jacuzzi and BBQ area; for additional fee you may use gym and parking ($25/24hrs in-out privileges)&lt;BR /&gt;&lt;BR /&gt;Perfect location. Designed to be lived in on long term, this studio is suitable for long and short stays. Ocean view. Walking distance to the beach,  restaurants, shops, …&lt;BR /&gt;&lt;BR /&gt;Pool, hot tub, BBQ area, W+D in the building; for extra fee gym and parking ($25/24hrs in/out privileges). There is also a convenience store, food place, King\&#39;s Pub, hair salon, and smart car rentals in the building.&lt;BR /&gt;&lt;BR /&gt;at check-in and check-out&lt;BR /&gt;&lt;BR /&gt;Studio is located at the edge of Wa&#39;,0,1,2,119,21.2874,-157.834),(&#39;1385324e-d727-475c-ad30-f7dcb5afea02&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;1aef765c-3c91-47aa-a716-ffd3b8d748df&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;1 Bedroom, 1 bath guest house&#39;,&#39;Fully furnished.  Just bring personal items.  Very quiet location. Living room, kitchen, bath and bedroom. Refrigerator, stove, microwave, coffee maker, 65\&quot; TV  all Dish Network stations. 2 miles from downtown Globe.  Safe for walking.   Base of Pinal Mts. which are great for hiking.  8 miles from Apache Gold Casino.  20 miles from the Apache Nation at San Carlos, AZ and San Carlos Lake.  31.7 miles from Roosevelt Lake Marina.  29 miles to Tonto National Monument. 2 miles to Besh-Ba-Gowah Ruins.&lt;BR /&gt;&lt;BR /&gt;Guest will have access to the entire guest house.  They will be the only guest who will be there during their stay.  The space is a living room and kitchen, a bath and bedroom separated from the living room and kitchen. There is an excellent air conditioning and ceiling fans in the living room, kitchen and bedroom for added comfort. 65\&quot; TV with all sports, movie, local stations provided by Dish Network. There is a desk in the living room for ease of computer use.  The bedroom has a&#39;,1,1,2,59,33.3678,-110.77),(&#39;14e9cb05-e188-4e02-ab2c-8ef425e5ea64&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;36bff3a3-e3b3-41b9-a6b5-ab2185a8cdf0&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;A Room With a View&#39;,&#39;Charming private room, located in Minnesota\&#39;s beautiful Capitol city. On bus line w/ access to light rail, easy transit. Coffee shops, and restaurants within walking distance. Travel professionals welcome! I\&#39;ll create your home away from home.&lt;BR /&gt;&lt;BR /&gt;Located in a historic neighborhood full of colorful Victorian charm, you\&#39;ll have plenty of options for creative backdrops when you take selfies on your evening stroll.&lt;BR /&gt;&lt;BR /&gt;You will have access to the full house. 2 levels - feel free to make yourself at home. WiFi, Netflix, full cable package available.&lt;BR /&gt;&lt;BR /&gt;If you need directions, recommendations, or to catch up on your favorite TV shows OnDemand, I\&#39;m happy to help!&lt;BR /&gt;&lt;BR /&gt;My home is close to the city, but located on a large park so it feels like you\&#39;re in the country. There are restaurants, coffee shops and even a healthy/organic grocery store all within a block or two.&lt;BR /&gt;&lt;BR /&gt;The bus line, with access to light rail, is a block from my front door. You can get to t&#39;,1,2,2,50,44.9606,-93.0715),(&#39;18ff54e2-dc10-4e7f-bfdb-8a7591f7f009&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;45903748-fa39-4cd0-8a0b-c62bfe471702&#39;,&#39;3fda0d5c-fea4-4920-