t, downtown, golfs, parks, some of Birmingham\&#39;s finest restaurants and night life.&lt;BR /&gt;&lt;BR /&gt;You will love staying in this house, lots of space, FREE parking in the TWO-CAR COVERED GARAGE or on the street, amazing city views from large front covered porch.&lt;BR /&gt;Lots space for out of town executives, families for extended visits, wedding groups, Robert Trent Jones Golf groups, and events. Newly and fully renovated, a great high 9 ft.+ ceiling three bedrooms, two full bathroom historical house with large front covered porch furnished with rocking chairs, bench, dining table with chairs, and lots outdoor sitting area. It has two cars covered garage at alley with fenced back yard for easy access to the house without walking on the stairs at front. Large living room with wood burning fireplace and full size sleeper sofa&#39;,3,2,10,108,33.5156,-86.8468),(&#39;ea0e2e31-1b74-4334-adf1-555d8a6d6c1e&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;b11616e0-fa23-4939-bd3f-0e178de3530b&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Burnside Penthouse: 2/2 + Parking. Walk Score 95!&#39;,&#39;With its sweeping views of Portland, sky-high cathedral ceilings, walk score of 95, and professionally designed interior, this brand-new, ultra-modern Penthouse sits just steps from the action of the Southeast Burnside corridor, where you can dine, drink and shop to your heart\&#39;s content. Just a five-minute Uber ride to downtown, this extra large flat, complete with private and gated parking, is the perfect place to explore the city, while having an ultra-comfy space to lay your head at night.&lt;BR /&gt;&lt;BR /&gt;You can\&#39;t get any closer to the action than at this house, which sits just one block from Portland\&#39;s famous SE Burnside Corridor, with some of the city\&#39;s most heralded restaurants, cafes, shops, and bars just a few blocks away, such as:&lt;BR /&gt;&lt;BR /&gt;&lt;BR /&gt;-- Doug Fir Lounge&lt;BR /&gt;-- Noble Rot&lt;BR /&gt;-- Screen Door&lt;BR /&gt;-- Food Fight Grocery&lt;BR /&gt;-- Prasad&lt;BR /&gt;-- Biwa&lt;BR /&gt;-- Burnside Brewing&lt;BR /&gt;-- Kachka&lt;BR /&gt;-- Olympia Provisions&lt;BR /&gt;-- Chicken and Guns&lt;BR /&gt;-- Sizzle Pie&lt;BR /&gt;-- Le Pig&#39;,2,2,4,99,45.5217,-122.675),(&#39;eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;45903748-fa39-4cd0-8a0b-c62bfe471702&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;Freetown diggs&#39;,&#39;A spacious home on Cleveland. Only a 5 min walk to down town! There\&#39;s lots of nightlife, shopping and good eating! I have a fenced in yard with a fire pit area for groups to enjoy.&#39;,3,2,8,70,30.2185,-92.0159),(&#39;ef3f56b8-c024-471e-b7ba-be1a72c6cbec&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;14e2f358-f8fb-419c-8e8f-0017f971d82d&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Cozy Studio in the heart of Tempe!&#39;,&#39;My place is close to downtown Tempe, Tempe Town lake, Mill Avenue shops/restaurants, and within walking distance of ASU. It is just a 10 min drive from downtown Phoenix and old town Scottsdale. You’ll love my place because of the location, the coziness, and the amenities provided. The apartment is furnished with a simple elegance and is great to relax in after a long day of exploring the valley. My place is good for couples, solo adventurers, and business travelers, and anything in between.&lt;BR /&gt;&lt;BR /&gt;It is a spacious 1 bedroom/studio with a minimalist/elegant style.&lt;BR /&gt;&lt;BR /&gt;You will have access to every part of the apt but I do have my personal belongings in the closet across from the bathroom. Please respect my things and this area. The complex itself has laundry onsite which I would be willing to help you access for a fee.&lt;BR /&gt;&lt;BR /&gt;I will be often available after 5pm on weekdays and all day on the weekend. I live on the floor below in the same building.&lt;BR /&gt;&lt;BR /&gt;The neighborh&#39;,0,1,2,45,33.4225,-111.953),(&#39;f19fa153-154e-440b-9f4b-debee403b0d2&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;c5bbe76a-87f0-44f8-8b4d-e805e6cd757c&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Beautiful Home 1 Mile from Downtown&#39;,&#39;Beautifu home just one mile from Downtown Naperville. Private bathroom oasis w/ rain shower &amp; body jets. FREE Coffee/Tea, FREE wi-fi. Queen size REAL bed. Use of kitchen, off street parking, cable TV in shared space. Two outdoor decks, fire pit.&lt;BR /&gt;&lt;BR /&gt;Home is a tri-level home. Your room has a queen sized bed and is on the lower level away from the other bedroom\&#39;s space. Your bathroom is across from your bedroom and will be yours to use during your stay.  Towels are included as are sheets, hangers, bedding (and extra bedding if necessary).  Hairdryer available. FREE Wifi available.&lt;BR /&gt;&lt;BR /&gt;The mid and lower levels of the home are available for you to use. There is a kitchen, living and family rooms as well as a dining room table, outdoor decks and a fire pit.  You will have access to the coffee maker, teapot, as well as all kitchen utensils and cookware. You will have some space in the refrigerator if you\&#39;d like to purchase food for you to use. We also have a washer and dryer as&#39;,1,1,2,60,41.7744,-88.1741),(&#39;f25b307b-4285-4902-8305-8cf908eace7a&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;44e7a911-2c16-4dc0-ad68-9ae0412afc21&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Cozy Tropical Bungalow&#39;,&#39;This private bungalow is steps from the wide Ewa Beach oceanfront. Great for water sports, sunbathing, splashing in the water and playing in the silky sand. Detached from the main house and in a completely independent dwelling, affording privacy and comfort during your stay on Oahu. No ocean view from the unit but is surrounded by lush foliage, and the beach is just a short 50 ft walk on a secluded path through the ferns out to the ocean/cabana. Private property and no public access is allowed.&lt;BR /&gt;&lt;BR /&gt;Full Kitchen, 2 dining tables for your comfort, one is indoors and one is outdoors on a covered patio surrounded by huge palms and lush ferns. Shuttered windows all around provide balmy breezes flowing all through the bungalow. King size bed with crisp linens, tiled step-in shower and all the beach supplies you will need for a great time. Tropical birds singing all day and the sound of the ocean waves will relax you during your stay at our serene and heavily forested beachfront proper&#39;,0,1,3,125,21.3139,-157.995),(&#39;ff46f903-411b-4a16-8e16-1aab7f00686c&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;1721b75c-e0b2-46ae-8dd2-f86b62fb46e6&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;The Rooming House in Old Bisbee&#39;,&#39;The Rooming House is a lot like the city in which it resides: quirky, cozy, inviting, communal, and experiential. It’s a safe and relaxing space for adventurers to sleep, spin records, talk, explore, and meet fellow travelers from all over the world.&lt;BR /&gt;&lt;BR /&gt;You will never stay anywhere like The Rooming House! This space was previously used to put up miners when they were working in town back in the heyday of Bisbee. It has a very cool set-up with lots of rooms, windows, wood floors and great accents. Complimentary coffee provided every morning! Charcoal grill also available for your use... Please note: This space can accommodate groups of up to six people. If you would like to book additional rooms, please send us a direct message and we can adjust your reservation accordingly!&lt;BR /&gt;&lt;BR /&gt;We will be here to answer any questions you may have; however, this space is definitely yours to enjoy. Full access to the kitchen, dining and living rooms while you\&#39;re here. Wifi throughout, pass&#39;,1,1,2,70,31.444,-109.912),(&#39;ffcc9c22-759e-4418-b788-81eda89c2865&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;2017-03-25 02:17:06&#39;,&#39;1da255c0-f023-4779-8134-2b1b40f87683&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Affordable room in the Marigny&#39;,&#39;Semi-private room in a cute and cozy shotgun house in the Marigny. 15 minute walk to the French Quarter, 12 minutes to Frenchmen St., 2 minutes to the Bywater. Located around the corner from a few restaurants, bars, a coffee shop, and grocery store.&lt;BR /&gt;&lt;BR /&gt;The house is a classic shotgun, a very common style of architecture for homes here in New Orleans. We rent three rooms in our house (see our profile for links to the other rooms). Each room is arranged one behind the other. You will be walking through all of our bedrooms to get to your room, and while you\&#39;ll have your room to yourself, people will need to walk through it to access the kitchen, other bedrooms, backyard, and bathroom. Please look through our photos to see the \&quot;blueprints\&quot; of our house, this will give you an idea to how it\&#39;s laid out.&lt;BR /&gt;&lt;BR /&gt;Your room is the third room in the house. It comes furnished with a built in bed, curtain for privacy, XL twin mattress, reading lamp, a chair, vanity with a large mirror,&#39;,1,1,1,40,29.9666,-90.0519);</td>
