        <tr>
          <td id="L180" class="blob-num js-line-number js-code-nav-line-number js-blob-rnum" data-line-number="180"></td>
          <td id="LC180" class="blob-code blob-code-inner js-file-line">INSERT INTO `reviews` VALUES (&#39;01a2c67a-b39d-4940-b910-a1cc3289557d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;314b188e-990b-423e-ae63-f0199b8c2b17&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Lovely haven on a quiet street.&#39;),(&#39;0230dc18-a336-4ded-97ef-0fee0b4d6ea0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;453b0b1c-6bf3-4e94-8265-082ef06ab85f&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;We loved our stay here! The cottage is gorgeous, comfortable, and has an extra touch you can tell. Our hosts were great and offered some awesome suggestions (like delicious Italian at Beppe\&#39;s that made our night). Very relaxing and cosy, we would highly recommend!&#39;),(&#39;0245460e-d3ed-4c21-b003-155bf74ce3d8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7ed82a23-cd4f-437b-be12-9c54e84281ef&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Great place! Very clean and nice...we were visiting family that lives near by and it was perfect...much better than the local motels. I have a feeling I will be fighting other members of my family to stay here again, everyone was very impressed. Thank you Lynn, Becky and Rebecca for your hospitality!&#39;),(&#39;0278a560-6531-4a28-975f-f68bfc5fe0f9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ffcc9c22-759e-4418-b788-81eda89c2865&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;I only stayed for one night but they were very accommodating with check in and check out times. I was greeted by their pups and barking, but don\&#39;t be afraid they\&#39;re actually really sweet. &lt;BR /&gt;Although the idea of having your room accessed by others may be a turn off it wasn\&#39;t that awkward hahaha&lt;BR /&gt;In your bedroom they provide a curtain with the bed for extra privacy. It really does make your stay more comfortable and is a very nice detail that helped me sleep more comfortably at night. s a very urban and photogenic area. THANK YOU KATIE AND MATTHIJS ! &#39;),(&#39;0363cc1f-6b48-426f-997b-e7b0b5f69195&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;cff8a023-eacb-4a38-a24f-a01fe9ddde18&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;As of the first week of march 2017 there were 165 reviews...all positive!...Cara and Bryan\&#39;s KBCG lives up to every one of them...if there was a choice for 6 stars I would have...we have been coming to oahu for the past 17 years and this was easily the BEST vacation ever...Cara and Bryan are just good people and you absolutely cannot go wrong with Kailua Beach Cottage (URL HIDDEN) Ka Oi&#39;),(&#39;03774280-2251-4721-ac2a-ae032b4e866f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;645127dd-38b4-4fad-9950-57b3ce0a5301&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;Cameron and Sara are very friendly. They allow me to check in earlier to get a quick snap before my audition. I would be happy to be here again. You can cook, take shower and have a cozy bedroom. And their cat spent time with me. The cat is very friendly and lovely.&#39;),(&#39;03d137bf-773f-4ae2-9fcb-fc388550636d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b180ad52-fe00-4040-97f9-9efdfc3d406d&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;This is a private entrance and space in a small RV.  Not really big enough for more than 2 persons.  Great family and close to I5, shops and supplies.&#39;),(&#39;053c8af0-d775-4d20-b938-0834572e28cf&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;47b9ca37-915d-405d-861d-7dbf74559441&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Very clean and worth the money&#39;),(&#39;056a429c-61f4-4a8b-a1fa-e4e129d6697f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;60b77ea7-04c9-4b8a-b835-dc92c6aa196b&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Excellent location near one of the most iconic beaches in the world, Lanikai Beach.  The layout is very comfortable with a private space with all the amenities needed for an awesome stay, whether it\&#39;s a day or a couple of weeks.  Josh and Josey were super-helpful and made sure I had all the info I needed to make the stay comfortable and cozy.  I gladly recommend this cottage to anyone looking for a great experience.&#39;),(&#39;05a4063b-07b8-4ce4-b738-35217f82cfdc&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;453b0b1c-6bf3-4e94-8265-082ef06ab85f&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Bruce and Jennifer were great hosts, have a very cute, clean little cottage and were helpful when we were looking for adventures within the area. Great place to relax and unwind!&#39;),(&#39;06084442-cd96-4daa-8b4d-8619ed8eae64&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9c5a1e44-0090-464b-ac3b-89e0f65cc6e1&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;The house is pretty much terrible if you have european standards. Towels never clean, and when I say never I really mean never. The TV is always on 24h. Nobody to welcome you and help you at the airport. &#39;),(&#39;06af6da4-137d-4a3b-bc3e-0ae33d687b47&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0b96262f-2c72-464c-a182-8f58afde4288&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;We came from Houston for my sons soccer tournament. This was our first Airbnb experience and it was great. Francis was a GREAT host, very accommodating, everything as described, easy in-easy out. Will definitely stay again when in Lafayette.&#39;),(&#39;07278d85-44fa-43bf-a913-95babba2838a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6a78ec0c-8410-4cbf-a915-e697a3aa798d&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Excellent, just book it&#39;),(&#39;07456db9-4c5f-4b24-9c5b-55661da816b2&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4ae40c33-23c9-47a9-b867-0a6d8f25fd8c&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;She was so accommodating and responsive ! Highly recommend and what a beautiful view &#39;),(&#39;08429ff0-3eee-4094-8098-a8b69fda7b56&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8835ba11-7757-45c6-9138-f7e2e4b5f80f&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;We were supposed to stay at Jordan\&#39;s place for one night, but ended up cancelling last minute since my boyfriend got sick in Honolulu and decided it was best to stay there and rest. Jordan was very flexible with our last minute changes, and he even offered us a different night to stay at his place. Unfortunately, this didn\&#39;t happen since we had to fly out, but I will definitely want to visit his place the next time I visit Oahu. Thank you!&#39;),(&#39;08738c2f-129b-4549-ae14-2316fa783b1c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;66fb8e5d-2ad2-44be-8890-a13a9992f257&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;This place was great and Naomi was awesome. We had a last minute flight change and ended up getting to portland 3hrs before check-in. Luckily Naomi was super flexible and let us check in early. The house has a welcoming but hip vibe; has everything you need to make it feel like home. Also has some great places to eat just down the street and it is the perfect distance from downtown.&#39;),(&#39;0ae495cf-67ef-470c-840e-b300e5f01f61&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8835ba11-7757-45c6-9138-f7e2e4b5f80f&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;The room is clean and good for 2 people. We unfortunately did not see Jordan who does not live in the house.&lt;BR /&gt;&#39;),(&#39;0b32b57e-a26c-4a0d-9442-65a7331825e0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4ae40c33-23c9-47a9-b867-0a6d8f25fd8c&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Place had the most amazing view I\&#39;ve seen since I\&#39;ve used Airbnb. Location in convenient and there are a lot of shops, restaurants near by. Clean, AC, had a blast in the hot tub on the recreational floor. Would definitely recommend. Host was polite and quick to respond to my question &#39;),(&#39;0b498860-3c30-447b-bd90-b3a3e92359b8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7354ea6c-3c0e-4800-aad8-708c29a6c067&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;My husband and I needed a place where we could sleep and shower while in Oahu,  since we wanted to do as much as we could out. Tex\&#39;s place was just what we needed, a private room with a comfy queen bed and a bathroom we could use. The bathroom is shared with others in the house, but we did not mind since we only used it to take quick showers. We were comfortable during our 3 night stay. &#39;),(&#39;0bbf090d-0f7e-4dc0-a2b8-4810c5ab7b66&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9c7d3ecd-9592-4910-bd04-91c59e8350f1&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;My husband and I really enjoyed our night stay in Chris\&#39; pool house: easy, clean and everything we needed.&#39;),(&#39;0d1617cf-eca9-4eb8-b539-09d45f3af2b5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1385324e-d727-475c-ad30-f7dcb5afea02&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Tom is a wonderful host.  I have stayed several times and been very impressed with the quick communication and how accommodating Tom is.  I often make last minute requests and this has not been an issue.  I am comfortable and enjoy my stay.  Thank you very much for helping out when I have to stay late in the area and prefer not to drive back home.   &#39;),(&#39;0da4f5fd-2fb8-40ed-8bfe-13aa3ee75cc0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0b96262f-2c72-464c-a182-8f58afde4288&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;We really enjoyed staying in this little artist\&#39;s nook. The place was clean, comfortable, cute, and right within walking distance to the Acadiana Center for the Arts and restaurants. Would definitely here again..&#39;),(&#39;0db3d4f0-a35b-4930-9df2-5dccb70a333c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4703b2d8-e417-4243-a6f3-044fc06f020e&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Amelia was a WONDERFUL host and her house is very nice. Beautiful views off the balcony and beyond a great value. &#39;),(&#39;0e3f3f44-0d47-4746-9b64-5b608aa18d11&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4703b2d8-e417-4243-a6f3-044fc06f020e&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Amelia will make you feel at home and treat you like family. Don\&#39;t look any further.&#39;),(&#39;0e47910b-8bef-47bf-acfb-0363468f8dab&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b2c8a4cd-6e80-48c3-a1fc-07f129ee2875&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;The host canceled this reservation 4 days before arrival. This is an automated posting.&#39;),(&#39;0f718be9-2d4f-4489-b8b8-dac1e5f61311&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b4a927e4-9715-4cd2-9918-47491f97df3e&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Easy, clean, comfortable home with great touches. Slept well, and the room was comfortable. Much better than a hotel. &#39;),(&#39;10315880-bba3-4a90-8ed5-c12f4fb73bac&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ffcc9c22-759e-4418-b788-81eda89c2865&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Overall, I had a nice stay. They were very friendly and easy to talk to.&#39;),(&#39;1085af55-106b-47ee-befa-8b47225c8f79&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4703b2d8-e417-4243-a6f3-044fc06f020e&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Amelia was extremely friendly and helpful, the house/room was clean, well decorated, and in a convenient location. The bed was also super comfy! I would stay here again! &#39;),(&#39;10c1e6a5-ce21-4c90-b73f-f180a1c210c3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;314b188e-990b-423e-ae63-f0199b8c2b17&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Great place, as advertised. Thank you, Christine and Chuck!&#39;),(&#39;11b144c4-423c-42aa-b18b-7a0e26de7270&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e551a4a6-7701-41de-be62-aae869888c78&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Smooth sailing from the beginning. Clear instructions for check-in. Always responded to my questions in a timely manner. A very gracious host and really wants the guests to have a great stay. Highly recommended!!&#39;),(&#39;123824a5-b220-4917-bbea-6125b5d19ae0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;60b77ea7-04c9-4b8a-b835-dc92c6aa196b&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;We loved our stay at the Kailua Cottage! Everything was very clean and decorated nicely, the a/c worked well and we loved having access to the beach chairs, towels and snorkel gear. Josey and Josh were so nice - they greeted us upon our arrival and were alway available if we needed something! Josey was super helpful in providing great recommendations for the area and checking in with us to ensure things were going well. We loved our stay and would definitely recommend staying here! &#39;),(&#39;12f0c56e-8f1f-4f05-86fb-e1d5ccf8da60&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6a78ec0c-8410-4cbf-a915-e697a3aa798d&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;Overall, we had a good stay! &#39;),(&#39;12f53707-8644-4f5a-8af8-ac4bbcc1b56d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;19ae5055-f503-499d-a64f-2bf7d92eff5b&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;We had a great time at Joe\&#39;s place. It was just the right size for us two and we liked the simple nature of the place. No extra frills, clean, and a quick uber ride to downtown. Thanks Joe!&#39;),(&#39;13007e07-8a09-4d0e-ad26-7a90e7e166b2&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b5880e7d-c4b7-497e-ac1a-12826327132f&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Great location and really nice host. Highly recommended &#39;),(&#39;13a80198-2b13-446d-a71f-869c013575fd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;12ff7d06-9910-41cd-9eee-bdc21476d119&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Very cute place! Small, but equip with everything someone will need and great decor. Within walking distance of beach and many great restaurants. Well worth the price, I highly reccomend!&#39;),(&#39;13b8e228-d167-4dcd-b32f-28158b6187af&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;610ef600-53da-4e05-aaaf-b7ae4d14fcfb&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Worked out perfectly for my visit to MN. Simple, clean, quiet accommodations that were cheaper than a hotel and right in the part of town where I needed to be. Great communication for checkin/out.&#39;),(&#39;13dab7f9-766d-4acc-ae4f-b885e44bf57b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b6692019-ac4a-47aa-a671-89cd79c9e11f&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Had a great stay! The apartment was clean, easy to use and had everything I needed for a one. Ugh stay. &#39;),(&#39;14d2cf2b-e854-4e3b-a05a-6f02a2e4a339&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7a958fb6-a203-441c-9f8f-3440523fed14&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;I truly enjoyed the stay, it was definitely as stated. Spacious room that was stayed in. The living place does look like it is within the picture. Fabian was a great host, very warming and friendly which was a great feeling. You might slightly get confused in going to the back to check in, but otherwise fine. The only concern that I had while my stay would be if you plan on going out or working late driving a car is not recommended, drove for an hour in attempt to find parking was quite irritating . Otherwise I loved the stay and would gladly comeback again.&lt;BR /&gt;I would give my entire day stay a good 4.5-4.8 minus the parking issue coming back late. &lt;BR /&gt;&lt;BR /&gt;Muchas Gracias Fabian! &#39;),(&#39;14fb5f8d-9363-4912-affc-68bcd2a4746e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6ebec357-8589-435b-a5cb-fcd99b638fae&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;Elisa\&#39;s place was incredible. The bedroom was very clean and the bed really comfortable. Great communication too. Elisa was a great host. She is very friendly and helpful. She even left coffee and some snaks in the morning. Great experience, I totally recommend the place! &#39;),(&#39;16000e94-6a7c-4383-ab18-150463674b44&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;47b9ca37-915d-405d-861d-7dbf74559441&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;Carmenita is the best host one could ask for and the downstairs apartment is always clean and cozy.&#39;),(&#39;16084c13-e28c-47a6-9020-ff06a2b84c6d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;453b0b1c-6bf3-4e94-8265-082ef06ab85f&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;My daughter an I had a very nice stay in Bruce\&#39;s lovely cottage. Bruce was great about getting us settled in and was very accommodating. I would definitely stay here again. Highly recommended!&#39;),(&#39;16124acc-9a83-4308-9fac-9ae15ce41f1a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7eceb696-213d-42cf-a58d-fa2e47cfdada&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Very comfortable, quiet home, in great location that is convenient to major transportation routes, shopping, dining and entertainment, yet the home itself is in a safe and quiet area.&lt;BR /&gt;&lt;BR /&gt;David is a great, welcoming host, he is generous, very responsive and ensures that his guests have easy access.  He offers a variety of options for your stay.  &lt;BR /&gt;&lt;BR /&gt;The value that David offers can\&#39;t be beaten.&#39;),(&#39;162c399f-950d-4d63-a01c-d7eec17dd34d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;30e56424-c0f0-4e36-9523-f5e904bb3142&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Wonderful! Excellent hosts!&#39;),(&#39;1724f60f-0718-4c54-ae8c-e8d53149eeb7&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;14e9cb05-e188-4e02-ab2c-8ef425e5ea64&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;Donna was such a great host. She was more than accommodating and made sure my stay in St. Paul was very pleasant. The neighborhood is quiet, rustic, and not too far from downtown. I recommend a stay at her house.&#39;),(&#39;17b304f5-d399-4288-8e11-db33a30a41e3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;18ff54e2-dc10-4e7f-bfdb-8a7591f7f009&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Great location. Very welcoming host. Highly recommend this spot.&#39;),(&#39;17b6fad9-ddb9-44a1-94d1-4cf4c008002d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;be13aa0e-8da7-4943-be05-5fd89f4d18e6&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Reeva made sure that I was able to find the location, provided me with a towel, and made me feel at home.&#39;),(&#39;18288fe8-c9d5-4e38-92cc-0e4ed6f26b63&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;207f5bf6-d1de-4cca-a60d-c2c48e93debc&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Jim was amazing and his home is beautiful. He met us upon check-in and showed us around his well preserved, historic home. Jim was so welcoming, friendly, and interesting we just sat and chatted with him for a while. Honestly, we could have chatted all night but we needed food. Jim suggested Weidmann\&#39;s, a really great restaurant nearby (sit on the balcony in the balcony bar!) that has been there since 1870!, and it didn\&#39;t disappoint. The room is pretty stunning and much bigger than the photos show. You basically have a whole, private wing of the house, including a bedroom, living room (with a daybed separate from the bedroom), private bathroom, and kitchenette. All to yourself! You are also provided with plenty of linens, and a Keurig. We really appreciated how charming and unique this home is. &lt;BR /&gt;&lt;BR /&gt;Happy travels!! &#39;),(&#39;183dc5dc-4dbc-47c8-804e-a8f5201b0a22&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;71641595-0021-4007-8e89-2bb776cbf6f5&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Laird was a very welcoming host, he made sure we had everything we needed. The location of this place is great-- right in downtown Greensboro. We loved our stay, the furniture in the home is gorgeous and the king size bed in the room we had was luxurious!  We\&#39;ll definitely be back. &#39;),(&#39;18432f32-e602-4425-aa8b-09215273b5f2&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b6ea25aa-f298-4f24-bc8c-526439f254d5&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;The house was larger than I expected with two stories and had a beautiful, clean interior. Kim was accommodating, letting me check-in a couple hours earlier to leave my luggage there while I went out to explore downtown. Although I never saw or met Kim, the tenant Sarah was usually always home and was a very nice person whom I had good conversations with. &#39;),(&#39;189b6393-f5ac-4e75-9acd-97780c075cd1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7b8ecd06-c520-4adc-b2e4-bfaa7f8bab2e&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;This studio is darling, everything is new and clean.  It is a private entrance, easy parking and access.&#39;),(&#39;19632894-7d2e-4a41-8771-ed76c8a8ed55&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;38e38612-a626-47a9-a699-05efa178e155&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;It was perfect for my business trip&#39;),(&#39;197ef827-833e-4065-9976-3d6c0977daa6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;acd9cdca-855e-484b-baf9-ffda99d945f2&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;We had a wonderful time at Cindy\&#39;s place! Upon arrival, Cindy showed us around the house and was extremely considerate to all our needs. The house was beautiful and very clean. The yard and the views are just lovely, and we spent a lot of time sitting in the yard enjoying the weather. It was super peaceful and quiet the entire time, except for when a big, loud train went by in the evening. We enjoyed checking out the unique rooms and playing the board games, including horseshoes in the backyard.&lt;BR /&gt;&lt;BR /&gt;Thank you Cindy for a wonderful stay!&#39;),(&#39;1a6de471-107f-436c-b230-d7e59437fe69&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;cff8a023-eacb-4a38-a24f-a01fe9ddde18&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;We love coming back to Cara\&#39;s place! This is our 3rd year in a row back, and our experience has been as great as ever. We love the convenient walk to the beach as well as the washer and dryer on site. She also added a new fold out sofa bed since our last stay which was super convenient for our group. We will be back again! :) &#39;),(&#39;1ad57a88-d69e-4271-a5c4-d881cbd11240&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;09b4888f-0e06-4ab1-abbc-05e9865634d0&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Great place win character. Take a walk around the.  Neighborhood, it\&#39;s amazing! Close to the capitol and downtown. Collin and Janay were super easy to work with. Thank you! &#39;),(&#39;1b3a49ce-cfc5-420d-8c65-57a1968d6e93&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;645127dd-38b4-4fad-9950-57b3ce0a5301&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;Peferct Place!&#39;),(&#39;1bb245ab-ace8-484e-b405-70892bc5fa2a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0b96262f-2c72-464c-a182-8f58afde4288&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;This Studio apt is unique. Francis has his art places all over the apt. It is great art. Francis met us and gave us a tour of the apt. I would stay again for sure.&#39;),(&#39;1beabdf4-aa1e-4bed-8b7b-5aca45ea1c32&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;71641595-0021-4007-8e89-2bb776cbf6f5&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;The host canceled this reservation 14 days before arrival. This is an automated posting.&#39;),(&#39;1bf7d7d1-c47e-4658-bb5a-af23e67b0ac4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;859a8a8f-9423-4bf6-b471-d9a7f39c9c2c&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;Wonderful host. &#39;),(&#39;1c12ad76-af0c-4f72-b41c-555189223278&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ff46f903-411b-4a16-8e16-1aab7f00686c&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;Nice place with small rooms.  Great for people traveling light needing a place for the evening while visiting the Bisbee area.  Was greeted by on site management and Olive the dog - always a plus for me.&#39;),(&#39;1c157c0a-bde5-45fd-bae4-314dd002112e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;98b1678d-d25c-476a-b6c3-c11978617e90&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Chris was great, perfect for our one-night stay. &#39;),(&#39;1c280683-704d-4b60-8ce7-8958dfbbcab9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;598218ba-5069-450d-afe1-1e3212c378d4&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;My second time here and i absolutely loved it. The room was as usual, clean and tidy. I highly recommend this place. &#39;),(&#39;1d427ebb-cf6b-4d08-a7d3-0aefa6cd78d8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;598218ba-5069-450d-afe1-1e3212c378d4&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;The stay at Berry&amp;Megans House was teriffic! They are very friendly and open minded and can tell you some nice stories. A nice couple!&lt;BR /&gt;&lt;BR /&gt;The House is very new and everything is fresh and clean! You can feel like you are at home! I highly recommend this accommondation.&#39;),(&#39;1d97cf67-099e-47a5-bf6c-ed0847a833aa&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7a958fb6-a203-441c-9f8f-3440523fed14&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;A great location for what I was doing in the city.  The place looks just like the pictures and the bed was very comfortable.  The apartment is close to a park which was great for going for a run.  Fabian was responsive and helpful during my stay.  &#39;),(&#39;1dcf4818-a951-4b65-a5b8-84e0efe45bea&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0d10682b-5bd4-4fde-9427-0067fe6ff63c&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Great place in a big, beautiful house. Great value for the space!!&#39;),(&#39;1e70ca42-864a-4612-b62c-07de7546d56f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bcda6018-7286-4d8c-abfa-dda1026adf88&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Winnie\&#39;s place was cozy and comfortable! Great location and we had a relaxing trip. Winnie sent us spot on suggestions on where to eat and drink! All of her recommendations were amazing, especially the donut place. It was an easy and beautiful drive to the wineries. &#39;),(&#39;1f0d7dac-3302-4627-b76a-bc337bbdd90b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;52cc10db-af9b-499c-aa8e-670056611a7c&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Place was awesome! Very good place to bring the dog. Neighborhood seems a little spotty but there were no problems! Very good value &#39;),(&#39;1f1601e3-e038-4139-9b44-d7416a5e431f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Emily was a great host. Very kind and with good ideas for local restaurants and attractions. The home is just a short walk to downtown Lafayette with all it\&#39;s considerable charm. I would definitely stay here again.&#39;),(&#39;1f200415-785e-42dd-be9d-13f5cc702066&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;5463e312-5bf4-4764-8c06-e97c5548f712&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Megan\&#39;s space and hospitality is perfect for a business traveler or couple traveling to Jackson. Everything has been thought of and taken care of from comfy robes to light snacks to a personal welcome note with a bottle of wine. Megan\&#39;s house will always be our first choice in Jackson!&#39;),(&#39;1f78f5e5-f98e-4774-b8f6-5ff3bce9408d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;695c0586-3345-4b15-bcf7-f5ecbae258e1&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;The house in general was very clean and well maintained. The room was very clean, looked like a hotel room and I was very pleased with the presentation. I was pleasantly surprised by the host providing cables for charging which was very helpful.  If you don\&#39;t drive, there are a couple of bus stops near the apartment which makes things more convenient. Communication with the host was clear which helped with finding the place, just use the picture and map that they provide and not the one on airbnb &#39;),(&#39;20250979-6295-4ceb-88fa-0216d1857e00&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;af92250e-2f85-4fca-8c04-03029a1b1fad&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;Nice place and Vincent is a good host.&#39;),(&#39;20691f95-dcdd-4b8f-8007-4e653bb12907&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bb86e624-9ecb-4aca-a713-8cd6984f25a0&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;This place was a great stay. Would definitely book here again for the next wine valley trip. A great value for the area!&#39;),(&#39;216a35c0-3239-4072-886a-dc4f0c62d7a9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;14e9cb05-e188-4e02-ab2c-8ef425e5ea64&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Donna was super friendly, and she made sure we had everything we needed for our stay.&#39;),(&#39;2171a4ed-e38b-40a5-a0c6-aa282b111233&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;cb681375-76ad-41d4-ac03-7fe74df9aed3&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;We had the most wonderful stay at the Beachwalk Bungalow.  We arrived very late at night (much later than we\&#39;d said we be there thanks to a travel mishap).  Despite this, the owner, Michelle, waited up for us so that she could welcome us as we arrived and insisted that we text her if we needed anything. Throughout the week, she asked about our trip and told us about great places to see and things to do in the area (including the best local farmers\&#39; market EVER).  One night, when we were laughing like hyenas, Michelle thought we\&#39;d seen a roach and came running out to SAVE US!  We never did figure out who \&quot;Barbara\&quot; is, but we really hope Michelle isn\&#39;t paying her to find guests for her place.  Barbara comes across as very curt (we never met her, though, so we can\&#39;t say for sure if this is truly her personality; we all know it\&#39;s tough to gauge a person\&#39;s tone online).  So, if you\&#39;re considering staying here but are put off a bit by Barbara&#39;),(&#39;219e6562-27e5-438d-9a07-48de868d9167&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ef3f56b8-c024-471e-b7ba-be1a72c6cbec&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39;This is a great place for the money&lt;BR /&gt;Very clean and quiet.  &lt;BR /&gt;And Jake is great.&lt;BR /&gt;Quick responses &#39;),(&#39;224b0828-17d0-4b84-9226-9eba6a6daa96&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9247dcc1-711a-4ab2-b99a-f2808627d2f2&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;We loved our stay at the plantation. The host John gave us great recommendations and we breakfast was superb! Loved every hour!&#39;),(&#39;22d6aba1-1dad-4d54-ad74-13675f94b586&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;cb681375-76ad-41d4-ac03-7fe74df9aed3&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;The bungalow was great. It\&#39;s a cute, well equipped, very comfortable place in an excellent location, close to the beach and shops (including Whole Foods and weekly markets).  It was perfect for our week long stay. Michelle, our onsite host was lovely and very helpful.  I would highly recommend it and would return again without hesitation.  &#39;),(&#39;231f2d41-72ac-44ca-833b-386c50bb8af7&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;38e38612-a626-47a9-a699-05efa178e155&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Stay here&#39;),(&#39;2332eed3-1a2c-41d8-975f-026e44ae936a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1014dfdf-fa7a-487c-bba8-2d3076d570dc&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Randall\&#39;s place is amazing! I would absolutely stay here again, and hope to next time I\&#39;m in Denver. Plenty of delicious snacks provided, and Randall was easily reachable for questions we had during our stay, and even came by with more snacks!&lt;BR /&gt;&lt;BR /&gt;It really did feel like a separate apartment! The sauna and jacuzzi were fantastic. Great neighborhood, close to restaurants and dispensaries. Extensive guidebook of things to do in the area. &lt;BR /&gt;&lt;BR /&gt;The backyard space was quiet, fenced in and beautifully landscaped-- probably my favorite thing about the place. &lt;BR /&gt;&lt;BR /&gt;Thanks for helping to make our stay in Denver awesome!&#39;),(&#39;23a1529a-9cc0-4a97-900e-c7685aeef278&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;32945f6e-5a96-4233-b8ae-048d51323d7b&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;For the price it\&#39;s a good deal. I think that sentence is self explanatory. Also didn\&#39;t get bed bugs&#39;),(&#39;240e2a07-f2b6-44a2-9747-f0d352a5d6b8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;18ff54e2-dc10-4e7f-bfdb-8a7591f7f009&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Lots of fluffy, big towels; very clean floors; spacious rooms with good temperature control; good outside door security (keyless); enjoyable porch swing; friendly, industrious host; easy parking; and my fave... the walk-ability to a vibrant, pretty city park and campus -- all at reasonable rates. &#39;),(&#39;24599559-acff-4576-937a-e23e4d39b402&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7ed82a23-cd4f-437b-be12-9c54e84281ef&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Lynn\&#39;s home in Newton, MS was lovely, very clean and well stocked. The neighborhood is beautiful, very nice homes in a beautifully wooded residential area.&#39;),(&#39;246dd685-5d91-4812-9f8c-99b01177d4dd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e551a4a6-7701-41de-be62-aae869888c78&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;I felt like I was at home while traveling. Such a joy! Thanks Laura!&#39;),(&#39;2490b44d-ba1f-4ede-8064-61e4c513e54d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3c7eb6bc-a146-4186-bfbf-9de857286e68&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Naomi and Frank\&#39;s place was very relaxing and cozy. We loved the scenic view and the complimentary coffee. The overall experience was lovely. Great place to stay! &#39;),(&#39;24b3aa0d-8188-408b-80f4-a8ab2c039bf4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;52d726db-2427-40ca-a5f0-d5c117625d1c&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;Jay and Melissa are as accommodating as hosts can be. From the booking, they gave us a plethora of information and details about their listing and Napa so we would arrive informed and comfortable. &lt;BR /&gt;&lt;BR /&gt;The listing itself was very accommodating. Cozy yet spacious for two. It\&#39;s secluded from the main home, so no need to tip toe or whisper. Cozy bed, lovely living space, and a nice porch for good weather. &lt;BR /&gt;&lt;BR /&gt;Less than a 10 minutes walk to the heart of downtown. We parked our car the night we arrived and never moved it until we left 3 days later. &lt;BR /&gt;&lt;BR /&gt;If we ever do Napa again, we\&#39;re looking for this listing again!&#39;),(&#39;25479f15-000b-4f66-8926-1e85ec8f60bc&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;cff8a023-eacb-4a38-a24f-a01fe9ddde18&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;Really nice and helpful couple.  Nice quiet position walking distance from stunning beach and centre of Kailua with good restaurants.  Great place if you have a car with easy access North and South.  Easy 40 minutes from Honolulu.&#39;),(&#39;257c705b-6b4b-41a5-a1fc-3a597a9a2158&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;43803445-1874-4a3c-94e9-955fcb25089b&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;A really outstanding stay and my experience was consistent with the hundreds of other positive reviews. I enjoyed my conversation with Valerie and Spencer, and liked meeting their cats!&#39;),(&#39;2598ee72-9db0-42be-ae87-05811aa43d60&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;c29b5191-ac68-4e9b-a68f-aa42ea1dcb01&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;It was my first time staying at Cayla\&#39;s bungalow and it was ever better than I imaged. The home has beautiful natural light filling in from it\&#39;s abundant windows and her Disney Movie selection is on point! Thank you for accomodating us!&#39;),(&#39;25ac652b-36d3-4a9e-9448-ce7b317ff39c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b493f8ca-c5d2-414a-9441-6cd4dcebcd36&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Great location for a weekend getaway to Bisbee!  The unit is spacious and has an awesome wrap-around deck that we enjoyed every night.  The fan in the bedroom didn\&#39;t work when we were there and the bed is a little small and uncomfortable but I still gave a 5-star review because I assume the fan will be fixed and bed comfort is a subjective issue.  We would come back here for sure!&#39;),(&#39;2658fdab-fc73-4618-a1ec-7887c2179823&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d27f17eb-3ddd-44c0-9e8a-f3c21d933b3b&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;What a deal! The price is incredible and the accommodations were impeccably clean. If you are just looking for a cheap place to rest your head at night, look no forward. &#39;),(&#39;26eb8371-59ef-44c4-941f-52c529a54dcb&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;96233d68-319e-4ae0-a20f-3af55dcadb0a&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;Great facilities and awesome view, i ll recommended it.&lt;BR /&gt;&#39;),(&#39;27045143-dd28-4c63-b06a-c4941b06ba97&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;60b77ea7-04c9-4b8a-b835-dc92c6aa196b&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;We loved staying here! Josey is so nice and the cottage was beautiful! She has put a lot of detail into the room and it smells really good :) it was close to the beach and the town :) we wish we had more time to spend in Kailua because we feel like there is so much to do there!! Highly recommend to anyone staying in Kailua. &#39;),(&#39;277c1703-4336-435c-b22e-b5eff1872be5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4316efa3-0fb1-4aad-87c0-43ef8d3c0376&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Great for a couple just looking to spend some quality time in a pretty space &#39;),(&#39;27977046-6533-44fd-bc27-2835d8b90f53&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9684e0c7-0f21-4a00-9334-1a974e13dbc3&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;This place is great! I got a little turned around when initially finding it, not realizing I kept passing it up. I gad to call to get directions and my host, Jason, was so nice and guided me there in a snap!  Once I got there though I realized how great the location is. Its very close to all the fun of downtown Lafayette but far enough to not have to deal with the noise of everything once you want to settle down for the night.  The airstream itself was very nice and clean with amenities such as tea, Luna bars, and beer provided (in my case, strawberry beer ) as well as shampoo and conditioner and nice towels.  I am 5\&#39;6 on a good day and this place was the perfect ceiling height for me (about 1ft- 1 1/2 ft above my head. It seemed spacious and bright in the morning too. I had an excellent time in Lafayette but my time here was definitely the best part.&#39;),(&#39;282ce32b-5be3-4a7f-b669-f6c28c216310&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;02d9a2b5-7dca-423f-8406-707bc76abf7e&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Delightful stay.  Irene and Don are very personable and committed to the comfort of your visit.&#39;),(&#39;29cb94cb-de21-40b1-9cc9-2f2249402930&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bcda6018-7286-4d8c-abfa-dda1026adf88&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Amazing communication, Winnie gave us lots of suggestions of things to do, check in was smooth and the place was perfect for a few nights stay. &#39;),(&#39;29da8e26-0eb5-4e3c-bb48-fa60c76e4d10&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;645127dd-38b4-4fad-9950-57b3ce0a5301&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;Lovely historic house, sweet host and an adorable cat!! &#39;),(&#39;2a4824db-3916-4ac7-9702-559495f034cb&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;207f5bf6-d1de-4cca-a60d-c2c48e93debc&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Jim was a gracious host! He was waiting for us when arrived and gave us a tour of his historic family home. The space was even better than we had hoped - very comfortable and spacious.&#39;),(&#39;2af92615-f848-4253-b51d-dd47d439af31&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;85b663e1-ea70-41ff-965b-4280863a8912&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Stephanie was a very welcoming host with excellent communication.  The cottage is very cute and well decorated.  Enjoyed the stay and would stay again.&#39;),(&#39;2b5ef641-5615-4762-b1f6-f262fddf5cbd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8c2f2c57-a172-4689-a070-cbb4cd456c5c&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;I had a nice quiet 3 day stay in Michael\&#39;s house. He was very attentive and friendly to his guests.&#39;),(&#39;2bcc6215-9927-4149-93ad-d98b458db29e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4316efa3-0fb1-4aad-87c0-43ef8d3c0376&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;The place was exactly as described.&#39;),(&#39;2c22d557-2cbd-43e8-82d3-603cadf4299d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e74201c2-6057-419d-be22-d0087eeb4179&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Sherry was a great host and helped me out a lot! Definitely a great place to stay during your stay in Hawaii. Highly recommended!! &#39;),(&#39;2c27a5a7-4860-4c84-9ba6-9562e9aa4af0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3c702a05-81f1-450e-b07f-386ae8a3b124&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;The host canceled this reservation 23 days before arrival. This is an automated posting.&#39;),(&#39;2c2926cf-16bf-47de-bf11-920d8d7f2c92&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b13b1a74-3a12-4f00-8c19-273cbedc0eaa&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Great location in an amazing town&#39;),(&#39;2c4bad08-ef5e-4590-8dce-f976596e4669&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;66fb8e5d-2ad2-44be-8890-a13a9992f257&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;We throughly enjoy Naomi\&#39;s wonderful home. It was everything we expected. We enjoyed the decor, board games and cozy fire. I wanted to bring home the bed! It\&#39;s ultra comfortable. &lt;BR /&gt;I cannot wait to book my next trip to Portland. &#39;),(&#39;2c697c31-7a96-4556-9c2c-607fa60e306b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;be89d2ce-231e-4205-a8c1-e6bcf5990302&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;An amazing place to stay. Super inexpensive, near light rail, a beautiful room and house, and very accommodating! Highly recommend. &#39;),(&#39;2c6fa5bb-21dc-4b6a-8620-98e0b031a2d8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e3f28357-a476-4032-8726-4ac7262cbc72&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;I can\&#39;t say enough good things about Jane and her place.  &lt;BR /&gt;&lt;BR /&gt;The place was just as described and represented a really good value in a location that often has tight hotel inventory and very high prices.  The home is in a quiet neighborhood, but just a short walk to downtown Napa and all of the restaurants and shops there.  Getting to St. Helena highway and Silverado were very easy as well.    &lt;BR /&gt;  &lt;BR /&gt;Jane\&#39;s communication both prior to and during the stay was excellent.  She provided recommendations for things to do in the Napa Valley area and also gave two-spot on dinner restaurant suggestions.&lt;BR /&gt;&lt;BR /&gt;I\&#39;d highly recommend Jane\&#39;s place to anyone planning a Napa trip and look forward to staying there again in the future.&#39;),(&#39;2e4c75fe-51ad-453c-ada0-328b9abafc3a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;dce54621-9083-4cd9-9335-a9e8861289d8&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Great location and accommodating. Staff was friendly.&#39;),(&#39;2e6c4669-3e83-4a96-acc5-bbf85f463f0a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b6692019-ac4a-47aa-a671-89cd79c9e11f&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Great place for overnight stay, central location&#39;),(&#39;2e85ee97-9adc-4e9b-850c-b66e849028d9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;5463e312-5bf4-4764-8c06-e97c5548f712&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Really great place!&#39;),(&#39;2f2ddfa5-99b8-4d9a-a6d9-f9187726c48a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Emily\&#39;s place is conveniently located within walking distance to all the downtown restaurants and nightlife. The house is older so don\&#39;t expect the Hilton. But do expect it to be clean and comfortable. Emily was an excellent host. We couldn\&#39;t be there to greet her at 3pm check in so she left the key where we could find it&lt;BR /&gt;She has local numbers and places written down if you don\&#39;t know the area. And even allowed us a late check out(because it worked with her schedule) as we wanted to sleep in. &lt;BR /&gt;I\&#39;d recommend Emily\&#39;s house if you looking to be able to go out downtown and drink and be able to walk and not drive.!!! &#39;),(&#39;2f607848-04d7-4eb6-9076-485b280415fd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;859a8a8f-9423-4bf6-b471-d9a7f39c9c2c&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;This is the type of space that you stay in if you want to get away from the day-to-day rush and meet some very good people...Business travelers and personal travelers should both plan a stay here if you happen to be in/around the Tupelo area. I very much enjoyed my time at Brent and Cindy\&#39;s space and look forward to staying there again in the near future. &#39;),(&#39;2fe22742-fe8f-429e-aa72-d173509ba5fb&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ef3f56b8-c024-471e-b7ba-be1a72c6cbec&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;Jake\&#39;s place is perfect for one or two people. Overall, it was clean and neat and quiet! I never met Jake, but he was quite responsive to my needs via text when I ran into a few issues. It was an ideal location for me and I would like to return next time I visit Tempe.&#39;),(&#39;30978ec3-63a2-452d-ae1c-e3f64e662ba1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;df2548db-377d-422e-b805-4e8e0c794302&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Minutes from UAB, major roads, grocery markets and other retail. The condo is very safe, gated with live guard, clean and comfortable. The views are stunning. Kevin is a great host and is willing to do whatever it takes to make your stay enjoyable. I highly recommend.&#39;),(&#39;30982e18-b8f9-4733-9f42-de944dda7fad&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e2d4feeb-4cb0-4df4-a10e-5a54748621b3&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39;Inn the Oaks is a very comfortable, clean, welcoming place. If you get a chance to sit down and talk with Jane, do. She\&#39;s wonderful, and she made me the best breakfast ever. I\&#39;d love to stay there again. &#39;),(&#39;322c77dc-d8a7-4be4-94f7-7cf5ffa6e639&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;52cc10db-af9b-499c-aa8e-670056611a7c&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Great place at a great rate in the Capitol City!&#39;),(&#39;325a672c-45cc-450a-ba47-c59df51902fd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;073084e1-1d9d-49e6-8383-42ef6f4325b5&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;My wife and I were very impressed with our first stay in an Airbnb rental. It was wonderful. We had a very restful time and will surely stay here anytime we are traveling through Tupelo. We felt very secure. Vince\&#39;s place is walking distance to many of Tupelo\&#39;s attraction yet it is still very secluded in a very upscale neighborhood. We couldn\&#39;t have asked for better. Thank you Vince!&#39;),(&#39;3310ffc4-d046-47a4-8645-157cfa2b7c65&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;cff8a023-eacb-4a38-a24f-a01fe9ddde18&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Cara\&#39;s place is amazing, The beach is only a few blocks away.  The inside was immaculate and decorated with authentic Hawaiian artifacts. Cara and her family were great host. We will definitely be coming back to stay.  &#39;),(&#39;33ec4f6e-891f-4a22-8542-3efb555b13c4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e58517c1-3214-465f-a982-78208a3266c0&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;This is a perfect place to take a group to help volunteer in rural Alabama or visit the Civil Rights Movement sites!&#39;),(&#39;33ec75c5-22ca-4b81-9647-f86e3e319ee8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ad4cd1fe-3358-4183-8062-59e39824175c&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;It was like we stepped back in time to Antebellum Era Alabama. Why stay in a hotel when you can live like this for a few days. Ian, our host was incredibly accommodating. Breakfast was made for us every morning. I wish we could have stayed longer. &#39;),(&#39;33f3ea40-e5b7-4d08-a722-e17311037199&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;14e9cb05-e188-4e02-ab2c-8ef425e5ea64&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;She made me feel welcome, and relaxed. She is available and overall a good experience&#39;),(&#39;34167ed5-d42e-4c0c-9b43-614b5f7ae41f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3290a4ef-4241-4fa5-843e-87926c74e384&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;Carlos could not have been more accommodating, hospitable, and professional.  I was truly thrilled with our experience at his home. It was immaculately kept, modern yet classic, and made to feel our own. &lt;BR /&gt;Carlos showed his true kindness when my fiancé and arrived a few hours before our scheduled arrival time (traveling can confuse the best of us) and yet Carlos quickly turned over our room and allowed us to settle in. The self check in and out was also much appreciated. &lt;BR /&gt;The location couldn\&#39;t be better, either. His home is walking distance to many restaurants and bars catering to the ASU and Tempe community.  We were a moderate drive to Peoria where we watched a couple Mariners games and a 45 or so minute drive to great hiking at the Superstition Mountains. &lt;BR /&gt;We will definitely look to staying with Carlos in the future and I recommend you do the same. &#39;),(&#39;343b878c-6bab-4d46-a512-6b3d1b70b653&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bc227cc3-0ad7-4b9a-b72a-6c2a45e6a88a&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;Hosts were very responsive and helpful. The house was conveniently located, large, clean and very comfortable. Having 3.5 bathrooms is a big plus. The 5+ bedrooms were very comfortable with nice bedding. Bathrooms were also very nice. Internet was easy to access. Lots of amenities -- hair dryers, shampoo, lotion, etc. Television channels are  limited, so plan on using Netflix/other. &#39;),(&#39;346e0190-4410-498a-827f-c353e9f6153e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b33cae89-fe4f-4c6e-a1c5-0022450f2bf2&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Loved everything about the rental.  We arrived late at night and everything was set for us to have a stress free check-in.  The rental was clean, well-stocked with coffee, granola bars, bottled water and even croissants.  The rental is very private and the neighborhood is quiet.  We stayed a total of 3 nights and were not around much during the day. In summary, the rental exceeded our expectations, Michele was very responsive and professional throughout all communications. Would highly recommend.&#39;),(&#39;34ceb933-d2cc-436d-a57e-176933476d3b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ae787938-171f-4563-8c75-92a037fed415&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;Hannah and Richard\&#39;s home was beautiful and clean. They are great hosts (and decorators!). They were super accommodating and friendly. I would definitely recommend staying with them.&#39;),(&#39;35087f35-2eb7-4d6b-a14a-fab6c593f774&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;836bea96-c22d-46d2-9335-b97cec4cc30a&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Ellen\&#39;s house was everything that you imagine Southern hospitality to be. A very friendly host with interesting conversation . We thoroughly enjoyed our stay.&#39;),(&#39;350e6904-26de-4229-a766-5731b48542bc&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7354ea6c-3c0e-4800-aad8-708c29a6c067&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;Close to public transport. Good value for money. Hardly any interaction with the hosts.&#39;),(&#39;35cebfe1-c6a1-4ac2-9368-6057297483da&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e58517c1-3214-465f-a982-78208a3266c0&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;I have stayed at the bunk house several times now and it is as expected.  Perfectly fine.  Pam is as welcoming as can be and is always around to help if needed.  I like the bunkhouse and would stay there again.\n&lt;BR /&gt;\n&lt;BR /&gt;Dave\n&lt;BR /&gt;PS....I got the WIFI working so there is internet in the house now.&#39;),(&#39;35d605df-1c08-49f7-a6d8-18c860c30378&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9c5a1e44-0090-464b-ac3b-89e0f65cc6e1&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;I really enjoyed my stay at Lauren\&#39;s. It\&#39;s perfect if you want to be able to easily access the entire island because it\&#39;s just as far from Ka\&#39;ena point as it is to Haleiwa. The shared room was perfect because I was only there to sleep. One thing I loved was how close this Airbnb was to a Buddhist temple. I would definitely stay here again.&#39;),(&#39;362bb9ff-0168-49e4-bf7f-727a64cddfb3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;12ff7d06-9910-41cd-9eee-bdc21476d119&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Dana\&#39;s place was as described, comfortable, clean, adorable, and very walkable to Waikiki! Would definitely recommend for your stay!&#39;),(&#39;36429951-2841-4f93-8bda-f6106a0039ab&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;30e56424-c0f0-4e36-9523-f5e904bb3142&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Charming and cozy.  A really unique experience (assuming you\&#39;ve never stayed in an Airstream) but has all the amenities you might need and a wonderfully comfortable bed.  A fantastic option for a special and unique place to stay in Napa.  If you\&#39;ve bookmarked this place and are considering it among other options, BOOK IT.&#39;),(&#39;36d880b3-1b80-4f0f-86bb-b855853579a8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;610ef600-53da-4e05-aaaf-b7ae4d14fcfb&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;Great communicator and a great place to explore St. Paul! Near lots of shopping and good restaurants, very nice and walkable area. Parking is readily attainable as well.&#39;),(&#39;370c007d-8e0c-41c2-8d8f-1eb930bbd702&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3ebfaf23-cede-4cf0-964d-8afc17b11d02&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;This is a beautiful place with very thoughtful and gracious hosts. The neighborhood is lovely as well. I hope to go back and stay longer next time.&#39;),(&#39;3763bf41-a515-4b70-affc-56a6d48c290a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b56cb489-da79-4028-bcc0-7251324606f0&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;The picture with the spa on the deck tells the story. This is a great place to stay while enjoying the leeward side of Oahu. The appearance of this home from the street is deceiving. Don\&#39;t let this turn you away. Once inside you\&#39;ll be taken in by the view and the very cool interior decoration. Jim collects vintage furnishings and he and Maki have decorated the interior in an attractive and artful manner.\n&lt;BR /&gt;\n&lt;BR /&gt;Of course, it\&#39;s the hosts that make or break a stay at an AirBnB. Maki and Jim made us feel right at home. Maki makes delicious and creative breakfasts. \n&lt;BR /&gt;\n&lt;BR /&gt;Keep in mind that you\&#39;re not right in a town. The nearest Starbucks is a  5 to 10 minute drive.  One of the features we liked was that most everything we wanted to see or do was within 30 minutes. On the other hand, depending on how you look at it, everything is at least 30 minutes away. No problem for us.&#39;),(&#39;3777d4fd-e5fd-4602-9153-fca83172618d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;43803445-1874-4a3c-94e9-955fcb25089b&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Clean&lt;BR /&gt;Cozy&lt;BR /&gt;Well organized&lt;BR /&gt;Easy to check in&#39;),(&#39;3793e6c6-664e-45fa-b429-4dd9a0fd7c6f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;aaf389be-c794-4fb4-a6cf-619ca956898f&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Perfect stay! Melanie made us feel so welcome and made our travel plans as easy as can be. The space is so comfortable and centrally located; just a few minute drive into the main area of town with dining and shopping and was perfect for our 3 day stay in town for exploring wineries in Napa, Sonoma and Calistoga. Highly recommend and would definitely stay again!! &#39;),(&#39;37dc3555-8753-4748-a226-3ca446cef6ce&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;859a8a8f-9423-4bf6-b471-d9a7f39c9c2c&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Perfect location, Perfect host, great space, I absolutely loved it and look forward to many more business trips to Tupelo&#39;),(&#39;38268dd5-0875-4690-bf1c-217bf3fec5a0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;38f1bc75-713e-4f09-b02f-d26a4c43ac63&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Great value and quiet location. Comes with electric blanket, locking door, easy parking in quiet neighborhood. If you want great economy this is the place.&#39;),(&#39;38288a65-102f-4ec8-940d-31e2082a06cb&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;acd9cdca-855e-484b-baf9-ffda99d945f2&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Cindy is an amazing host and her place is great. We booked the property for a 2 day getaway for a surprise party to a would be groom and bride and this place had all ingredients to make the trip a memorable one. &lt;BR /&gt;&lt;BR /&gt;Cindy is very accommodating. She was very flexible to give us a late check in and was courteous to allow us 3 hours of extra time for check out. We were greeted by a box of fresh home made cookies, coffee and bananas. &lt;BR /&gt;The house is amazing will all facilities. Name it, and its here... outdoor grill, fire pit, wifi, comforters, pillows, fully loaded kitchen etc... we had an amazing stay and will come back here soon. &lt;BR /&gt;&lt;BR /&gt;Cheers!&#39;),(&#39;382fa2aa-2aff-4980-93c0-20b8dfc8d48a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b7a46879-c82a-46d9-9ea9-43cbefca2f81&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;It was a very nice-sized place to stay the night.&#39;),(&#39;38349a33-af84-4560-a1e1-045768f9261f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9a4d1511-f149-485c-a66b-0ca3fa105ad7&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Extremely comfortable feel. &#39;),(&#39;38d44b1a-6872-4c55-8332-38f88cbadc41&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0b96262f-2c72-464c-a182-8f58afde4288&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;Our host was very kind. The apartment is great located from all that we needed. Our stay was really great and we didn´t have any problems. WiFi works great, so as air condition. Close are great restaurants and bars with live music. I can definetly recommend this apartment.&#39;),(&#39;38e332c7-6221-4074-94b4-de69723cddc7&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;836bea96-c22d-46d2-9335-b97cec4cc30a&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;We absolutely loved our stay at Ellen\&#39;s! The room is cheery and comfortable, as is the rest of her beautiful home (and the shared bathroom wasn\&#39;t a problem at all!). Ellen was a wonderful host - we appreciated her flexibility with check-in time and her great conversation. Just wish we could have stayed longer :)&#39;),(&#39;392e4b15-e1d8-4cd2-9f16-b5cffe64d1b0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b4a927e4-9715-4cd2-9918-47491f97df3e&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Doug &amp; Deb are friendly host and what was said in the site is accurate and enjoy !&#39;),(&#39;3a3988df-d572-4668-a20e-15073a94d078&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7b8ecd06-c520-4adc-b2e4-bfaa7f8bab2e&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Very clean and everything was available at the place. &#39;),(&#39;3a9a15c2-7020-4bbb-9d10-4ba31fa11a81&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;31568a3f-d5b1-47d1-b2ee-74339059e3a0&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;Best landlady ever!  Very special place...&#39;),(&#39;3accdedc-54fa-4d3d-8967-3134a4265bf6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;314b188e-990b-423e-ae63-f0199b8c2b17&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Great experience. Booked at the last minute and that was an easy process. Everything was thought out in this small space. It was extremely clean and comfortable. &#39;),(&#39;3b2a5795-310e-4b2e-b1d1-45767ebd0210&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;478d6061-fc78-40c3-a1b2-0e906fb86da8&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;I had a nightmare flying experience and spent over 16 hours in airports thanks to delays. I flew into SJC a day later than expected and in the middle of the night. So I contacted 20+ air b n bs in the area for a place to rest and Tiger was the only one who made an easy, self check in possible. The area is safe, conveniently located by 280, and is exactly what the photos show. Perfect place for a quiet and clean place to sleep.    &#39;),(&#39;3b46d409-808e-44c1-a0ca-be36356390c9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d3fc84bb-8ccd-4457-99a8-91dda88dc64d&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Love this place!   Calle Ocho is RIGHT THERE!!&#39;),(&#39;3b4c6cc2-1279-4572-940a-ae20f45e157d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e3f28357-a476-4032-8726-4ac7262cbc72&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Room is clean with private bath. Nice towels soaps etc.   nice TV and Jane has many nice touches in terms of decorating, books for reading, movies for TV, coffee.   Jane is a warm accommodating host.  &lt;BR /&gt;Even though The room has a private bath, it is across hall and close to host bedrooms.  Even though it technically has private entrance from outside, you need to climb a narrow metal spiral staircase to get to door.  In order to carry luggage to room you need to enter through hosts main entrance and go through their living area to access your bedroom.  Older people will not be comfortable using spiral outside entrance at all so they will not really have private entrance.  &#39;),(&#39;3b86dd03-2f38-4cdc-9a37-fc1f767ce700&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9a4d1511-f149-485c-a66b-0ca3fa105ad7&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Nice and quiet and tastefully furnished. We would stay at Rachel\&#39;s again.&#39;),(&#39;3cb3bbec-e6cd-47c7-8083-463a23d20b12&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;52cc10db-af9b-499c-aa8e-670056611a7c&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;I stayed at Kelly\&#39;s while taking the bar exam. I couldn\&#39;t have asked for a better place to stay. The house was clean, the bed was comfy and the neighborhood was quiet. &#39;),(&#39;3d6bf370-6367-49cf-ba81-68be652857c7&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b180ad52-fe00-4040-97f9-9efdfc3d406d&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;It\&#39;s very quiet and cozy! Camping in the city, without the worries of Raccoons! ! Very comfortable and easy to move around the city.&#39;),(&#39;3e725c04-213f-4e2d-97d0-d32cd34c0d8b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b56cb489-da79-4028-bcc0-7251324606f0&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;The reservation was canceled 34 days before arrival. This is an automated posting.&#39;),(&#39;3f54d114-582d-4dab-8559-f0682dbf1fa6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;279b355e-ff9a-4b85-8114-6db7ad2a4cd2&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;Really nice place and really nice people. Secluded. Everything was clean. Very convenient. You will love it.&#39;),(&#39;407a4179-4f6e-4f92-b5c4-f11282fd4a37&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;14e9cb05-e188-4e02-ab2c-8ef425e5ea64&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Donna greeted me at the door with a huge smile and a firm handshake. Everything was in order and she even had a lot of coffee waiting for me. On my way out she was even gracious enough to have packed me breakfast because I was running late for the airport. I couldn\&#39;t have asked for anything more in a host. Thanks again Donna!!!&#39;),(&#39;40ccb35f-71f7-4e09-91c5-4dad072d1187&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6d24beec-f296-473c-a34a-4dd9aab8a780&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Gingers place was close to downtown and easy to get to and from.&#39;),(&#39;4156e8df-5c9d-4144-9e98-45e4ed80edcd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;817bcb43-ba39-4925-aed6-76be4bed946b&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Tom was a very friendly host; he was familiar with the area and offered us some great tips. The room was small, parking was far away and the lava lamp didn\&#39;t work which made us sad. But for $20 a night, this place was definitely worth it. Thanks for hosting us Tom/JJ!&#39;),(&#39;41b90126-54c2-4af4-a7fb-f676791debfd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;478d6061-fc78-40c3-a1b2-0e906fb86da8&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39;Very quite and private. Accurate and prompt response. &#39;),(&#39;41f6c5ec-e7fa-41c4-a494-0b9196800aab&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;38f1bc75-713e-4f09-b02f-d26a4c43ac63&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;David &amp; Darla are friendly réactive hosts who will help You If You need information And support. Only the horrible cold weather And floods downtown San Jose ruined all their efforts to make me have a good stay, Nevermind they are not responsible Of the weather ;)&lt;BR /&gt;i Will come back When good weather, spring or summer comes back. Best regards.&#39;),(&#39;42498681-30d4-482b-9e2e-4b6a53a0bd72&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0d10682b-5bd4-4fde-9427-0067fe6ff63c&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Perfectly comfortable and sufficient!&#39;),(&#39;424b29f6-8008-4ea7-b142-ae65e762fddf&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b180ad52-fe00-4040-97f9-9efdfc3d406d&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;We needed a last minute place to stay in Eugene, and Dee responded very fast. The pod was great size for 2, very comfortable, and included all amenities that we were looking for. The family is very nice, and inviting. Residential area feels safe and close to main streets. We loved our privacy and pretty much everything! This is the place to stay if visiting. &#39;),(&#39;432ef7ac-590e-466a-bab3-7ce72be25b39&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9c5a1e44-0090-464b-ac3b-89e0f65cc6e1&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;I didn\&#39;t stay - has a friend take me in!&#39;),(&#39;434fd10e-72ae-4051-b03e-82092b41935b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;12ff7d06-9910-41cd-9eee-bdc21476d119&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Awesome place to stay. Will stay again.&#39;),(&#39;43af3ff7-8d3e-4ff0-89ae-d9333b9fdf37&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3290a4ef-4241-4fa5-843e-87926c74e384&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;It really felt like home &#39;),(&#39;43be7e50-906e-4c89-92b8-f5713c80e1d0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3c702a05-81f1-450e-b07f-386ae8a3b124&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;Highly recommend staying with Dan and Kelli. Excellent hosts with a beautiful home and they make you feel very welcome. Definitely going back &#39;),(&#39;43c14f45-8d60-482a-8085-a70b2af051eb&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;5463e312-5bf4-4764-8c06-e97c5548f712&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;We travel frequently and were pleasantly surprised.  Megan goes above and beyond as a host thinking of all the little details.  You won\&#39;t find a better place in Jackson especially for the price.&#39;),(&#39;4497686b-2c87-4c2f-bd74-2d7aedb42696&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;32945f6e-5a96-4233-b8ae-048d51323d7b&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Curb appeal isn\&#39;t great, but host in office is caring and helpful.  The room is clean, stocked with towels and has good AC/heat.  Shower a highlight. Bed was rather comfortable.  All things considered a great value and exceeded my expectations.&#39;),(&#39;44bd1216-751d-4f72-9ffe-4c81acb24b37&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b