bus stops on Government and Normal and also a 10 minute walk to CATS terminal so it\&#39;s easy to get downtown and back by bus. We only stayed one night but met Bryan, his wife, and his wonderful dogs. The bedroom is nothing special but it gave us a good night\&#39;s sleep.&#39;),(&#39;46ff4b30-f188-48ea-94de-20a9fd16b150&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;daa15c1b-9ca6-4042-85fd-bdb7a46d5862&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;Stayed here for a show at the X. Great location for walking to/from. Restaurant across the street perfect for a nightcap. Apartment was beautifully furnished and easy to find. Mike was a great host and communication was excellent. Will definitely stay here again!&#39;),(&#39;472f1a9e-c976-46fd-ac79-5514c3db3205&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2b6e6650-5f69-426d-a084-71f7ad30d1f1&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Thank you very much for having us!! It was quite comfortable in this room. We are really reallyspending good time. We can defenitely recommend it to my friends. Thank you :)&#39;),(&#39;4741df70-2e95-404e-b150-da02c0ce6541&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ef3f56b8-c024-471e-b7ba-be1a72c6cbec&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Location is really close to downtown Tempe.  The apartment was cozy and clean.&#39;),(&#39;4866d45d-9c21-4d13-bb39-f62bc2bf233a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;478d6061-fc78-40c3-a1b2-0e906fb86da8&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;Quiet, clean, comfortable, great location - just what I needed!&#39;),(&#39;48771e28-30db-40ba-8001-d5f58d9c48d7&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ff46f903-411b-4a16-8e16-1aab7f00686c&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;The Boarding House is exactly as advertised. I met four very nice people, including Tiffany and Ryan. The space is relaxed, clean, and eclectic. T &amp; R have extra nice touches to make guest comfortable and welcome. I was there two nights and would come back to stay here on another visit to Bisbee. &lt;BR /&gt;&lt;BR /&gt;The location is just super. About five minutes or less from all of the city fun when you walk downhill. Five minutes to great visuals, birds, and flowers when you walk up OK Street. &#39;),(&#39;488e5739-759e-4c33-b7f9-aff5ba897419&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;dbdc349b-a195-474f-9856-dbe01d08c331&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Welcoming. Small, comfortable room and a nice bathroom at the end of the hall. Very quiet. Thank you for letting me stay!&#39;),(&#39;4989a032-71f1-4abc-ab0d-486702c9c915&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;dbdc349b-a195-474f-9856-dbe01d08c331&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;Inexpensive place to stay with just the basics. Clean. Nothing fancy. Perfect if you just need a quiet place to sleep.&#39;),(&#39;4994bf49-62e2-4cfe-b2f5-f64bd93a2a11&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e2d4feeb-4cb0-4df4-a10e-5a54748621b3&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;I was arriving around 9:30 on Easter night. I was met and warmly greeted. After a quick tour, I had the entire house to myself!  Everything is very clean and very charming. I met Pat, Randy and Jane. All were delightful. The breakfast is a super fantastic surprise. If you are in the area, book a room!  You will not be disappointed &#39;),(&#39;49a0f733-d01f-4cbb-8b40-2a758e317c8d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;48bf9579-0f57-426e-9051-a4d3507ad7cd&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39;We enjoyed our stay at Stacie\&#39; s home. For the price we paid we had a comfortable, happy experience.&#39;),(&#39;4a641ad6-cd31-4df0-820f-546118bea5cb&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;f19fa153-154e-440b-9f4b-debee403b0d2&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;I stayed for 9 weeks as a clinical student at Edward Hospital, and I thoroughly enjoyed my stay. Great drive to work, home was lovely, and Kathi is an amazing host. She welcomed me like family (even took care of me when I got the flu), which made the academic stresses far more manageable since I wasn\&#39;t worried about my living situation on top of it. Also her home is really close to downtown Naperville (5 minute lyft/uber) but in a quiet community, which is like the best of both worlds. I can\&#39;t give her enough stars! &#39;),(&#39;4a91fc4a-6e0e-43e1-9454-d404847d7de5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e6c33577-5de3-4481-9147-47ef4710b986&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Lani\&#39;s house was central and not far from the airport. About a half hour away from most places and attractions. Lani was benevolent and hospitable. She didn\&#39;t hesitate to help us with anything we asked for or needed. We also met her family and they were nice too! We were out most of the time and she understood and respected that. She even washed our clothes while we were out! This place is PERFECT for people who visit Oahu to go out and explore the island but don\&#39;t want to sit by a pool all day. Thanks, Lani!!&#39;),(&#39;4ab0b168-fc47-47cb-8643-97f4ab3b18ea&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d991f849-0f2f-41cb-b6d7-41feee6bc943&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;Really nice room with balcony, attached bathroom, and walk in closet. I was very comfortable. &#39;),(&#39;4b2d0cc2-a030-4002-aa2f-e269bf6a8015&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0d10682b-5bd4-4fde-9427-0067fe6ff63c&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39;Great, convenient spot for a lot of te cool spots in Birmingham. And the beds were quite comfortable! &#39;),(&#39;4b976ffb-a8e9-42b4-9771-fc8e2e69cb60&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2b6e6650-5f69-426d-a084-71f7ad30d1f1&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;We stayed at Nathalie\&#39;s place in Kailua for a week and loved it. It was close to the beach and shops, everything we needed was only 5 minutes away. Nathalie was always very quick to respond with any questions and is a lovely person. I would certainly stay here again!&#39;),(&#39;4bbc633c-b593-426f-8d81-38438718434b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e2d4feeb-4cb0-4df4-a10e-5a54748621b3&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;Everything was great at Inn the Oaks. It\&#39;s a real B&amp;B, and the owners were very accommodating of my late arrival time and came over to meet me. The place has been recently remodeled with great care and was spotlessly clean and the bed was super comfortable. Jane, the inn keeper is charming and made me a great breakfast of grits and bacon. I definitely recommend staying here!&#39;),(&#39;4bbf30c9-6b1e-4251-811f-67b97de477a7&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bb86e624-9ecb-4aca-a713-8cd6984f25a0&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;We spent two nights in Pippa\&#39;s place and we had an amazing time !! The place is super cosy and confortable and Pippa is a great host making sure you have everything you need, and sharing with you tips and advices on what to do during your stay ! Highly recommended to visit this beautiful region and to feel like home :) &#39;),(&#39;4bcca9d8-d866-45d8-84ab-3ed97215b393&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;552b5aaf-33b7-407b-a2dc-459ab730b3a5&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;What a wonderful condo and host. Everything was brand new and very clean. Annie was available at all times and check in was very easy. Just a quick bus ride to Waikiki Beach and great access to Walmart, Pharmacy and other restaurants. Definitely great for professionals and tourists.  &#39;),(&#39;4bd3764f-9525-4341-9e7f-c8293f71da7e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b7a46879-c82a-46d9-9ea9-43cbefca2f81&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Barbara\&#39;s place is clean and wonderful! They are super nice and willing to share all they know about this town! You will not regret choose this place! &#39;),(&#39;4c4bc8c9-6fd3-497e-9b19-e018d8a9d78a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;62e75faa-d265-4ca1-a009-1e06f1d6ab14&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Ellie is an excellent hostess and was very helpful in answering my questions about Chicago. It was a very clean apartment with an amazing view. The location was close to great restaurants and attractions. &#39;),(&#39;4d0ec895-5e31-48df-b326-bcbc03498cd1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9c7d3ecd-9592-4910-bd04-91c59e8350f1&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Chris\&#39; pool house was exactly what I needed after a long day on the road. Very quiet and unique. Sat by the fire pit, listened to my tunes on the rock box, and sipped bourbon. Chris communicated timely, described everything accurately, and had everything ready when I arrived. Looking forward to the next visit!&#39;),(&#39;4d325840-91c9-4725-ab72-7968d57fcb06&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0a454f9a-eaac-488b-8443-23cf58f7ae37&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Great location!  Busy all day exploring the island.  Best location,  walking to beach for sunrise was such a wonderful and peaceful experience&#39;),(&#39;4d35bb60-a8b7-453e-aff7-0db17fc372be&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;cb681375-76ad-41d4-ac03-7fe74df9aed3&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;We loved staying in this cozy place! Perfect walk to Kailua beach. My favorite part was how QUIET AND PEACEFUL it was! My husband and I were visiting from a city life and we both felt like we slept like babies! Perfect breezes, crickets and birds- but quiet residential neighborhood. Michele was super accommodating! Thank you for a great week!! Mahalo!&#39;),(&#39;4d4aadba-246c-41e2-9acd-d2c48ad59f08&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;38e38612-a626-47a9-a699-05efa178e155&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;If you like the family feeling or you are a group of travellers, this could be your place. The apartment is wide with 6 rooms, mine had 2 bunks but I don\&#39;t know about the other rooms. Also you will find a nice swimming pool.&lt;BR /&gt;Mario is a nice host, and the communication with him was easy.&#39;),(&#39;4d7a1d3f-f209-42df-80e1-21cf871009c1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;c29b5191-ac68-4e9b-a68f-aa42ea1dcb01&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;Cayla was great. Her home is beautiful and she was a great communicator!&#39;),(&#39;4dcfbc6b-a065-4467-b8af-eb8df2ea2885&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7eceb696-213d-42cf-a58d-fa2e47cfdada&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Great place. Beautiful home in a nice quiet neighborhood&#39;),(&#39;4dec3a16-d121-4b1b-9bce-3b046ead7388&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0d10682b-5bd4-4fde-9427-0067fe6ff63c&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Robin and Haynes are incredibly sweet, approachable and helpful. They offer a lot of great recommendations about things to do, and Robin is very prompt with her responses about check-in and information about her place. An added plus is that her dogs are very adorable and friendly. And as someone with a mild allergy to dog dandur, I had no trouble and didn\&#39;t sneeze once. The place is very clean and cozy. The house is very close to the Vulcan Trail, so if you are someone who enjoys a good view and nice walk, I\&#39;d highly recommend staying in the area. &#39;),(&#39;4e1c7270-2302-4c39-9d4e-dd5d393a8d2e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b33cae89-fe4f-4c6e-a1c5-0022450f2bf2&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;I stayed at Michele\&#39;s place for 2 nights. The place is exactly like the pictures in the listing. Being a 1-minute walk to the beach was the best. Michele provides extra towels and beach towels; it came in handy for our beach trips every day. Michele is a great host and very responsive. We didn\&#39;t encounter any problems while staying at her place. Thanks Michele!&#39;),(&#39;4e456426-ed11-45c8-b9fb-c9dad66d1db5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;09b4888f-0e06-4ab1-abbc-05e9865634d0&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Beautiful room in a perfect location to downtown Baton Rouge. Quiet neighborhood and nice and friendly owners. They have good timely communication when trying to book something. Room very nice and clean with separate entrance and bath from rest of the house. &#39;),(&#39;4e745a31-8d5c-496a-8d2c-71891b702faf&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;dce54621-9083-4cd9-9335-a9e8861289d8&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Fantastic place, great staff, close to great places for entertainment..... &#39;),(&#39;4f062ce4-6234-4977-9b62-55d968b9d39f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d991f849-0f2f-41cb-b6d7-41feee6bc943&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Had a comfortable stay here. First Airbnb so I wasn\&#39;t sure what to expect and have nothing to compare this experience to. The price was good for the stay -- some things were lacking IN ROOM like cups/water... and communication, but overall it wasn\&#39;t a deal breaker and I would stay again. &#39;),(&#39;4f43e15c-9a3b-4808-8645-62b2501c2023&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e979e012-bcb1-47ea-bb39-140cdfe0f917&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Clean, comfortable, quiet, basically perfect for two or one person. It has its own bathroom which was really nice. Clayton gave us some suggestions of hikes around the area that were really cool! It was also nice to use the kitchen if we needed it. Overall a great place!&#39;),(&#39;4f501f92-3a0f-4ec2-b0af-5cb3b2253008&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9c5a1e44-0090-464b-ac3b-89e0f65cc6e1&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;This place is great if with friends or people you know! Very cute set up and everything you need. The open air feel is nice in the shower and bathroom! Unfortunately didn\&#39;t see or play with the dog during my stay. &#39;),(&#39;5022106d-619e-4087-9aac-7b2e866980b5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;I took a bachelorette party to Lafayette for the weekend, and we had a great time at Emily\&#39;s. While not fancy, it was clean and comfortable. She made up the beds and futon for us, which was very nice! The location was walkable to a few bars and restaurants, and it was 5 minute drive to the rest of town. We enjoyed hanging out at the eat-in kitchen. Lots of natural light in the house! The price was so reasonable, and Emily answered all of my questions. I would totally recommend this host and house!&#39;),(&#39;5076d997-adb0-428c-ba9e-18ce6c7785e4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6f59f0c7-f3f6-419f-9a8c-9d998a3b681c&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;It was great to get to know Daniel and his fiancee. He was very warm and welcoming. Daniel and my wife got along well and that helped my wife settle in being new to US. The place itself was clean and nice. I would definitely recommend this airbnb to others.&#39;),(&#39;50967d43-75c9-4576-81ea-bd2a578c0f38&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;cb681375-76ad-41d4-ac03-7fe74df9aed3&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39;Highly recommend this place! Host is incredible, went with my 7 year old Son and we had a great time and felt welcome every day!&#39;),(&#39;516b03b7-f1d0-4a64-8756-f196e48f3e53&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d3fc84bb-8ccd-4457-99a8-91dda88dc64d&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Pros :&lt;BR /&gt;&lt;BR /&gt;Price &lt;BR /&gt;Locations&lt;BR /&gt;&lt;BR /&gt;Cons :&lt;BR /&gt;&lt;BR /&gt;Air mattress &lt;BR /&gt;Too much people (I didn\&#39;t expected to be that big)&lt;BR /&gt;We were in room in the way to kitchen, bathroom and other rooms, so very noisy avec people passing by our room... &lt;BR /&gt;&lt;BR /&gt;The number of people could be a good thing to meet new people and make friends... but be aware of the cons if you are fine with that the location is convenient, I didn\&#39;t have good nights of sleep there but you cannot beat the price &#39;),(&#39;5177c5e6-d7f7-4133-b05c-40ee4f46ef13&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d72f839c-9390-4085-9d39-b45144c9c3c8&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;Worth the stay - very relaxing. Very rustic and peaceful especially at night. &#39;),(&#39;518ae513-811d-4a28-9c10-6f9a28944bb7&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;478d6061-fc78-40c3-a1b2-0e906fb86da8&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Great place, really nice guy! Very helpful!&#39;),(&#39;51c82d5e-5193-4488-b471-551f19d6c36c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;be13aa0e-8da7-4943-be05-5fd89f4d18e6&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;Reeva was cool and chill just like her place.    Very hospitable! I think the bed was made out of clouds.  I slept so good! She had water and little snacks for me in the room.  Great place to stay if and when you are in Tupelo, MS!&#39;),(&#39;528d30c2-f969-4ec9-aeee-5028673a60f3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Staying at Emily\&#39;s place was great. Especially since we brought our dog on our trip. Thank you Emily for your hospitality.&#39;),(&#39;52d32d59-3174-4b39-8e23-fe8a1f3863be&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0675a2d6-f64c-4be7-9a8a-f55341f09d4b&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;this was fine for what i needed. it\&#39;s not a space to spend time in, but the futon bed was comfortable, and the place was heated well.&#39;),(&#39;53224507-ecb9-40c8-a3e5-33ad5686eb73&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6d24beec-f296-473c-a34a-4dd9aab8a780&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Stellar spot&#39;),(&#39;53e42a62-bd5c-495e-aa23-390567c38ba2&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e979e012-bcb1-47ea-bb39-140cdfe0f917&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;We arrived in the evening and were only at the house for one night. Clay was out when we showed up but he had arranged for us to check in . We appreciated the effort   he made so that we would feel welcome,  such as a leaving light on in the entry way as well as in our room. The  bed was comfortable and there were a number of foods available for breakfast.  The listing is a fair distance from the I5 and has limited furniture but is great value for a short stay.  We were quite satisfied.  &#39;),(&#39;53fdc230-f05e-4710-a93b-1538ace666b1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ad124633-a610-483f-862a-6f54dda19c6e&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;It was a convenient and comfortable one night stay. We arrived in the middle of the night and Lida made the check-in process fast and easy. &#39;),(&#39;53fffdc2-8b28-4a41-b807-076a0676acd2&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;552b5aaf-33b7-407b-a2dc-459ab730b3a5&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;This place was amazing. Super clean, cozy, modern. Great location, located near food shops, grocery stores, coffee shops. Easy to get places. Annie respond very fast and was willing to help with anything. I would comeback to Annie\&#39;s place in a heartbeat&#39;),(&#39;5445e292-d37b-4592-a447-7a177e4b48a0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;acd9cdca-855e-484b-baf9-ffda99d945f2&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;The Roost was perfect for my student staff retreat. We had to switch locations at short notice and Cindy was very accommodating and quick with her communication. The kitchen was perfect for cooking for a big crowd and you can\&#39;t beat the view at sunset. Perfect escape from busy Phoenix. &#39;),(&#39;5479dabb-4e91-44d0-9ac4-e2345b517040&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;921cd471-9e69-4214-a1f0-014a0a378327&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Tom is a great host and has a wonderful house. I\&#39;ll definitely plan to stay there again if I\&#39;m in the area.&#39;),(&#39;54e3cc07-cd68-4f5f-84d8-b446ce8c2206&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;12ff7d06-9910-41cd-9eee-bdc21476d119&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Stay was great! Close to downtown! Great Communication from host! &#39;),(&#39;5556fe9e-3f98-42de-88d0-a43bd16c66f9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;02d9a2b5-7dca-423f-8406-707bc76abf7e&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;Irene and Don\&#39;s place is nothing short of wonderful. We so enjoyed it there. A sunny evening porch, extra little touches-mini breakfast items and lots of care, and attention to making sure we had everything we might need.  We felt at home immediately. It is only a couple of miles from Old Bisbee and well worth the short drive. &#39;),(&#39;55677153-9bdc-4c5d-b4b9-ea6010c46a03&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;610ef600-53da-4e05-aaaf-b7ae4d14fcfb&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;If you are staying in the st. Paul area this is the place to stay. It is small so no more than two people but it is great. The area is also great.&#39;),(&#39;55b8a54e-4ebc-4f8d-911a-4aa9d039c602&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ff46f903-411b-4a16-8e16-1aab7f00686c&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;The Rooming House has so much character. It comes fully equipped with everything you need for a great stay and even has extras like toiletries for anything forgotten. Ryan met us and was genuine and very helpful. The location is great and you can walk anywhere. My boyfriend and I had a great time.&#39;),(&#39;55d11ec8-5819-442f-86ba-7fcfdf920d7b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;be89d2ce-231e-4205-a8c1-e6bcf5990302&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;Very nice person. Very disponible. This is where I will stay when I am in St Paul. Nice room. Bed is comfortable.  The host try to make you feel at home. He does a very good job at it. Thanks!&#39;),(&#39;55d69a73-aa35-43c5-8590-9c2c2cc9ceeb&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7eceb696-213d-42cf-a58d-fa2e47cfdada&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Nice room in a very nice house. David was a great host!&#39;),(&#39;55f5c921-4c85-4dfa-b54e-874168113ef1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;073084e1-1d9d-49e6-8383-42ef6f4325b5&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;Our group included my 81 year old mom and 16 year old son. The Barbecue Festival took place in his back yard (so to speak) But inside Vincent\&#39;s home was quiet and peaceful.  Vincent was so genuine and pleasant. And his home is beautiful and comfortable.&lt;BR /&gt;We truly enjoyed our stay!&lt;BR /&gt;&lt;BR /&gt;&#39;),(&#39;5628eb1b-384c-4f46-af69-0061b5864047&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b6692019-ac4a-47aa-a671-89cd79c9e11f&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Great apartment in a central location. Mason responded super quickly to all my questions and his place was clean and comfortable. Also, the bed was crazy cozy. &#39;),(&#39;566ccd60-acff-4e60-ac66-cec46444d301&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;62e75faa-d265-4ca1-a009-1e06f1d6ab14&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39;Ellie\&#39;s place is great. You\&#39;ll find a very comfortable apartment in the heart of Chicago. The views are breathtaking and Ellie does a great job communicating and accommodating. Great central location walking distance to a lot of attractions. Very clean place with a warm welcoming vibe. I definitely recommend booking her place when visiting Chicago. I certainly will! &#39;),(&#39;56c3460c-417c-4c5f-9a0e-af5356383844&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8fba447b-e04f-41c5-a730-848ef02758a9&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;This was the perfect place for a weekend get away. Amanda was a generous host from the Netflix available on the TV to the chocolates on the bedside pillows. She was always available incase we needed anything. Very close to downtown St. Paul and great restaurants. Can\&#39;t wait to come back to Minnesota and visit soon!!!&#39;),(&#39;56eb5858-cfc7-4472-9787-db0417ac7e65&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b6ea25aa-f298-4f24-bc8c-526439f254d5&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Stayed here one night for an interview at medical center. Her place is 15 min walk to Cook County hospital. Clean room and not much noise from other occupants. I slept well and would consider staying again if I\&#39;m in the area. &#39;),(&#39;56f311ca-dcc0-4b6a-bafc-181bdbb1c98e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7354ea6c-3c0e-4800-aad8-708c29a6c067&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Everything was great!&#39;),(&#39;5735a6cd-ace0-4366-9164-dc8304359ee1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;dbdc349b-a195-474f-9856-dbe01d08c331&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Jimmy\&#39;s place was exactly what I needed. I only needed to stay a night near the University and to take a shower before leaving. I was in town for music audition, and they fortunately had a little upright to play around on. Simple furnishing, no frills. I liked waking up to the view out of the window, which looks out to their backyard and lovely tree. Great value. Recommended for low maintenance travelers/visitors!&#39;),(&#39;576736bf-48a0-4d4a-a14f-564a2d24b423&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;96233d68-319e-4ae0-a20f-3af55dcadb0a&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;The apartment was clean and accommodations were great. Location was centrally located with close access to restaurants and stores. D was there to greet us when we got there. We also were able to hang out at the pool after checkout because our flight was a couple of hours later.  Overall, great experience.&#39;),(&#39;57682096-11f3-4ed0-b5f3-9e245e427ae9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b5880e7d-c4b7-497e-ac1a-12826327132f&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;The location was perfect.&lt;BR /&gt;The beech is very close.&lt;BR /&gt;Clean and quite and a very good host.&#39;),(&#39;57713144-8dd5-4583-92b6-3b5f9cd65bd9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;62e75faa-d265-4ca1-a009-1e06f1d6ab14&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;It was definitely worth the price and had a great view. And by great I mean GREAT. &#39;),(&#39;577a2d13-dc64-4ee2-ada8-a7416cc7f051&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;cb681375-76ad-41d4-ac03-7fe74df9aed3&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;This was our second time to Kailua and we were definitely happy with the location of Beachwalk Bungalow. Everything was as we were expecting. Lovely hosts who don\&#39;t bother you but are available when you need anything and they have some of the friendliest 2 dogs we\&#39;ve ever met.&#39;),(&#39;579f645d-240f-4613-b832-893021d03574&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0b96262f-2c72-464c-a182-8f58afde4288&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;We loved the convenience, character and personality of this place. We were very comfortable and would return.&#39;),(&#39;57af0e18-49e6-4bae-987a-b634df5b6510&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;836bea96-c22d-46d2-9335-b97cec4cc30a&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Ellen is personable and her home is charming and comfortable.  We enjoyed our stay.&#39;),(&#39;57b8e5b5-8c4f-47c3-8129-6d74d57e382d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0a454f9a-eaac-488b-8443-23cf58f7ae37&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Exceeded expectations &lt;BR /&gt;Pam and her place are awesome and great location &#39;),(&#39;581e190a-ec94-4390-8e9d-a5cc2ccec537&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ae787938-171f-4563-8c75-92a037fed415&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;My mother and I stayed here, using both of the rooms available. I slept on the pull-out couch (which was extremely comfortable). Hannah and Richard were great hosts and I recommend staying with them wholeheartedly. &#39;),(&#39;592c1b53-0099-4033-b7e5-9fcd66608faf&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b13b1a74-3a12-4f00-8c19-273cbedc0eaa&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;Great view, colorful and comfortable house. Those 90 stairs keep you honest.  :)&#39;),(&#39;59318363-98d0-4135-a451-1fdf77d00b3c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bc227cc3-0ad7-4b9a-b72a-6c2a45e6a88a&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Great place for a larger group stay. Very classy interiors and quiet location. &#39;),(&#39;593212bb-f60f-43ef-ba55-aacc0d1cefec&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;38e38612-a626-47a9-a699-05efa178e155&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;Great spot&#39;),(&#39;5944a617-068b-418f-b5b6-dc32d036138b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1ff1963c-7afa-470c-bc05-562b01549b09&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;We had a great stay at Hanan\&#39;s place. The location was ideal, and the back patio was a perfect place to unwind after a day of wine tasting. We were traveling for a girls trip, and had 4 of us staying at the house. We found it very comfortable, and were very happy to have laundry in unit! &#39;),(&#39;5a12ce74-e54e-4a42-ab15-2472912aac3a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b4d6d884-e50d-41eb-9b97-6395a07a43f9&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;We absolutely loved Alex and his wife. They were home and around all weekend to answer questions and give us tips. Cute and cozy room and bathroom too. The room is right across from the master and off by the living room so if you\&#39;re looking for a quiet room by yourself be aware of this. Had a great time and will definitely recommend in the future! &#39;),(&#39;5a14bc7d-19a3-4625-9aad-ad9c21cabdb9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8fba447b-e04f-41c5-a730-848ef02758a9&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Absolutely awesome warm welcome!  Love this stay as much the second time, as the first!&#39;),(&#39;5a37b507-eb98-4b88-947e-74ee5cc85ac1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bcda6018-7286-4d8c-abfa-dda1026adf88&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;What a great find! Amazing location, quiet neighborhood, cozy and clean accommodations. Has everything you would need and then some. Bonus: great value. Highly recommend.&#39;),(&#39;5a9b27d1-8501-40fb-a190-ade8f4b4b6f9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0b96262f-2c72-464c-a182-8f58afde4288&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;Great place for our family. Kids loved the pond in the backyard. Good location. Francis is very easy to communicate with.&#39;),(&#39;5b123026-e90e-4973-9218-5f16ad1a2130&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a16c7358-bf66-4802-8933-1616b5a322db&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Perfect location and beautiful studio!!&#39;),(&#39;5b3abb93-48de-4927-9ef2-5a60398d59ae&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6ebec357-8589-435b-a5cb-fcd99b638fae&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Elisa\&#39;s place is so welcoming and immaculate.  I talked to her once or twice when I was there and she was super sweet and accommodating, and even had breakfast treats out each morning!  I had some issues getting in due to inclement weather, and she was quick to communicate, and even refunded me a night because I literally could not get there from the airport. She could not have been nicer about the whole situation! &lt;BR /&gt;&lt;BR /&gt;My bedroom was super clean and private and smelled amazing.  I think that bed is literally the most comfortable bed I\&#39;ve ever slept in.  Seriously, haha.  &lt;BR /&gt;She has a key-code security system that makes it super easy to come and go, which I loved. &lt;BR /&gt;&lt;BR /&gt;The surrounding area is very nice and beautiful just like her home!  Pretty secluded, but I loved the nature and surroundings on my drive to and from the house.&lt;BR /&gt;&lt;BR /&gt;I highly recommend Elissa\&#39;s place!  I will definitely be staying with her again when I go out to visit my family again! :) &#39;),(&#39;5b79a25e-c857-4708-874f-c26610661ca9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;52d726db-2427-40ca-a5f0-d5c117625d1c&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;This was such a phenomenal experience. Jay and Jessica were such wonderful hosts- responsive, welcoming, friendly- and the place is just amazing. Beautiful neighborhood, the cottage is awesome-  can\&#39;t say enough good things. We will definitely be back!&#39;),(&#39;5be9ecc8-1655-4ba9-9147-5ec5fde307b4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0675a2d6-f64c-4be7-9a8a-f55341f09d4b&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;If you\&#39;re looking for a cozy and lived-in space, this is the room for you!  The room is very clean and well decorated.  Our hosts traveled a lot too so you\&#39;ll get to see all the cool travel memorabilia. It was awesome to see some stuffs from when they traveled to my hometown! Hosts are quick to respond to questions, very friendly and welcoming.  They even gave me a tour of the space and the rooftop with a phenomenal view.  Parking can be an issue but there are some tips in their notes. We took Lyft everywhere which is quick and cheap because we\&#39;re in the center of everything. There are tons of stores right around the corner of this building and a 7-Eleven a couple steps away for anything you might need. I would highly recommend this place!&#39;),(&#39;5c109cf5-fb36-40cf-b572-8620b536fcac&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9c5a1e44-0090-464b-ac3b-89e0f65cc6e1&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Place is very affordable which is great for travelers. Communal kitchen was also handy, but kind of cramped. &lt;BR /&gt;Overall super friendly vibe and though it\&#39;s located up a steep hill that\&#39;s further than is worth it to walk, the bus stops only a couple blocks away. &#39;),(&#39;5c21cdff-2110-416b-a30f-6afa70e22b0f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e74201c2-6057-419d-be22-d0087eeb4179&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;I stayed upstairs which was basically a combined open living area and sleeping area that led out to the balcony. While there was no closed off private space, I was the only one in this area so to me it felt pretty private and I enjoyed the space. As for the rest of the house, there were many other people staying, but most of the time no one was ever in the common areas so it felt like no one was around. I think this is a good affordable place to stay for solo travelers. Sherry has a good heart and took care to ensure a comfortable stay throughout!&#39;),(&#39;5c5167cb-b82d-4079-b205-8bceb68c412b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0d10682b-5bd4-4fde-9427-0067fe6ff63c&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;Robin\&#39;s place was nice for our quick stay in Birmingham. It was a good location, a nice room, and was just what we needed. I\&#39;d gladly stay again.&#39;),(&#39;5c735cce-9731-48f7-aaae-db369e9f3698&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b6ea25aa-f298-4f24-bc8c-526439f254d5&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;It\&#39;s an awesome place! Safe and quiet neighborhood, beautiful house. Recommended! &#39;),(&#39;5ccfa509-d904-40b8-bb0f-c64b24c7a5d3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8835ba11-7757-45c6-9138-f7e2e4b5f80f&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;It\&#39;s on a small cul-de-sac off a small street in a quiet neighborhood. There\&#39;s lots of airflow, but still manages to be very cozy. Listening to the rain at night was lovely. &lt;BR /&gt;Medium walk to the beach, maybe 25 minutes walk to downtown Kailua. &#39;),(&#39;5cf12ed5-6ae2-4e80-b8c7-d2ce95c38448&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;19ae5055-f503-499d-a64f-2bf7d92eff5b&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;I was able to book a very last minute stay for the weekend at Joes place. He is quick to respond and provided very clear, detailed instructions right away. &lt;BR /&gt;&lt;BR /&gt;Dedicated parking space is a massive convenience. Easy lockbox entry. Quiet building. Host is friendly &amp; easy going. Very central location. &#39;),(&#39;5e153086-f746-43d7-ab39-7bf95a1f9705&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9a4d1511-f149-485c-a66b-0ca3fa105ad7&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Super clean and cute. Rachel was very responsive. Would definitely stay there again!&#39;),(&#39;5e477470-91e8-4e3d-b100-7e8adcdc5187&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1014dfdf-fa7a-487c-bba8-2d3076d570dc&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;Although just starting on his Airbnb host journey, Randall has it all worked out. His private suite is perfect in every way. As a veteran airbnb guest and host, I am happy to give Randall my highest praise and report that he provided a great and memorable experience. 10 stars!&#39;),(&#39;5e59b478-deff-48cb-a7a1-0623c7550704&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b5880e7d-c4b7-497e-ac1a-12826327132f&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;The perfect spot! Great location, beautiful, clean, minimalistic interior with crystals &amp; organic products. Jasmine is an awesome host &amp; will make you feel welcome straight away! &#39;),(&#39;5eef6067-f071-4cb9-85c9-a6c409f9f7a3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2b6e6650-5f69-426d-a084-71f7ad30d1f1&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Nathalie\&#39;s place in Kailua was perfect for a quiet weekend with my wife. We spent our time walking the long white beach (only 1 block from the house) and dining at all the fun places in town (also within walking distance). The place was clean, quiet, and communication with Nathalie was easy peasy. I would wholeheartedly recommend a stay for peace, relaxation, and a taste of the laid back Kailua lifestyle. &#39;),(&#39;5f652959-451d-4270-aa32-00a295149672&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a12e6da9-0797-4445-9626-d5f0fa5ed775&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;We rented this place because we were attending a funeral in Birmingham. It was really the closest to Birmingham we could find in our price range and that wouldn\&#39;t be out of the way for the interment, which was in Montevallo. If we were only going to be in Birmingham, it was a bit far. But if you\&#39;re travelling to Montevallo for any reason, this place is perfect. It\&#39;s tucked away up on a wooded hill and there is a lot of space. It was just the two of us and we could have brought the entire family (not that we wanted to do that). The place is furnished well and there are coffee supplies and bottled water in the kitchen. It was cold the two nights we were there and the furnace seems to heat a bit unevenly but there are a couple of space heaters which made up for that quite nicely and my husband and I were warm. We had a little trouble deciding on our sleeping arrangements - the first night we slept separately in the two ground level bedrooms which have full size beds, and the second night &#39;),(&#39;5f972264-a8ee-426a-9d07-7411913e1d4f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;02d9a2b5-7dca-423f-8406-707bc76abf7e&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;This is a comfortable charming home uniquely decorated-each room i different The facilities were clean, warm and up to date. {effect for a congenial group to relax between exploratory adventures in Bisbee. Our hosts provided a generous breakfast and refrigerator full of drinks and fruit and yogurt, we really did not need to go out for breakfast. the beds  were comfortable and cozy. And we enjoyed meeting our hosts who  greeted us an d provided answers to all our questions and suggestions for dining and sightseeing.&#39;),(&#39;5fa2f28a-4e7b-414d-a639-228b8b8063ce&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ae787938-171f-4563-8c75-92a037fed415&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Richard and Hannah are delightful hosts. They have created a comfy and welcoming get away. &#39;),(&#39;604b8cc7-b53b-4906-919b-1501838b9b5c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3827c1d1-14d5-4643-a24b-3dca656192fa&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;Chantal\&#39;s place was extremely clean and very nicely decorated. The bed was comfortable and the room was quiet. We had everything we needed, and our hosts were sweet and helpful. Would definitely recommend! &#39;),(&#39;60bcaff9-d346-4e28-a144-11c8469b9596&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;acd9cdca-855e-484b-baf9-ffda99d945f2&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Cindy\&#39;s place is wonderful! It has an incredibly warm and comfy atmosphere and had everything we needed for a weekend away. I brought a large group of college students for a staff retreat and it was the perfect get-a-way for us to rest and relax, and it is really close to the mountains which allows for some fun adventures too. Cindy was an amazing host (and her homemade cookies are really delicious!). I would highly recommend this home!&#39;),(&#39;60d304f1-ca2c-4a20-a1da-5d9b64cdfbf3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3ebfaf23-cede-4cf0-964d-8afc17b11d02&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;I was blown away by Jan and Charlie\&#39;s stellar hosting before I even arrived at their place in Jackson -- they were so communicative and focused on making sure I\&#39;d be comfortable. Once I arrived, the experience somehow got even better: the cottage is wonderful, and every detail seems to have been considered and taken care of. I enjoyed sitting on the porch in one of the rocking chairs and reading, talking to Jan, and just taking in the lovely courtyard. This is Southern hospitality at its absolute finest: if you have the chance to stay here, don\&#39;t pass it up!&#39;),(&#39;60ecfaa2-fa86-4ba5-8491-be2a7b4e7dcb&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a302bce0-cb8e-4e54-ba2b-0822b0565303&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Loved the hilltop view but wow what a climb to get there! the windows and porch gave such a panoramic view. Liked the comfortable bed, good wifi access, and the opportunity to get laundry done.&#39;),(&#39;613edd6c-f7d7-4932-94b9-06ac7cacb93b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;31568a3f-d5b1-47d1-b2ee-74339059e3a0&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Great property   good location And a great owner...&#39;),(&#39;6147263f-4c32-44c0-853d-4ced2f03a31e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bb86e624-9ecb-4aca-a713-8