e to welcome us when we arrived, brought us freshly baked cookies, and offered many good suggestions for sightseeing, exploring, and eating.  The Roost was the perfect size and setting, in addition to being well-supplied with things we needed.  We all loved being together and checking out the immediate area and beyond.  The younger grandkids especially loved watching the trains go by, and the older ones had a great time at the Renaissance Festival, the old mine site, hiking, and a couple of museums in Phoenix.  We highly recommend the Roost and are now enjoying the memories we made there.&#39;),(&#39;6500d73f-13a0-46fa-8a8c-0cbd2ab685d6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d72f839c-9390-4085-9d39-b45144c9c3c8&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Easy to get to, peaceful setting, lovely animals!&#39;),(&#39;6562086c-0245-4e20-81de-b0ed89e271f6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;09b4888f-0e06-4ab1-abbc-05e9865634d0&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39;This space was awesome! My wife and I came up for our anniversary and this space was perfect. It was private, comfortable, VERY clean, and had a lot of surprise amenities. We wish we could have stayed longer. This is definitely a favorite for whenever we return to Baton Rouge.&#39;),(&#39;657c4a25-e848-4f67-95f4-fd369099d881&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e6c33577-5de3-4481-9147-47ef4710b986&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;Joanna and her husband are extremely kind.&lt;BR /&gt;&lt;BR /&gt;We arrived late and they were waiting for us (they knew we didn\&#39;t have internet connection for communications.)&lt;BR /&gt;&lt;BR /&gt;Our room was big and we were able to sleep with windows open. There is no external noise whatsoever. &lt;BR /&gt;&lt;BR /&gt;Their home is about 20-25 min from the airport. I suggest to avoid taking the highway after office hours. You risk to get stuck in traffic for quite a bit.&lt;BR /&gt;&lt;BR /&gt;Definitely I will return to Joanna\&#39;s place on my next trip to O\&#39;hau.&lt;BR /&gt;&lt;BR /&gt;Mahalo,&lt;BR /&gt;Davide &amp; Ben.&#39;),(&#39;65a9ba6f-ec8d-4892-9c43-176afc01615d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b4a927e4-9715-4cd2-9918-47491f97df3e&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Deb and Doug\&#39;s place is beautful, clean and well furnished. They are super nice and we enjoyed our stay there, thanks a lot for being such a wonderful host.&#39;),(&#39;65b61798-2953-4cca-8a4a-6074912f42c8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;df2548db-377d-422e-b805-4e8e0c794302&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;This was our first Airbnb and it was phenomenal. Our host was very accommodating and inviting. The room was very quiet and calming with a beautiful view over Birmingham. Our host was out of town the weekend we came, but went out of his way to stop by and assure we were well settled. It was overall an amazing experience and we plan to stay here again if we are ever in the area.&#39;),(&#39;661fc74e-034b-474b-9ce6-46b0e73e6a38&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3c702a05-81f1-450e-b07f-386ae8a3b124&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;Amazing place! Very convenient if you are in Napa for a night out. Host are very nice, polite and approachable. &#39;),(&#39;669f4e43-9c7b-4e52-90f6-3c0918685c0c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1014dfdf-fa7a-487c-bba8-2d3076d570dc&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;This one, by far, one of the best listings I\&#39;ve had the pleasure of staying in. Randall was an excellent host and communicated often, even asking if I needed any specific groceries. The studio is exquisite: it\&#39;s decorated very well and has far more amenities than some 5-star hotels I\&#39;ve stayed in. The infrared sauna was a treat; nothing like sweating out the toxins after traveling all day! And then there\&#39;s the amazing shower (and yes, there\&#39;s a deep, jetted tub for those of you who prefer long baths). He offered many toiletries for my use, even Origins masks, which I splurged on and used two. The bed was comfortable and the rugs that are on the floor are nice and soft; bring slippers or socks if you get cold feet, though, as most of the floors are not carpeted. The Nespresso machine was a treat (I could even make my own foam for a cappucino!) and Randall left snacks and drinks in the fridge. If you\&#39;re looking for a ..&#39;),(&#39;676871ad-0beb-494e-8b6b-d0c6336c7a16&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b4a927e4-9715-4cd2-9918-47491f97df3e&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;We HIGHLY recommend this Airbnb!!!!!! Deb and Doug\&#39;s lovely home was the perfect start to our romantic anniversary getaway.  The room feels very private and cozy with a luxurious bed and sleek bathroom. They thought of absolutely everything and more - from extra toiletries, bottled water, and a wine fridge to 2 for 1 winery coupons. Free coffee and tea. The jacuzzi tub was a perfect way to relax after a day of wine tasting. Downtown is a 5 minute drive away and all the wineries are an easy, beautiful drive. Deb and Doug were available for anything we needed yet respected our privacy. We had a great time getting to know them and their adorable kitties. &#39;),(&#39;6792305b-6166-452e-a664-2f893364eb2b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3290a4ef-4241-4fa5-843e-87926c74e384&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;Great place, sweet dog, cool dude&#39;),(&#39;67f261ff-cc1a-402d-b1a9-d20b41ba5cf7&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9c5a1e44-0090-464b-ac3b-89e0f65cc6e1&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Unrealistically amazing in every way shape and form. The yin to my yang. Jk. Its legit folks. Peace! &#39;),(&#39;685de83b-3859-4b31-9349-ad6d62d8f2df&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;836bea96-c22d-46d2-9335-b97cec4cc30a&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Ellen is an excellent hostess and is very thoughtful in her preparations. She is easily available thru the messaging system on Air BnB. Her home is inviting, beautiful, and comfortable. We  would recommend her home to others. &#39;),(&#39;68c8ec29-b15d-401a-88b5-09afe91b34fd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7eceb696-213d-42cf-a58d-fa2e47cfdada&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;David was kind and welcoming. His place is very spacious and comforting for a solo traveler or many people. Would definitely recommend!!&#39;),(&#39;68f35c4b-05ae-45b8-ac6d-6bd10d7236d6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d72f839c-9390-4085-9d39-b45144c9c3c8&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;The cabin is nice enough and the surrounding desert is beautiful, but be sure to pack like you will be camping. We didn\&#39;t have electricity on the second day and couldn\&#39;t use any of the kitchen appliances to prepare food. The road into the ranch crosses a riverbed, and you will want to have a high-clearance vehicle during and after inclement weather (and maybe at other times as well; we were there during a rainy spell). There is plenty of opportunity to spend time outside, but we didn\&#39;t find a terribly conducive spot. It\&#39;s difficult to move through the river bottom near the ranch, so hiking is somewhat limited except along the road. Lots of wildlife though and definitely a quiet place to pause and reflect.  &#39;),(&#39;68f6b461-8e34-474f-9359-d1b900fb3423&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b13b1a74-3a12-4f00-8c19-273cbedc0eaa&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;Juan\&#39;s place is a great place in the heart of Bisbee. If you want to know what it\&#39;s like to live in Bisbee, this is the place! There are tons of stairs, so be prepared (but that\&#39;s how houses are built there). Parking is very tricky. You have to go up this narrow, steep, cobblestone road. Best to do it with a spotter. But if you can commit to parking and then walking for the rest of your trip, it\&#39;s worth it. The house itself is very nice. It\&#39;s clean and comfortable. The outdoor patio is awesome! We really enjoyed our stay. &#39;),(&#39;691f655f-dbd4-4b4a-a593-c8810092bfb5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8c2f2c57-a172-4689-a070-cbb4cd456c5c&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Michael was a great host - he extended my last minute request and the place was kept clean. &#39;),(&#39;694269a9-d7d4-488f-877f-c8cdc38d6c36&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;62e75faa-d265-4ca1-a009-1e06f1d6ab14&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;Great view of Chicago, nice apartment.  Elli was a great host &#39;),(&#39;6aa650c7-ee55-445d-ac0f-5e346f23ead5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;32945f6e-5a96-4233-b8ae-048d51323d7b&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;you will be happy to stay with Belle. Lovely premises and very helpful.&#39;),(&#39;6ac36161-a9b4-4c9f-9d33-16dabc5ae737&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b7a46879-c82a-46d9-9ea9-43cbefca2f81&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;I loved Barbara\&#39;s cozy cottage. It was perfect for during my long conference weekend in Eugene. Every time I thought, \&quot;I wish there was…\&quot; I found it! The cottage is just the right size for one person or a couple. The kitchenette was especially handy and well stocked with gear and basic food supplies. Even though the cottage is located in a pretty adjoining garden to the back of the house, it felt very private. There’s even a small secluded patio near the cottage entrance that would be lovely to use in nice weather. I also appreciated that the main house was decorated with little white lights – that made it easy to identify where to turn when coming back in the dark. Great job from a fellow Airbnb host and traveler.&#39;),(&#39;6af9152c-e0d7-41fb-95be-b5bfa5bcf432&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e990e07f-1b6f-4bc5-a553-ddddad30211b&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Really enjoyed our stay.  Loved sitting out on the front porch enjoying the nice weather we had during our visit to Birmingham.  Thanks Suzy&#39;),(&#39;6b368c27-5a44-4e9e-a18a-ef3418e2ccfc&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b493f8ca-c5d2-414a-9441-6cd4dcebcd36&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;This place was perfect! Close to everything with an amazing view. Was a very comfortable stay and had everything you needed. &#39;),(&#39;6b9a2d63-6645-45c6-ac84-23cbd7aa73f1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;598218ba-5069-450d-afe1-1e3212c378d4&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Berry and Megan\&#39;s place is awesome! Coming home to their bed after being in the parks all day was the best part! Very clean and modern house, and their two little puppies are the cutest! &#39;),(&#39;6bd2d8b2-2e01-442f-a1f8-197e0c80aa15&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;dbdc349b-a195-474f-9856-dbe01d08c331&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;Jimmy was a great and considerate host!  A bottle of water was provided in the bedroom and the lights left on at night for me when I came back late.  House and neighborhood were very quiet with quick access to main roads by car.&#39;),(&#39;6c309270-1741-472a-8195-a0f172f6fe8a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;921cd471-9e69-4214-a1f0-014a0a378327&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;Amazing place&#39;),(&#39;6c6bd604-aab9-46cc-97fc-0021ec220921&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;38f1bc75-713e-4f09-b02f-d26a4c43ac63&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;5  stars &#39;),(&#39;6c779c6f-b1b2-4160-a1b2-005c8ff03306&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;02d9a2b5-7dca-423f-8406-707bc76abf7e&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;I was happy to return to The Lynn House for my second stay. Always a pleasure! &#39;),(&#39;6d87469a-3e33-43f5-b66e-36c933a358ae&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;52d726db-2427-40ca-a5f0-d5c117625d1c&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Jay is a superb host. He was quick to respond to all questions and offered us many helpful recommendations to ensure we experienced the best Napa has to offer. The house is just as described and photographed. Features we especially appreciated: off street parking, washer/dryer (with detergent, etc), comfortable, clean and modern furnishings, Keyless entry. Had the weather been better we would have taken advantage of the walk to downtown and cute, private patio. &#39;),(&#39;6de35cd6-5a30-4b74-9fc9-4a1baa8659da&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d72f839c-9390-4085-9d39-b45144c9c3c8&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;The guest house was exactly what me and a friend were looking for, the price is very reasonable and the scenery is phenomenal. If you enjoy stargazing there is zero light pollution, every constellation was as clear as could be. &lt;BR /&gt;&lt;BR /&gt;There were several very friendly cats that loved to visit us, one caught us a moth and left it at the doorstep as a gift. &lt;BR /&gt;&lt;BR /&gt;The description is very accurate, don\&#39;t expect to have a 5-star hotel, just a perfect little home base to lie your head and look at the stars through the window, or curl up with a good book.&lt;BR /&gt;&lt;BR /&gt;Though we didn\&#39;t bring anything perishable we were pleasantly surprised to find a mini fridge inside in case you have something small that needs to be refrigerated.&lt;BR /&gt;&lt;BR /&gt;Hope to visit again some day, had a very good experience.&#39;),(&#39;6e71f02c-3ee0-4d06-9983-3ee8f1eaa014&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;78ca76e7-78dc-4867-8281-50ab3dc47cdd&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Excellent space and host.&#39;),(&#39;6e84d081-3424-4b68-b354-552936293df3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e979e012-bcb1-47ea-bb39-140cdfe0f917&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;We stayed at Clay\&#39;s place while attending a conference at the University of Oregon. Clay\&#39;s place is located in a quiet residential neighbourhood, check-in was simple, bed was very comfortable, lots of privacy, parking spot, and all necessary amenities. Would stay here again!&#39;),(&#39;6e8f99bb-5311-48ec-8b77-80156c46cfe6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a12e6da9-0797-4445-9626-d5f0fa5ed775&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;We enjoyed our stay at Terry and Sarah\&#39;s place. It was our son\&#39;s birthday and we arrived to find that our hosts had left us lots of little goodies (cookies, fruit, coffee etc) which was an unexpected delight! The property is wooded and very beautiful to walk around on. It is also very near to a couple of parks which was great for us. Oak Mountain State Park is also a short drive away. We would definitely stay at terry and Sarah\&#39;s place again!&#39;),(&#39;6ec2c15c-57f1-4fcf-8632-874314959e3e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;14e9cb05-e188-4e02-ab2c-8ef425e5ea64&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Donna was very flexible and communicated well. She allows your privacy but is friendly and social and respects your wishes either way. I had a need for ironing my shirts and she went out of her way to purchase an ironing board for my needs on her own. The Location couldn\&#39;t be any better from a geography standpoint and like le the quaint Location near a public park and restaurants. &#39;),(&#39;6ef01cb4-72a3-44bf-8e0f-f740988f7f59&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;47b9ca37-915d-405d-861d-7dbf74559441&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Carmenita is very nice. She has a very nice home. I would recommend a stay here. It\&#39;s not the closest to the city but you could catch a Lyft and be under $20. The stay is the basement of her house. There are no windows in the bedroom part so keep that in mind. I only stayed for a day but I would come back to her home again. *Bonus points for her huge jacuzzi bath tub. &#39;),(&#39;6f35bbf2-54e2-451f-8aa2-59ef9cdbcd60&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bcda6018-7286-4d8c-abfa-dda1026adf88&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Winnie\&#39;s place was exactly as advertised! Cannot wait to come back to Sonoma - would stay with Winnie again!&#39;),(&#39;6f83f1fa-c7e8-4502-9653-26ef6b909b41&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;02d9a2b5-7dca-423f-8406-707bc76abf7e&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;Irene is a relaxed and did extra as a perfect host&lt;BR /&gt;&lt;BR /&gt;Everything was tip top and comfy&#39;),(&#39;6f9044f1-aaac-48fe-9942-6b414beb11e6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e551a4a6-7701-41de-be62-aae869888c78&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Laura\&#39;s home is in a safe, friendly, residential neighbourhood close to Bradley University. She keeps her home to a really high standard and is well prepared for guests. The house is lovely and her dog is sweet and friendly, and our room was spacious, comfortable and nicely decorated. Laura was easy to communicate with and helpful, and we enjoyed our stay in her home. &#39;),(&#39;6fea0981-112a-4145-92ad-560b0ef99eb9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;207f5bf6-d1de-4cca-a60d-c2c48e93debc&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;Great house with so much character. Jim went over and beyond what was expected. I\&#39;m a tennis coach and brought my 9 year old and 7 year to compete in a tennis tournament in Meridian. We cooked  meals and enjoyed the house as much as our busy scheduled allowed. Jim\&#39;s house is going to be a real winner on airbnb. I was coaching 8 other families who all over paid for hotels in Meridian and when they saw the room my family had they were extremely jealous. I\&#39;ve stayed in Airbnb\&#39;s all over the world as a professional tennis coach and this was by far the most historic and unique stay I\&#39;ve had. It was also my wife\&#39;s first stay in an airbnb and she was a little apprehensive at first. It took no time for her to get hooked. Glad to know when we travel as a family all of us will pick airbnb! Thanks Jim!&#39;),(&#39;7015b240-bf1a-4d5b-b551-e773746a858d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;c29b5191-ac68-4e9b-a68f-aa42ea1dcb01&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;If you ever wanted to be in the heart of a very artsy-gentrification area, this is it--along with a chance to see a community WW II Victory Garden and have coffee and schmooze just down the street from Cayla\&#39;s home-studio-bnb. This is a VINTAGE BUNGALOW with some lovely updates. &#39;),(&#39;70d14c8d-bd56-4ec7-b5ad-a2d8af745ba7&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;cff8a023-eacb-4a38-a24f-a01fe9ddde18&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Cara\&#39;s place was perfect for my husband, me, and our 1.5-year-old daughter. She loved running around the yard and eating on the patio. Cara was thoughtful to set out a child\&#39;s table and chairs, and my daughter loved it. We loved pulling her to the beach every morning in the red wagon. Easy driving distance to Whole Foods and great eating options.&#39;),(&#39;70e49dc8-082f-4b43-9b80-3f9eb01c86dd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7a958fb6-a203-441c-9f8f-3440523fed14&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Thank you so much for being an amazing host! You were very accommodating and lovely! Thank you so much for making my first Air BNB experience a great one &#39;),(&#39;70f1f649-5745-48be-930d-a8390473920d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4929d198-149e-437b-b4a1-3ae1ec0044c2&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Very clean, good location! Six minutes to anything you need. House is decorated beautifully. &#39;),(&#39;70f8dd89-7969-4d24-b383-043968b4f5e6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bb86e624-9ecb-4aca-a713-8cd6984f25a0&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Great place!&#39;),(&#39;7182005c-41ce-4250-b545-d92457ad4750&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;60b77ea7-04c9-4b8a-b835-dc92c6aa196b&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;We loved this cottage! Great location and amenities.....bikes, beach towels, etc. The hosts are lovely and we really appreciated their attention to detail. Mahalo!!&#39;),(&#39;722e1968-590e-48b4-a1c1-fe10222de0b1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;daa15c1b-9ca6-4042-85fd-bdb7a46d5862&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;Quiet and clean place. Fast and helpful response from Mike. He completely leaves you alone which was great (at least for me).&lt;BR /&gt;&lt;BR /&gt;Definitely will be back when I am back in Saint Paul area.&#39;),(&#39;72f668bd-48ab-4a54-abd7-87b2d5cece45&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1ff1963c-7afa-470c-bc05-562b01549b09&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;We loved our stay at Hanan\&#39;s! We were able to rest and recharge after a long day of traveling. The beds are so comfy and the backyard is beautiful! The space was clean and the decor made it feel so homey. We loved the bathroom! Hanan was a wonderful host and made sure we had everything we needed. We could not have asked for a better experience for our first Airbnb stay!&#39;),(&#39;737d52de-b347-4552-980a-6181b1c50fac&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;18ff54e2-dc10-4e7f-bfdb-8a7591f7f009&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Travis was a great host. Super easy to get in and out. Very accommodating!&#39;),(&#39;73cf9194-9b58-4bbd-9bc1-644cb8b3815d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9a4d1511-f149-485c-a66b-0ca3fa105ad7&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Cute house. Great host. &#39;),(&#39;744f0bd0-c64a-47fb-9cb4-4cf297f1c3d1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3827c1d1-14d5-4643-a24b-3dca656192fa&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;Chantal\&#39;s place was really convenient for me location wise as I had both dinner and an interview nearby. Even though I did not get to meet her she had sent me directions to her home, parking info and wifi password before I got to her place. The room I got was very comfortable and the best thing was having a private bathroom for my use. If her place wasn\&#39;t booked for the next day I would have stayed longer. For the price I think this place is a steal.&#39;),(&#39;7455c99a-b6d0-440c-ab57-2232968fde98&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b2c8a4cd-6e80-48c3-a1fc-07f129ee2875&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Our stay at Jesse\&#39;s place was amazing and oh so relaxing. &lt;BR /&gt;&lt;BR /&gt;The home was spotless, decor was tasteful with a fun vibe and was stocked with the necessities (thanks for all the k cups!)&lt;BR /&gt;&lt;BR /&gt;The home has beautiful views and a huge deck off the master bedroom, comfy king size bed, whirlpool tub, enormous steam shower ... incredibly romantic. &lt;BR /&gt;&lt;BR /&gt;Thanks for the hospitality! We will be back. &lt;BR /&gt;&#39;),(&#39;74d7db3c-0b4f-468b-a04a-14f9470f9213&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4929d198-149e-437b-b4a1-3ae1ec0044c2&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;Great place to stay. Looks much better than in the pictures. Located close to everything in Tupelo. Quiet. Fast internet. Host was quick to respond. I would stay here a again.&#39;),(&#39;75393bf6-aad5-4918-93ca-7662358e18be&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;921cd471-9e69-4214-a1f0-014a0a378327&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Great experience...would definitely stay again!&#39;),(&#39;75fad29e-25d9-4900-b60c-fd6e79129c5c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3c702a05-81f1-450e-b07f-386ae8a3b124&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Friendly hosts and awesome location. Thanks for having us!&#39;),(&#39;7620823e-8fbe-4bb4-9c66-c81d0434c65b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e990e07f-1b6f-4bc5-a553-ddddad30211b&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39; Susie was easy to work with. The kitchen was the best part of the home. &#39;),(&#39;76294b5d-1fed-4946-ae33-789f7a231f97&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;921cd471-9e69-4214-a1f0-014a0a378327&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;We had a great stay at Tom\&#39;s! He was very friendly and great at communicating. His place is beautiful and very clean and well equipped for guests. I would definitely recommend this location if you\&#39;re ever in the area!&#39;),(&#39;765f24a2-43ad-4ae4-8e01-c62febcedd18&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8fba447b-e04f-41c5-a730-848ef02758a9&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;The apartment was so spacious and very comfortable furniture and bed.  Amanda and her husband were very friendly and welcoming.  It was very private, safe and I felt at home.  It has everything you need.  I can\&#39;t wait to get back there!&#39;),(&#39;7677f3cd-6adb-43a3-bdb8-6c5d92923899&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;aaf389be-c794-4fb4-a6cf-619ca956898f&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;Our stay here was fantastic. Melanie was an amazing host and the place was just perfect. I can\&#39;t say enough good things about it. I would highly recommend it to anyone.&#39;),(&#39;77359d40-cf27-4a7d-9c3c-ddf0576f0f6c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;78ca76e7-78dc-4867-8281-50ab3dc47cdd&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;This space is super cute and secluded. I loved that the kitchen had everything we needed to cook a little meal with a short walk to the local safeway. The area was very quiet and the space was neat and tidy!&#39;),(&#39;7744d0ba-9caf-4ae2-9402-0a8e0347d753&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4929d198-149e-437b-b4a1-3ae1ec0044c2&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Our family of 5 fit very comfortably in this home. Great location, modern and cool decor, super comfortable beds and an awesome couch! Everything we needed was available and Austin was quick to answer any questions we had. Easy check in and check out. My 8 year old was ready to stay permanently, the whole family felt the same way! We definitely hope to stay here again.&#39;),(&#39;7752e7e3-87a3-4487-94b7-822105515307&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;695c0586-3345-4b15-bcf7-f5ecbae258e1&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Clean and quiet! Had some confusion about what days we were staying so we were caught off guard by the cleaner, but they were very accommodating and friendly while sorting out the confusion. &#39;),(&#39;77638eff-cb65-4c9f-bc7b-e49127421acc&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8c2f2c57-a172-4689-a070-cbb4cd456c5c&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;nice place to stay at.&#39;),(&#39;77fdcfc3-7e24-44f0-a58a-4f2d23a0fc2b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b6ea25aa-f298-4f24-bc8c-526439f254d5&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;I\&#39;m 19 years old and travelled alone to Chicago for the first time and I would highly recommend staying here. Super close to downtown and every tourist spot was no more than 10-15 minutes away. I never felt unsafe here. The people are lovely company, as well as the animals. You really get a bang for your buck here!&#39;),(&#39;78388983-b5a5-47af-8ebd-e7f005540831&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;279b355e-ff9a-4b85-8114-6db7ad2a4cd2&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Perfect for our one night stay in New Orleans. Clean &amp; comfortable. &#39;),(&#39;7840b739-a1b3-4505-9341-4afa9be60e54&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b180ad52-fe00-4040-97f9-9efdfc3d406d&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;Dee and Harry were absolutely wonderful and so was their RV! It was cozy and cute and the best night of sleep I\&#39;ve had yet in Oregon. Best Airbnb experience I\&#39;ve had yet.&#39;),(&#39;785bc9e8-c092-42a9-bbeb-bdfe9f375f76&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7eceb696-213d-42cf-a58d-fa2e47cfdada&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;I would have given this room a 5-star review but another guest watching a movie at a loud volume from 2:30-4:00 in the morning was extremely disappointing. My wife and I had to wake up at 4:30 for an early morning event. Both of us had trouble sleeping because of the loud movie. I, in fact, never got back to sleep. Everything David, the host, did and provided was fine. The room was clean and warm. David was very polite, welcoming, and accommodating. The other guest\&#39;s thoughtlessness, in contrast, was infuriating.&#39;),(&#39;78c727ed-9c43-470d-a06f-d9fbb845424a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3ebfaf23-cede-4cf0-964d-8afc17b11d02&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;I have stayed in several Airbnb\&#39;s and this has to be one of my favorites. Jan &amp; Charlie are great hosts and very welcoming. The cottage is truly cute with no detail missing. Outdoor areas are also cozy. &#39;),(&#39;7924b617-d9e4-48bb-b383-654b85b27eb5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;610ef600-53da-4e05-aaaf-b7ae4d14fcfb&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Lauren was an awesome host. Very easy to communicate with and get a hold of! The location of the apartment is in an excellent location. Lots of bars and restaurants within walking distance, and if you wanted to venture off of Grand Ave, an uber is within $6-$12. We had a great time! &#39;),(&#39;79f37547-25b4-4b1f-b37d-19e83e1cdeda&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;be89d2ce-231e-4205-a8c1-e6bcf5990302&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39; Great value for your dollar. College living situation.   Right next to intimate local shopping district and green rail.  Would definitely recommend to a friend.  &#39;),(&#39;79f3da69-af19-48c9-b8cf-1680fac48849&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d37d7e5a-d186-45a0-a190-c065ff5922e8&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Beautiful, unique, space for four with a kitchen required to cook on-site.  Very comfortable and cozy&#39;),(&#39;7a2200c1-dd66-419f-8a98-c7c922af3c55&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;84f6227b-6c97-47ff-9ede-d4fbf4994d23&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Janna and Kendall\&#39;s place is spacious and cozy, a perfect spot for for my brief visit to Eugene. I\&#39;ve stayed in a lot of airbnbs in Eugene, and this is one of my favorites.&#39;),(&#39;7ac72c82-8a2b-4cbd-a230-818ee6eba90c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e2d4feeb-4cb0-4df4-a10e-5a54748621b3&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;Excellent bnb experience.  Warm, energetic hosts, nice room and spacious, comfortable living room, excellent country breakfasts, fun interchanges with hosts--couldn\&#39;t ask for more.  We\&#39;ll be back.\n&lt;BR /&gt;\n&lt;BR /&gt;Chris and Valerie&#39;),(&#39;7b38230e-ff40-415c-9c3a-f45bea0717bc&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8c2f2c57-a172-4689-a070-cbb4cd456c5c&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Host was friendly. Provided towels, toiletries, iron, hairdryer, wi-fi code, offered me water. The room was clean, no-frills, comfortable bed. There are a few other rooms in the same hallway, with other guest(s) sharing the bathroom. I decided at the last minute to attend a conference in Silicon Valley, so this was a good value alternative to hotels that were running peak pricing at the time.&#39;),(&#39;7b50151a-7e2a-4303-a01e-de4b777af3eb&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6a78ec0c-8410-4cbf-a915-e697a3aa798d&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Rafael\&#39;s place is uniquely cool. The little compound is ideallic and our room was great! The king sized bed was comfortable and the room spacious. We enjoyed the use of the canoe and the hammock room. The security of the gate and room combination locks made it feel very safe. &#39;),(&#39;7bd4713a-5a81-492b-9d50-4e631473008c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b4d6d884-e50d-41eb-9b97-6395a07a43f9&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;Great place. Alex &amp; Bethany were great! Communication before &amp; during our trip was amazing. &#39;),(&#39;7c111822-3b92-4fd6-a605-6dccf7082e8b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7ed82a23-cd4f-437b-be12-9c54e84281ef&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Thoroughly enjoyed our stay. Lovely, welcoming country retreat provides all the comforts of home.&lt;BR /&gt;Beautiful property located in a quiet neighborhood at the end of the street. We sat on the patio each morning and enjoyed our coffee taking in the scenery and sounds of nature. I shared this residence with my parents and adult sibling; plenty of room.  We will definitly stay here again the next time we are in Newton!&#39;),(&#39;7c42151a-c909-4f32-a29c-43c3342f2073&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;be89d2ce-231e-4205-a8c1-e6bcf5990302&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;Comfortable and pleasant house made for a great stay on a quiet residential street. Friendly host.&#39;),(&#39;7c6781f7-02b9-4bb2-8218-9102e652b60e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2b6e6650-5f69-426d-a084-71f7ad30d1f1&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;Everything was just perfect! &#39;),(&#39;7c68b4eb-4e23-48ca-8075-8252f1f810f3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9a4d1511-f149-485c-a66b-0ca3fa105ad7&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Rachel was the great hostess. She was so helpful and attentive during our stay. Highly recommend this cottage for you your next trip to Lafayette. &#39;),(&#39;7c6fd6cd-6c31-4e3f-8a9d-54dc156ee8a1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0675a2d6-f64c-4be7-9a8a-f55341f09d4b&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Sofia was a great host, very accommodating. The studio was very comfy and right the in the perfect location.&#39;),(&#39;7cecf326-474f-4647-9f61-d451a1815a0c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b4d6d884-e50d-41eb-9b97-6395a07a43f9&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;Had a great stay at Alex\&#39;s place. He was away on business but his wife was around and very nice. We got in late so didn\&#39;t have much contact, but everything was as advertised. &#39;),(&#39;7d79bf7a-9171-4fdd-bd99-e327900723f4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;96233d68-319e-4ae0-a20f-3af55dcadb0a&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;Very good &#39;),(&#39;7d871add-468c-4069-a3ae-fc8653313763&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bc227cc3-0ad7-4b9a-b72a-6c2a45e6a88a&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;We had a great time! It wasn\&#39;t too far and we spent the afternoon outside at the park which was close and lovely. The communication was great and everything we needed was there. Thanks!&#39;),(&#39;7e016919-dd81-487b-b6e4-b6f0ca38183c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;19ae5055-f503-499d-a64f-2bf7d92eff5b&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Was a very quaint, cozy apartment. Not far from downtown with a parking spot(thank god). Neighbors were very friendly and helpful. Very peaceful and quite with a little view of a couple downtown buildings.&#39;),(&#39;7e91e901-1168-4c0b-9651-1f73c4dec758&#39;,&#