-759cafbbad00&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a12e6da9-0797-4445-9626-d5f0fa5ed775&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Nice place to stay that\&#39;s an easy car ride to Montevallo. Quiet and comfortable. Terry and Sarah are good hosts. The cereal, milk, fruit and coffee were much appreciated!!!!!&#39;),(&#39;8101bda1-66c7-4321-b00b-2faa0c131a1b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e58517c1-3214-465f-a982-78208a3266c0&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;The host canceled this reservation the day before arrival. This is an automated posting.&#39;),(&#39;811be8bc-3fae-4d10-b6ce-756760e992a5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ffcc9c22-759e-4418-b788-81eda89c2865&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Beautiful neighborhood, amazing hosts, they went above and beyond to help me navigate the city. Wonderful people! I will stay there again if I am in town!&#39;),(&#39;8134f2f3-5ac5-44e5-ab6f-64d7812e72e8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3c7eb6bc-a146-4186-bfbf-9de857286e68&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Our stay at the Opera House was a great experience from the moment we booked. Frank and Naomi gave us detailed directions and advice on how to navigate the very tight streets leading up to the house (they don\&#39;t show up on GPS). Frank was there to greet us and guide us into the parking area (where the car sat untouched for the remainder of the stay), and show us around the house. Naomi called a bit later to make sure all was well. Once settled in we found the house to be very clean, cozy and inviting. While this is a 100+ year old house, it appears to have been renovated recently. Plenty of room in the dresser and closet to unpack. The office sized water cooler was a thoughtful amenity in a dry climate. We loved getting up in the morning, making a pot of coffee (great local roast provided), and enjoying a cup or two on the front porch, in the sun, overlooking the town and the view beyond. The downtown is a short walk from the house, either directly down the stairs, or down the road. As &#39;),(&#39;813bae8a-b49e-4c3b-abb4-ec6d78d3c923&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8fba447b-e04f-41c5-a730-848ef02758a9&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Fantastic.  So happy I get o come back!&#39;),(&#39;817fda18-eff6-43a7-ac2b-33d3918073a4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e990e07f-1b6f-4bc5-a553-ddddad30211b&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Four of us stayed a couple days for work. The house is clean, safe and comfortable. Much better than a hotel. Thanks Suzy.&#39;),(&#39;8291fdb3-3717-4dfe-97cb-1e1bc12151d7&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;78ca76e7-78dc-4867-8281-50ab3dc47cdd&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;Consistent and excellent, every trip. &#39;),(&#39;82a72de8-b45f-4477-8925-69e07d01b8d9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b4a927e4-9715-4cd2-9918-47491f97df3e&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Doug and Deb were incredibly friendly from the get go. They are very knowledgable about the area and have great suggestions for food and wine.. Would definitely stay there again given such wonderful hospitality &#39;),(&#39;82e06396-00d6-402c-ab66-1abbecc37953&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e58517c1-3214-465f-a982-78208a3266c0&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Pam is amazing! Very hospitable and friendly. Home is perfect for small group with large kitchen. Making plans to go back!&#39;),(&#39;82e79f85-e149-43b6-b46c-00668d2d5d2d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;832b0d5e-b00b-40fb-b640-cddd0aa0ce82&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Kat was a very hospitable host and went above and beyond our expectations! She constantly gave us great suggestions to make our trip the most memorable. Her apartment was walkable to the town square where restaurants and wine tastings are. The apartment was very clean and well kept. She provided bikes to enhance our traveling experience around Sonoma. It felt like staying with a friend! Would definitely recommend staying here and booking again!&#39;),(&#39;82fe96de-778b-4b85-bea4-d84686ffdbea&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;38e38612-a626-47a9-a699-05efa178e155&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Great place. Easy going and comfortable&#39;),(&#39;83832f78-359f-4710-8e7d-20d91e60eb93&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;c29b5191-ac68-4e9b-a68f-aa42ea1dcb01&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Caylas place was great, very clean and close to downtown.&#39;),(&#39;83871780-1d84-4f1b-b66c-b69e5755d7bf&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;c29b5191-ac68-4e9b-a68f-aa42ea1dcb01&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Seriously comfortable and well-decorated. Very clean! Cayla accepted out request to stay here just a few hours before we were even in Lafayette which was really great. The bed is comfy and the room is accomodating. Her art is very pleasant and comes in many forms. You can really tell that she cares about her guests and is an altogether good person. Stay here! Don\&#39;t give it a second thought.&#39;),(&#39;84d22759-36f2-429f-8217-0bd7fa265343&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d3fc84bb-8ccd-4457-99a8-91dda88dc64d&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;ok&#39;),(&#39;84e423f6-0105-4c45-88bb-a27a81865057&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a12e6da9-0797-4445-9626-d5f0fa5ed775&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Lovely stay at Windmill Cottage. V quiet and appreciated the snacks and supplies left for me. &lt;BR /&gt;Will definitely stay here again! &#39;),(&#39;8588dd9c-c4b2-40a5-8953-a92b93557b92&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e6e428ae-bc13-4648-9e61-d01672bb5cf6&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Wow!!!!!! This is definitely a favorite of mine. Incredibly central yet private, comfortable and clean, relaxing and beautiful. The pool and the pool side is incredible. From the moment I showed up I was welcomed in and treated so wonderfully. I got to hang out with ricky and his family and friends. Genuinely fantastic people with a talent for creating luxurious, comfortable and beautiful spaces. The neighborhood is great too. Right down the street is fantastic authentic Haitian food! MUAH&#39;),(&#39;85b42b1c-b7a4-46c2-ab94-3327663e8388&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;96233d68-319e-4ae0-a20f-3af55dcadb0a&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;The location is amazing and although the room is small it is the perfect size for a couple. &#39;),(&#39;85e594db-a1c9-4919-af7f-69cf76eecfac&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e6e428ae-bc13-4648-9e61-d01672bb5cf6&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;Ricky\&#39;s place is great! It is beautifully decorated and just as described. It\&#39;s in an upcoming area that is close to everything, and you see the \&quot;two sides\&quot; to Miami in the residential area (coming in from one side vs the other is a huge difference, you see poverty and then extreme wealth). It\&#39;s very safe and private which was great for my partner and I. It is also centrally located to a lot of places (less than 7 miles usually) and we had a car (which is recommended) so we\&#39;re able to go to quiet a few places that Ricky recommended. Great host!&#39;),(&#39;863e74bb-bb7c-4379-92df-350c24be0352&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ad124633-a610-483f-862a-6f54dda19c6e&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;great for a quick stay! accommodating and very clean. &#39;),(&#39;86992fff-e21a-47a0-ba22-cefc5b1c7770&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;09b4888f-0e06-4ab1-abbc-05e9865634d0&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;2nd stay liked so much I booked again  location is great and the host communicate very well&#39;),(&#39;86acf5cc-4d04-49ab-b7bd-007e82e605c8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7b8ecd06-c520-4adc-b2e4-bfaa7f8bab2e&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;We enjoyed staying at this airbnb. Very clean! Parking, communication, &amp; checking was easy. We would\&#39;ve preferred a better mattress. Other than, everything was great!  &#39;),(&#39;86cf9371-1530-43a4-8b37-95ed8b58fc26&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b33cae89-fe4f-4c6e-a1c5-0022450f2bf2&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;Awesome and perfect place to spend our holidays. If you are looking for something away from the crowds and a local experience that is the place to be! Great with kids as well as it\&#39;s just a couple of steps to the beach. Shops in driving distance have all you need. &lt;BR /&gt;Michelle is a great host and always available. Simply awesome! :)&#39;),(&#39;87b8672e-2162-4ba3-badf-311971e56b96&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9684e0c7-0f21-4a00-9334-1a974e13dbc3&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;My husband and I stayed at the airstream for two nights and it was absolutely perfect! So comfortable and relaxing!&#39;),(&#39;883d38e2-6924-45ab-8122-03f79a1d3308&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ae787938-171f-4563-8c75-92a037fed415&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Great location, and value. Highly recommend for ease of access, great host and the home is historic and beautiful. &#39;),(&#39;88e57333-1b30-494e-87a0-b9b8569b8b2d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;478d6061-fc78-40c3-a1b2-0e906fb86da8&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;During my two days stay at Tiger\&#39;s place, I found it great, quiet, comfortable and basic, which is fine for the price range. Bring your own shampoo, hand wash etc.&lt;BR /&gt;Tiger was responsive as while check-in in night, it was too dark to use the lock-box to get the keys but he promptly fixed it next day. The location is good with sufficient street parking and its close to the airport too.&#39;),(&#39;8925764c-4e79-4c06-9c8a-c91af6d8e28d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0675a2d6-f64c-4be7-9a8a-f55341f09d4b&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Sofia was amazing. She kept in communication at all times and was very helpful giving recommendations etc. The location is perfect and the place was very cozy and welcoming. Thank you Sofia! &#39;),(&#39;893b0ce6-5094-42c8-9b9f-51bc1d8ca254&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8fba447b-e04f-41c5-a730-848ef02758a9&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;Amanda and her husband were so nice. I loved staying (URL HIDDEN) was really the perfect place with a rowdy 5 year old. I would definitely stay here again!!&#39;),(&#39;8984fb14-7da0-41c8-b568-7802b9681551&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b56cb489-da79-4028-bcc0-7251324606f0&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;I and my wife stayed in Jim&amp;Maki\&#39;s house for our first travel in Hawaii. They are very nice and their house was great especially for couples. Maki\&#39;s breakfast was perfectly fit for us and really yummy. She cooks only using organic vegis, which makes us healthy in the morning. One day, we got together. Jim let me know how I can cook his secret Steak that was fantastic flavor with red wine. I will never forget our staying with them. If anyone would like to stay in O\&#39;ahu island, I will definitely recommend Jim&amp;Maki\&#39;s house ! Their house is located in the center of island, which is very convenient to drive to any place in the island. The house and room are exactly the same as in photo. We have no problems with laundary, shower, cooking, and so on. Neiborhood is very quite, so that we sleep deeply. Thank U Jim and Maki ! &#39;),(&#39;89f37b0b-2606-4ed3-b8a7-92bafe0de9db&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1014dfdf-fa7a-487c-bba8-2d3076d570dc&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Great space, very clean with ample outdoor space in backyard. Very close to downtown ($6+ Uber). Randall is a great host and very willing to help us find our way around town. Overall a great and carefeee stay!&#39;),(&#39;8a3dc9e6-1031-42ce-8b3e-d17b094b54f2&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e3f28357-a476-4032-8726-4ac7262cbc72&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Jane is a great host, very responsive to messages, provided great tips for enjoying the local area. Their home is in a quiet neighbourhood, 25 mins walk from downtown Napa. &#39;),(&#39;8a5a1555-d524-4919-852e-4460d97fd4b5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3c7eb6bc-a146-4186-bfbf-9de857286e68&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Beautiful views, good value for the rent.&#39;),(&#39;8a824a23-cf8d-4eb2-b3c3-9ba3c2375a25&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0a454f9a-eaac-488b-8443-23cf58f7ae37&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;This place was just the perfect place for my last days. 5 minutes away from the beach and a nice hour costal-drive away from the stunning north shore. Pam sets up everything really lovely. Even if she couldn\&#39;t be there when I arrived - everything was waiting for me: like a bottle of water, local macadamia nuts, and a list of things to know and do.&lt;BR /&gt;The room by the way is just so cute - the nicest one I had on Hawaii so far. And so I even had the best days of sleep here. And I really appreciate Pams flexibility - my flight leaves late, so she welcomes me to stay in the common areas of here house till than. Even if we didn\&#39;t got the chance to chat that much - thank you so much Pam! &#39;),(&#39;8bb0c147-321d-487a-bca3-7e59ea267dc6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9247dcc1-711a-4ab2-b99a-f2808627d2f2&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Amazing stay - if you\&#39;re in town don\&#39;t bother with a hotel. Amazing chef-prepared breakfast (beyond expectations), local tips, stories, history, music, cocktails, etc. Rooms were authentic to the period (antique furnishing) but Very clean. &lt;BR /&gt;&lt;BR /&gt;Price seemed low for everything included - if just a room I\&#39;d say it\&#39;s spot on. Toss in all the extras, I\&#39;d say this place might run all the hotels in the area out of business. This place absolutely made our stay in Layfayette!&lt;BR /&gt;&lt;BR /&gt;&#39;),(&#39;8bd71aa4-5307-4c4b-b6ef-f88e1fb83ceb&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b6ea25aa-f298-4f24-bc8c-526439f254d5&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;Affordable and friendly accommodating hosts. Never met the host because I came in from my drive so late and had to leave so early. signage around the house made everything easy to understand/find, free WiFi! Room was clean, house was inviting and pleasant, bed was probably the most comfortable thing I\&#39;ve slept on in years. 5/5 if youre traveling through Chicago and need a place to stay the night, would absolutely recommend.&#39;),(&#39;8be03683-7249-4766-b476-09e968478faa&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9684e0c7-0f21-4a00-9334-1a974e13dbc3&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Having never stayed in an Airstream before, I wasn\&#39;t quite sure what to expect...Jason could not have been more communicative and helpful. The stay was a pleasure. The Airstream was both cozy and surprisingly spacious. It was very comfortable and there were several restaurants and things to do within walking distance. It was also great to just sit out on the deck and relax. I\&#39;ll definitely be looking for an excuse to return as soon as possible. &#39;),(&#39;8c1ec920-451b-4606-8c99-3f72105070a6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ffcc9c22-759e-4418-b788-81eda89c2865&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39;Very good location. Place is cozy and tidy. Katie and Matthijs are very cool and hospitable people. Will stay again!!&#39;),(&#39;8c3e2273-76fe-428f-a875-e3b94b0a537c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;aaf389be-c794-4fb4-a6cf-619ca956898f&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Wow! The place is well located, clean and well stocked. It was a nice haven! Also, Melanie is a gracious host. Looking forward to returning!&#39;),(&#39;8cc4ed94-2526-48df-b90b-a531304a8c6a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;89ddd0bc-2250-4094-8f6d-59b35c0f6891&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Great location and a wonderful hostess. The grounds are incredible. Close to shopping and restaurants. eclectic but fun decor.&#39;),(&#39;8ccd420f-f519-411e-90e1-3118b456ad81&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;207f5bf6-d1de-4cca-a60d-c2c48e93debc&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;Very nice&#39;),(&#39;8cce530b-cb3b-495d-85c7-4e3896de4f31&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ef3f56b8-c024-471e-b7ba-be1a72c6cbec&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Great location, easy to communicate with the host, exactly as presented. &#39;),(&#39;8d00aec9-6148-44bb-8caa-395e2bd174b5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;38f1bc75-713e-4f09-b02f-d26a4c43ac63&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;A pleasure, as always. &#39;),(&#39;8d0fb9b3-86ed-4de2-9918-c8a3d578e7e2&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;328bd785-a91b-424c-afda-9e08e5155cfe&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Bryan\&#39;s place is cosy and comfortable. Bryan was reachable and very friendly and we had a quiet night at his place.&#39;),(&#39;8d7a3fb6-eaf4-4ec2-8177-57902fd621a0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;daa15c1b-9ca6-4042-85fd-bdb7a46d5862&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;Great downtown St. Paul location! &#39;),(&#39;8e2a8971-5a16-49a0-8dd6-1e19e15f8e42&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3827c1d1-14d5-4643-a24b-3dca656192fa&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Chantal was very nice and friendly. Her place was very clean and cozy. I enjoyed staying there.&#39;),(&#39;8e40bc06-4fbb-49ff-adbf-6f4a6f332e8b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d72f839c-9390-4085-9d39-b45144c9c3c8&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;This place was exactly as described. Very secluded and relaxing.&#39;),(&#39;8e438596-30ef-4ed0-ab13-ab89e20a3d7d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;09b4888f-0e06-4ab1-abbc-05e9865634d0&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Very nice room and great neighborhood ! Love it!&#39;),(&#39;8e7dac8a-c9e7-4414-b5a1-9047b0d48c30&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;31568a3f-d5b1-47d1-b2ee-74339059e3a0&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Our family really enjoyed this place as a nice break from the cookie cutter hotels. It is a real southern house with a big porch and plenty of room inside and out. Old fashioned would probably be the phrase I would use to describe it. We were only passing through but it would be a great place for a retreat or some time away in peace and quiet. The price was very good. We would definitely stay here again if we were in the area! &#39;),(&#39;8e8dfd31-47db-4b36-a4f4-aee0c6f2da10&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8fba447b-e04f-41c5-a730-848ef02758a9&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Very comfortable and accommodating.&#39;),(&#39;8f00ca2c-ce78-40c2-b669-3b1c73d40a81&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;66fb8e5d-2ad2-44be-8890-a13a9992f257&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Great place! Clean, eclectic. Very quiet neighborhood. Close to city. &#39;),(&#39;8f55cb9d-449e-4744-ba0a-f5455fc164c5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e3f28357-a476-4032-8726-4ac7262cbc72&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;My gf and I loved this place, and it was a deal too. Jane was an excellent host: gave great local recs in advance, very friendly all the way through, and totally respected our privacy. This is a bit more than a 1Br/1Ba because the place is outfitted with everything you could want for a short stay (mini fridge, keureg, microwave, toaster oven, and water cooler) and there are TWO step out balconies, one of which is nice and sunny in the morning; so my gf and I enjoyed doing a quick breakfast there before heading out to wineries or wherever. We ended up driving the ~1 mile into downtown Napa the night we did go check it out, but you def could walk. The property is set in a really quiet little suburban section, so very peaceful at night and pretty stars too. We\&#39;ll totally go back.&#39;),(&#39;8fc3809b-7d27-44be-9a8c-ece6526f2064&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b2c8a4cd-6e80-48c3-a1fc-07f129ee2875&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;The house is beautifully decorated, super clean. Very convenient location wise. Absolutely loved every moment of my trip to Birmingham because of this Airbnb experience. &lt;BR /&gt;&#39;),(&#39;900225c3-87a4-496d-93db-245db3342808&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e551a4a6-7701-41de-be62-aae869888c78&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Clean, excellent amenities and plenty of \&quot;extras\&quot;: snacks, lotions, toiletries. Highly recommended! &#39;),(&#39;90acde0e-9783-4b14-b7b6-1b5e6c70e290&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;84f6227b-6c97-47ff-9ede-d4fbf4994d23&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;We loved it!&#39;),(&#39;90d85c99-7569-4cce-a9e6-4d63a53a761d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;aaf389be-c794-4fb4-a6cf-619ca956898f&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;My boyfriend and I stayed here two nights and could not have had a more positive experience! The cottage is quaint and cozy, everything is updated and a perfect space for two. We were very impressed with the small details in the cottage such as a welcome basket with treats and a sweet note, a plethora of fresh towels, updated amenities, and a list of recommendations in the area. We arrived later in the evening - Easy check in was a breeze! The location is great and within a quick distance to the Plaza, Glen Ellen, and only 40 minutes to Napa. We had no issues, but Melanie was just a quick text away. We had such a great experience and will definitely be back. Thank you Melanie for the wonderful getaway in wine country!!&#39;),(&#39;910e4fdd-580a-4dab-9547-7b532f5e5f47&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;89ddd0bc-2250-4094-8f6d-59b35c0f6891&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;This is a gem of a place.  Location is perfect!  A secret stair path to old town shops and yet just far enough away from any late night tourism noise.  Beds are super comfy.  Jen is an exemplary host.  I would not hesitate to stay here again!&#39;),(&#39;912ed230-3f64-4e40-9992-04854c14c81c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;89ddd0bc-2250-4094-8f6d-59b35c0f6891&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Jennifer was an exceptional host and our stay was so good we did not want to leave! We would recommend it strongly to anyone who is visiting Bisbee. We loved it so much we hope to stay again when we come back!&#39;),(&#39;9262023f-1756-4699-b758-a12be1184fb5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bb86e624-9ecb-4aca-a713-8cd6984f25a0&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Lovely private accommodations with kitchenette features, lovely bohemian decor, and close to Sonoma wineries. I was able to uber around vineyards instead of paying for a wine tour which was great! &#39;),(&#39;9291db19-fc25-4dce-9245-ec7c8487d5d0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6a78ec0c-8410-4cbf-a915-e697a3aa798d&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;I was only there for one night but what a great place! &#39;),(&#39;9304b57b-4a1f-4607-b061-a927edf799f4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b7a46879-c82a-46d9-9ea9-43cbefca2f81&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Cozy Cottage. Great place for any traveler to stay. &#39;),(&#39;93a773e4-3a0b-465a-9b90-7c6889f6b0c6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;df2548db-377d-422e-b805-4e8e0c794302&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;I have only Airbnb\&#39;d a few times, but this stay was INCREDIBLE. Kevin was a most gracious host, and an absolute pleasure to get to know. Our arrival was in the wee hours of the morning, but he woke up early and let us in to get settled without complaint. In our time there we were able to hang out with him a fair amount, and he was very helpful in guiding us around Birmingham. He also provided us with coffee and breakfast, which was a super kind gesture. The space was immaculate, from the beds to the bathroom. Impeccably renovated, decorated, and cleaned. Should we make our way back to Birmingham, we will ABSOLUTELY be staying with Kevin, and his sweet little dog Remy!&#39;),(&#39;93fba918-fd6c-4e2e-9dc1-4c41709e3c90&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a16c7358-bf66-4802-8933-1616b5a322db&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Very much enjoyed this cute spot.  Nicely appointed, clean tidy feel.  Highly recommend &#39;),(&#39;94a92bd6-8f1f-4cbb-af83-364ed6f441b9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;52cc10db-af9b-499c-aa8e-670056611a7c&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;If you want plenty of dining options nearby, this is your place!  State street in Fondren has  a great food option for every taste. Met Kelly in person and she\&#39;s great.  Thanks Kelly! &#39;),(&#39;9520fa62-6eb4-4220-b3c3-d7b2244fb22a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e990e07f-1b6f-4bc5-a553-ddddad30211b&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Great home and host! The porch is absolutely wonderful with a great view of downtown Birmingham at night. On a quiet street. Would definitely recommend! &#39;),(&#39;95250535-dcde-48bb-a12f-848df205333f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;daa15c1b-9ca6-4042-85fd-bdb7a46d5862&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Mike\&#39;s apartment is great! Very clean and comfortable! Great location within walking distance to lots of fun bars and restaurants. We had so much fun, would definitely recommend his place to anyone going to St. Paul!&#39;),(&#39;95508e12-2253-4150-9cd5-4261ad56fe0f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;89ddd0bc-2250-4094-8f6d-59b35c0f6891&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;A wonderful experience. Plenty of room for two couples and a baby. Easy walking to restaurants, shops, and landmarks of Old Bisbee. Jen was a wonderful host, and even brought over some of her daughter\&#39;s toys for my daughter to play with when we were there.  We\&#39;ll certainly be back.&#39;),(&#39;9591cafb-932a-4bda-b8b9-fd0792cc355c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d3fc84bb-8ccd-4457-99a8-91dda88dc64d&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Good location, excellent price. Good deal&#39;),(&#39;95935cb0-1d07-45d3-93ed-c66b86744635&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;610ef600-53da-4e05-aaaf-b7ae4d14fcfb&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Loved the location on Grand Ave.&#39;),(&#39;95c15541-bd96-4ab1-9deb-94b05efbcb7c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;dce54621-9083-4cd9-9335-a9e8861289d8&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Perfect crash-pad for a trip to SF. This place is walking distance from just everything, and the restaurant and cafe on the bottom floor are superb.&#39;),(&#39;95dd6a92-88c4-4d6c-8b8d-860656b937e2&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ad124633-a610-483f-862a-6f54dda19c6e&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Lida was a nice host. &lt;BR /&gt;It\&#39;s a cheap place, but it\&#39;s not the biggest one.&lt;BR /&gt;&#39;),(&#39;961cc8cc-2b68-4c03-8288-cd51775dfc1a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;817bcb43-ba39-4925-aed6-76be4bed946b&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;JJ\&#39;s brother, Tom, was a great host. He made our stay at this Bnb very pleasant. Only issue was parking, which was a bit difficult to find, and we had to park a couple of blocks away from the house&#39;),(&#39;963dea2d-abae-47f3-a177-fda7407b8179&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;552b5aaf-33b7-407b-a2dc-459ab730b3a5&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Annie is a great host and the place is brand new. Centrally located and walking distance to a lot of great restaurants and stores. Parkings can be troublesome at times but that\&#39;s similar in any city setting. &#39;),(&#39;96a07a1f-d437-4398-9a31-36241379b972&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;66fb8e5d-2ad2-44be-8890-a13a9992f257&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;My husband and I travelled to Portland for the first time and Naomi\&#39;s house was absolutely wonderful in every way. Located in Beaverton, just a short drive from downtown and the airport, it was a quiet escape nestled on the end of the street in a nice neighborhood. We rented a car, so the drive downtown was super quick and easy but there is public transit as well. The house itself was perfect for us because we like to cook, so the kitchen had everything (and more) that we needed to whip up a meal. There are tons of games and cards to play during a fun night in front of the cozy fireplace. Also, the bed was the most comfortable we\&#39;ve ever slept on, even more than our bed back home. It\&#39;s not often you stay in an airbnb and think, \&#39;gosh, I wish this were my home.\&#39; We would highly recommend Naomi\&#39;s place to anyone looking for a cozy getaway in a beautiful city.&#39;),(&#39;97218304-bb8e-40c0-812c-d264180b2407&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e6c33577-5de3-4481-9147-47ef4710b986&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Joanna and her family are great hosts! We had a very warm welcome and a super stay at their house. We are happy to be back soon! Thank you!&#39;),(&#39;9744f05e-c04b-4578-9941-8af259b2b9f6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;610ef600-53da-4e05-aaaf-b7ae4d14fcfb&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Lauren\&#39;s place is the perfect little apartment for a nice get away in St. Paul! 10/10 would recommend. Thanks for everything! &#39;),(&#39;979cd355-c3a2-41c3-adc2-c3cca6c9e29d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bb86e624-9ecb-4aca-a713-8cd6984f25a0&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Very quiet and easy to get to vineyards&#39;),(&#39;9825ef7d-252e-4c2d-a511-8f315cd13206&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;df2548db-377d-422e-b805-4e8e0c794302&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Kevin was a thoughtful and good host. The room and apartment were very nice and clean! The room is subject to the weather temp, so keep this in mind if visiting during cold or hot seasons! &#39;),(&#39;98328190-4428-473a-9cd2-5269a040f4ad&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6d24beec-f296-473c-a34a-4dd9aab8a780&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Great location and comfortable digs! &#39;),(&#39;98395e5f-654e-4eb0-881e-e4ed73073304&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b6692019-ac4a-47aa-a671-89cd79c9e11f&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Mason was easy to reach and friendly. Our checkin process was very easy. The apartment itself is not near a lot, but it was a short Lyft to downtown where there were lots of bars and restaurants to check out. The apartment has everything you need, was comfortable clean and ready for us. I would recommend staying here, especially if you\&#39;re going to see a concert at Syndicate Lounge like we were! &#39;),(&#39;9853d6c7-6875-4f74-ac6b-628ac114c281&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;328bd785-a91b-424c-afda-9e08e5155cfe&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Bryan was a very nice host and the stay was good. Downtown is a short drive away and you get a lot of recommendations for food.&#39;),(&#39;98ca6ce3-e98d-4d66-a1d7-3aaca65694a0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b6692019-ac4a-47aa-a671-89cd79c9e11f&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;Mason\&#39;s listing was completely accurate. Great place to crash for a night and you cant beat his rate. &#39;),(&#39;991e0172-0884-4ba6-a952-aa512c29c339&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bc227cc3-0ad7-4b9a-b72a-6c2a45e6a88a&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;The hospitality was great. They let us checkin a few hours early because no one stayed there the previous night. Special thanks to them for that. The house is beautiful. The location is safe. We rented the house for 3 nights for a reunion and it was so much fun. Everyone loved the house. I would recommend this to anyone who is looking to rent a house in the suburb. &#39;),(&#39;995bfb29-056d-4f8b-983d-7efbcf10a853&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1ff1963c-7afa-470c-bc05-562b01549b09&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39;Favorite BNB so far :) very comfy, super cute, good location, great host, can keep going on.... would definately recommend for a girls\&#39; trip to Napa! Can accommodate 4--we enjoyed for just 2 and had plenty of space. Hope to visit again!&#39;),(&#39;99b57fd1-5bb5-42e9-80c8-e3200481db26&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4ae40c33-23c9-47a9-b867-0a6d8f25fd8c&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;Barbora\&#39;s place was perfect! She is so awesome. Fast communication and really willing to work with you on check in/check out. Place was perfect!! Very accurate. We loved our stay! &#39;),(&#39;9a3d993f-387a-46d1-a87c-91c5038618bd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;279b355e-ff9a-4b85-8114-6db7ad2a4cd2&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Great value in a great location! This little guest house is a great alternative to paying very high prices for a hotel in this area. Check-in was very easy and we were even able to check in a bit early. It felt private and comfortable and the space was clean. All of the basics were available. The bedding was comfortable and we loved that there were extra pillows. The only minor issue was that there was only one set of towels so one of us had to use a damp towel. It was a very good experience overall and we would both recommend it to others and stay there again. &#39;),(&#39;9abb9a35-9463-4e8f-9888-8b8a8ab703d2&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3ebfaf23-cede-4cf0-964d-8afc17b11d02&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Adorable cottage in a beautiful neighborhood.  Jan was very accommodating and friendly.&#39;),(&#39;9ad7d57f-66fb-4da7-a2f3-5bd2901b2997&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;598218ba-5069-450d-afe1-1e3212c378d4&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Excellent room with comfortable bed &amp; bathroom. Everything was clean and hygienic. Very quite place and i would definitely repeat again. &#39;),(&#39;9aebc996-91bb-4664-8674-1924ca2a7d52&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;18ff54e2-dc10-4e7f-bfdb-8a7591f7f009&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Travis was extremely flexible with my arrival time. Travis and his friend helped get my bags out of the car, and another friend made me a nice beverage. I felt very welcomed. &lt;BR /&gt;&lt;BR /&gt;I enjoyed the comfort of the bed and I guess we got lucky and booked on a weekend where we were the only guests, which was great for us because we did not have to share the bathroom with any other guests.&lt;BR /&gt;&lt;BR /&gt; I would stay again.&#39;),(&#39;9b46cba5-61b2-401e-aec9-1d1fe039d5c8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b13b1a74-3a12-4f00-8c19-273cbedc0eaa&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Great Place.  Great Location.  Loved the patio for morning coffee.  Very well equipped&#39;),(&#39;9b494e60-758f-4a85-803b-759bf694adc8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;645127dd-38b4-4fad-9950-57b3ce0a5301&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Not bad for a quick in and out stay. I was unaware before I got to the house that the only parking options were to take a chance on a parking ticket or park 3 blocks down in the cold and walk back (don\&#39;t forget anything), I took a chance on the parking ticket. The head of the bed had a decline so that your head it tilted backwards and the flat pillows did not help. To bedroom was up against the living room/bedroom and could hear much of the voices and music and feel the bass. As well the only access to the bedroom was through the dining room which the residents were using with friends around 8/9pm and were not regarding any noise concerns.  &#39;),(&#39;9b8a6325-16cf-489f-89ef-9bd5085b8c7e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;14e9cb05-e188-4e02-ab2c-8ef425e5ea64&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Donna accommodated our very last minute request for which we were grateful!  She was welcoming and very responsive.  Our room was comfortable, and the house located near a park, co-op, and coffee shops with easy access.  I recommend Donna and her home.&#39;),(&#39;9b9138e7-188f-4b53-8f9f-9f589a5c079f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e74201c2-6057-419d-be22-d0087eeb4179&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;Very warm welcome. Sherry has helped us in the last minute and offered her beautiful place to stay as our flight has been rescheduled. Big thanks to her and her lovely daughter. &#39;),(&#39;9cdd411e-638d-48ce-8b87-221b8111fba4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;19ae5055-f503-499d-a64f-2bf7d92eff5b&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Great spot, everything as described. Good base for exploring Denver, sleeping in, relaxing. Neighbors seemed friendly. Would definitely stay again.&#39;),(&#39;9ce0ece8-0ee8-47e6-a7a0-5c0b84961796&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;695c0586-3345-4b15-bcf7-f5ecbae258e1&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;This apartment is small but is clean, modern and has everything you would need. The room was a good size and the bed was very comfortable. There were nice finishing touches such as good quality towels and toilet paper. The host was not staying there so we did not meet Veronica but her communication was fine. There are two bedrooms and both are rented out through Air BnB so there was another couple staying there while we were there.&#39;),(&#39;9d346eff-980f-47b0-bb9c-6f11ec6e5a09&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;314b188e-990b-423e-ae63-f0199b8c2b17&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;The spot is so cozy and quiet! We loved the patio and the warm bed. Perfect if you just need a place to sleep or soak up some sun.&#39;),(&#39;9d9a1660-0366-40f4-8ad5-5a0d97d08405&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;552b5aaf-33b7-407b-a2dc-459ab730b3a5&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Annie was an excellent host. She was quick to respond and helpful in her communications. The place was well equipped and she even provided extra toothbrushes, shampoos, and a helpful guidebook. Location can\&#39;t be beat, in the heart of Chinatown, just a couple blocks from the restaurants. &#39;),(&#39;9e876915-5e76-4315-b34d-82183b404e87&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7354ea6c-3c0e-4800-aad8-708c29a6c067&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;We wanted to stay in Ewa and it met all our expectations. &#39;),(&#39;9f0805a8-ee4b-4611-ad4a-4bced38733c5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;73544fd5-d823-4435-b0ce-854f3b2695c4&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Mary Amelia\&#39;s AirBNB exceeded all expectations I had. It\&#39;s a fantastic location and a comfortable space that has been thoughtfully designed. I would gladly stay again.&#39;),(&#39;9f083e8e-d33e-440c-8a86-3ec8fa7b31f4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;af92250e-2f85-4fca-8c04-03029a1b1fad&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Vincent was very accommodating. He made us feel at home. His home is very clean and the bed slept wonderful. We would definitely stay here again!&#39;),(&#39;9f48220f-34e0-4612-8197-c8d32e1c6245&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b7a46879-c82a-46d9-9ea9-43cbefca2f81&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;You Will Not be disappointed in this Very Nice Cottage....&lt;BR /&gt;With All the descriptions Barbara has posted......she left off the Skylights &amp; Ceiling fan!!! &lt;BR /&gt;For Price &amp; Location in Eugene, It Is GREAT!!!&#39;),(&#39;9f5c1bdc-b99a-4aad-b36b-96e50e963691&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;18ff54e2-dc10-4e7f-bfdb-8a7591f7f009&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;Travis is a generous host who knows his city very well, and is willing to spend time to help you learn about the area and get to where you want to go. The room was clean and comfortable, and the kitchen well equipped enough to do some basic cooking, and cleaning up. There is a lovely front porch swing to sit on and chat, or just watch the city. This home near the university is within walking distance of a big beautiful city park that we visited all three days we were in town. We loved the security system on the door because we didn\&#39;t have to worry about carrying an extra key. Dependable off street parking is a plus too.&#39;),(&#39;9f7cf49d-9b8b-4e4f-8b5a-356cd8854201&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1385324e-d727-475c-ad30-f7dcb5afea02&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;The host canceled this reservation 39 days before arrival. This is an automated posting.&#39;),(&#39;a072c086-9245-4868-a215-bb1b71c012dc&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;38f1bc75-713e-4f09-b02f-d26a4c43ac63&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;I will come again&#39;),(&#39;a0c2458b-1bb7-454c-a4d7-1861b73ada04&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8835ba11-7757-45c6-9138-f7e2e4b5f80f&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Nice cozy place to stay near Kailua beach.&lt;BR /&gt;&lt;BR /&gt;Sometimes (SENSITIVE CONTENTS HIDDEN) Maps has difficulty finding the place.  I found the iPhone maps more accurate.&#39;),(&#39;a16fb6fe-96a7-4518-b42e-f9b3a46513ca&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b493f8ca-c5d2-414a-9441-6cd4dcebcd36&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;See &#39;),(&#39;a1c89479-8983-4038-be36-895608883d78&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e979e012-bcb1-47ea-bb39-140cdfe0f917&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Located in a quiet, residential area about 15\&#39; drive to downtown where there are lots of choices for eating or pubbing or seeing a movie. Host has a very well behaved bigger dog who was just as welcoming as Clay!&#39;),(&#39;a1d31adc-2450-4194-b164-c1f141a0b76e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3c7eb6bc-a146-4186-bfbf-9de857286e68&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Great views, clean house, walking distance to just about everything Bisbee has to offer. Can\&#39;t say enough good about Naomi and Frank and there Opera House! &#39;),(&#39;a2301ce4-b9a4-42a9-8113-0b4301e36df6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d3fc84bb-8ccd-4457-99a8-91dda88dc64d&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Good place to stay in the heart of Miami. Close to various events.&#39;),(&#39;a249f110-c2e3-48ed-8e90-14364ea89768&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b493f8ca-c5d2-414a-9441-6cd4dcebcd36&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Melanie\&#39;s suite had everything we needed. The place is cheerful, spacious and comfortable. The huge deck was a major plus! A great place to stay while exploring Bisbee. Thanks Melanie! And Kathy, who was available for us as well!&lt;BR /&gt;Sam &amp; Sara&#39;),(&#39;a24ada0a-8c6c-4cec-9b75-547660cbdc70&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a12e6da9-0797-4445-9626-d5f0fa5ed775&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;This place is delightful. It is exactly as described and so wonderfully secluded. Terry and Sarah were so kind to us, and even left special snacks and toys for our young daughters. I\&#39;d recommend their guest house to anyone traveling, and plan to stay again in the future. &#39;),(&#39;a27f42d2-d833-4ce6-8913-56866fb45593&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e990e07f-1b6f-4bc5-a553-ddddad30211b&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;Great place - we came on a business trip and had plenty of space to work together while being able to have some privacy. Beautiful view of the city at night on a gorgeous porch. Suzy is an easy host to work with and we\&#39;re hoping to be back in BHM soon!&#39;),(&#39;a2fa5e46-4476-4ee7-9eb6-6f0c10d2c008&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;96233d68-319e-4ae0-a20f-3af55dcadb0a&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;Room smelled nice very clean.  Thorough instruction given on how to check in.  Brickell responded to questions in timely manor.  Would definitely stay again.  Thank you.   &#39;),(&#39;a3152321-c654-49ee-a1df-d40649c48e5b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;478d6061-fc78-40c3-a1b2-0e906fb86da8&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;Tiger is awesome. The place was awesome. Would stay there again. &#39;),(&#39;a3439455-add9-46f7-813b-d6bdd4d7c1ac&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3827c1d1-14d5-4643-a24b-3dca656192fa&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Our stay at Chantal and Cortez\&#39;s home was perfect. Great communication with Chantal and we were made to feel at home straight away. I had the best nights sleep in the super cosy bed (it was like sleeping in a cloud!). Would most definitely stay here again!!!!&#39;),(&#39;a371390a-2990-4b42-b06c-7386857a8a09&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0a454f9a-eaac-488b-8443-23cf58f7ae37&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Pam\&#39;s place by far the BEST airbnb experience. Everything exceeded my expectations. The place was very clean, quiet and I felt very safe there. The place is less than 2 mins walk to the beach access. It is located in a very safe residential neighborhood. It was so peaceful and quiet. It was the best. Thank you Pam!&#39;),(&#39;a39f474d-edf9-445b-84a2-cfe0ae2bc772&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b13b1a74-3a12-4f00-8c19-273cbedc0eaa&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Just enough steps to take you off the bustle of Main Street! Juan\&#39;s secluded hideaway is clean,  hospitable, and convenient to Bisbee\&#39;s charms!&#39;),(&#39;a47aa6be-9a28-4d6b-8010-8c3024e46284&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ff46f903-411b-4a16-8e16-1aab7f00686c&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Tiffany &amp; Ryan, Thanks for allowing us to stay at your place in Bisbee! We enjoyed all the amenities from the room, balcony overlooking the city, record room, kitchen and pleasant other guests. We will see you again! Best Wishes!! Barton &amp; Lesle&#39;),(&#39;a49f6a25-dde6-43a2-9cd8-964ff6da48a9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2b6e6650-5f69-426d-a084-71f7ad30d1f1&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Just perfect. Spotlessly clean, charming, thoughtfully appointed, close to everything. And quiet, with just the cooing of the doves to wake you. A completely wonderful experience.&#39;),(&#39;a4c5d230-7ea0-43e5-a17c-9ca2b8f4edf6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4ae40c33-23c9-47a9-b867-0a6d8f25fd8c&#39;,&#39;3ea61b06-e22a-459b-bb96-d900fb8f843a&#39;,&#39;Exactly as advertised. Beautiful little modern studio with panoramic views of the ocean, canal, and city. It even has a view from inside the shower! Would definitely recommend this spot for any couple or solo traveler looking to avoid the big resort scene. Barbora was a great host and very easy to communicate with. No complaints!&#39;),(&#39;a528583b-baa9-4825-a1ed-ab4c318941fd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e6c33577-5de3-4481-9147-47ef4710b986&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;My first time using Air B&amp;B. If you are looking for a place to sleep and friendly chatter in the evening this is the place for you. The hosts are very friendly, even offered me dinner!! Coffee in the morning and did some laundry for me. Wow what a great find! Close to airport and Pearl Harbor &#39;),(&#39;a555c150-329b-490b-9153-900ad387f49f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;30e56424-c0f0-4e36-9523-f5e904bb3142&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;This is a most memorable, delightful place to stay. It was cozy, comfortable, very clean and decorated with a loving, artistic eye. The bed was like a nest. The flat screen TV was a plus, along with lovingly kept chickens and kitties outside. A darling wine train makes a visit just past the fence once (not during the night). Tom and Judy are lovely, welcoming hosts who are very prompt and easy to communicate with. They gave us a great restaurant suggestion as well. It was very close to restaurants and the Uptown Theatre in Napa.&#39;),(&#39;a7324bc4-45f7-43ae-aaf9-1bc680f6d48f&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;98b1678d-d25c-476a-b6c3-c11978617e90&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Very kind, great stay. highly recommended. &#39;),(&#39;a7c41810-4c6e-4d6f-96a4-f7366dd0ef30&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;89ddd0bc-2250-4094-8f6d-59b35c0f6891&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Great place with wonderful light and magical yard. Quiet but two minute walk to Bisbee Main Street. Loved the vinyl records and player.&#39;),(&#39;a7cf3058-b7c4-421a-8c23-4cca07629545&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9247dcc1-711a-4ab2-b99a-f2808627d2f2&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;A nice historic plantation house to stop off on our way to New Orleans! My kids enjoyed the 2 flights of stairs to our room and the creaky sounds. Also, the elf door leading to the bathroom from the hallway and the claw foot tub. The hosts were super friendly, we enjoyed learning about the Cajun\&#39;s natural mosquito repellant and hearing the accordion in the morning at breakfast.&#39;),(&#39;a8863430-4bfb-41a5-bd9a-a6f28048b933&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ffcc9c22-759e-4418-b788-81eda89c2865&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Very clean and comfortable. The hosts are kind and welcoming. As private as could be for a shotgun-style house. About a 15-30min walk to the French Quarter through a pretty and safe residential neighborhood.&#39;),(&#39;a9f706be-6e25-4647-9ea4-d9ab763fb56a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a16c7358-bf66-4802-8933-1616b5a322db&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;This looks even better in person, very quiet, full kitchen and close to shops/ restaurants, highly recommended&#39;),(&#39;aa14468c-ee91-4bbb-9154-8cbb7f9f90c1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b4d6d884-e50d-41eb-9b97-6395a07a43f9&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;We loved staying with Alex and Bethany, they are a very nice and hospitable couple, we felt very warmly welcomed! Their place is a darling wine country home, we had our own room and bathroom right next door. Super clean, detailed. Had everything we needed and more!! Read the house manual and guidelines, they every question answered!! Also like that they are a permitted rental host! They suggested some great restaurants and wineries also, everything was very accessible by uber!! Will definitely stay again next time we are in Napa, hopefully sooner than later! :)&#39;),(&#39;aa573951-535a-4b18-bf0b-b78235bef1ed&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b56cb489-da79-4028-bcc0-7251324606f0&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;Jim and Maki\&#39;s place was great, they are wonderful hosts, they made us feel welcome, and woke up everyday with an excelent breakfast. =P\n&lt;BR /&gt;The place was clean,the beds comfy, and provide us with towels, beach chair, etc.\n&lt;BR /&gt;The location was ok, it\&#39;s an easy drive anywhere. The jacuzzi was always ready to use, clean and with hot water, to relax after a long beach day.\n&lt;BR /&gt;Jim and Maki are beyond friendly and accommodating, which made  our stay exceptional.\n&lt;BR /&gt;It is a great place to stay, and I highly recommend it for anybody.&#39;),(&#39;ab703c89-9254-49ae-b165-a70f837d560e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;66fb8e5d-2ad2-44be-8890-a13a9992f257&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;This house was perfect for us. Very cozy and clean. Quite and secluded. Not far from the center city and filled with decor that fit our style. Would definitely stay here again!!&#39;),(&#39;abc3b836-1e8a-45e8-9cbe-47df570718b0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;f19fa153-154e-440b-9f4b-debee403b0d2&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Kathleen\&#39;s home is in a nice suburban area of Naperville, only about a mile from the downtown area. Kathleen herself is a fantastic hostess and was very easygoing about our stay. We had an odd check-out time (which was one of our main concerns), but she was able to accommodate our exit extremely well. Many Airbnb hosts simply rent out a room, but Kathleen goes above and beyond to make sure the stay was special. She had tidied a bed for us, laid out some snacks, and showed us where everything in her house was for easy access. She made sure we were comfortable, which is something I appreciate in a host. She was also very easy to get along with.&lt;BR /&gt;&lt;BR /&gt;Her house itself was very nicely designed and I thoroughly enjoyed being in that space. It was easy to settle into and she made sure everything is great for her guests. If you\&#39;re looking for a place in the area, I\&#39;m sure Kathleen would be the best option. You won\&#39;t regret it.&#39;),(&#39;ac4e6473-e2cf-4fb3-a68d-16b7b4615e4d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d8a2b39f-6174-4f1f-a14a-561a81cabce2&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;This little place has a beautiful property and is quiet. We enjoyed our stay&#39;),(&#39;ac579759-8c19-4b08-a791-e95845b99ec4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1385324e-d727-475c-ad30-f7dcb5afea02&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;EEverything was very well kept and clean. Definitely would recommend it to others&#39;),(&#39;ac8243c0-5617-489f-b51b-3b75dcc906f5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;5463e312-5bf4-4764-8c06-e97c5548f712&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Megan\&#39;s place was exceptionally clean and well equipped for a nice and restful evening. I was on a bicycle tour and found the room and supplies to be of great benefit for my travel needs. It was also very easy to get to the Natchez Trace across the city from her location. &#39;),(&#39;ace32c8c-80ce-4d6f-a6a6-74fbae919f4a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;71641595-0021-4007-8e89-2bb776cbf6f5&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Beautiful home.  Excellent location downtown.  Laird was a great host.  A+ recommendation if you are staying in Greensboro.&#39;),(&#39;ad3c8800-a32a-45fa-8ab5-2432e10d1259&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b7a46879-c82a-46d9-9ea9-43cbefca2f81&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Barbara\&#39;s place was an absolute pleasure as usual. Cozy and comfortable, just what I needed. Thank you!&#39;),(&#39;af30a889-d727-4599-9f17-f819db43cd0c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ae787938-171f-4563-8c75-92a037fed415&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;Hannah &amp; Richard\&#39;s home was lovely, and the room was very comfortable. I was able to walk to the Historical Society and get back down to the Union depot easily.  Everything was really nice, and Richard and Hannah were very flexible and wonderful hosts!&#39;),(&#39;af6eefb3-26df-48da-81f9-1840e81ee910&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e551a4a6-7701-41de-be62-aae869888c78&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;In one word: HOME. Absolutely would return again. Kind, warm and accommodating. It is a 3 minute walk from where the Peoria Charter drops you off on Bradley University Campus. Super spacious and comfortable bed. Little details count and she did a great job. Snacks and toiletries were provided in very thoughtful way. The key system indicating what is for AIRBNB use is genius. Thank you for the tea... and I can\&#39;t forget to say thank you for letting Chase (the dog) hangout with me. &#39;),(&#39;afd3892d-ea9d-463c-a418-0520aeff9eed&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;dce54621-9083-4cd9-9335-a9e8861289d8&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;Very affordable and in the middle of downtown!&#39;),(&#39;afe2d932-1f8b-4cc2-8e0b-416c891cb80c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;817bcb43-ba39-4925-aed6-76be4bed946b&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Good. Location &lt;BR /&gt;Friendly person, we recommend this place. we friendly persons , the bedroom with all the basic stuff that we needed. &#39;),(&#39;affde9b5-9b54-466c-bd03-ed9f5c081b22&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9a4d1511-f149-485c-a66b-0ca3fa105ad7&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;Rachels place was just perfect.  We enjoyed sitting outside with our coffee and the location to all local attractions was perfect.  I recommend when you\&#39;re visiting Lafayette&#39;),(&#39;b0bdb854-c30e-408d-8d2f-db682a7a29f9&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e74201c2-6057-419d-be22-d0087eeb4179&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Sherry is very nice and her house is comfortable. She is quick to welcome you into her home and offer you anything you need. And her dogs are pretty cool too, especially Buddy. Multiple people stay here for different lengths of time, but everyone is friendly and mostly keep to themselves. I would definitely recommend any of the rooms here to anyone traveling to Oahu. &#39;),(&#39;b0e8c576-4abd-4922-9a03-cae3d05ffa21&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1ff1963c-7afa-470c-bc05-562b01549b09&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;We enjoyed our stay at the Napa apartment. It\&#39;s a bright and clean apartment and the bed was comfy. It\&#39;s close to a lot of restaurants and the drive through Napa Valley. Hanan provided a booklet of information on the local food scene which was perfect and made for easy meal planning. &#39;),(&#39;b13e6e1c-8eac-43b7-a180-2ba4d0acde8e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9c7d3ecd-9592-4910-bd04-91c59e8350f1&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;The pool house was nice, great part of town. Probably awesome in spring/summer!&#39;),(&#39;b15c5cd2-3a6c-4956-bf6e-f1eb8885be1b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8c2f2c57-a172-4689-a070-cbb4cd456c5c&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Great hosts, comfortable home :)&#39;),(&#39;b17e0703-6ad0-4a24-bc5a-b18fc4638e33&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;859a8a8f-9423-4bf6-b471-d9a7f39c9c2c&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Absolutely wonderful place!!! The only bad thing was that we couldn\&#39;t stay longer. Incredible hosts that feel like old friends and the location is beautiful. House is lovely and decorated beautifully- plenty of coffee which is always a good sign (: &#39;),(&#39;b185aaeb-e4b2-4902-b912-7e24b434ebcd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;30e56424-c0f0-4e36-9523-f5e904bb3142&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Great spot! &#39;),(&#39;b1e50c83-ec07-46b7-a4b8-78f8f1bdb318&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;84f6227b-6c97-47ff-9ede-d4fbf4994d23&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Janna and Kendall\&#39;s place is really wonderful.  So comfortable.  I plan to book with them again!&#39;),(&#39;b21669fb-4888-4997-979a-ac44ddf663b4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;552b5aaf-33b7-407b-a2dc-459ab730b3a5&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Annie is the ideal host! Anything you need is either already in the condo, or you could easily pick up from the Walmart around the corner or the Walgreens across the street. Annie was also quick with her replies, and if we had needed her for anything we wouldn\&#39;t have hesitated to ask. Because it\&#39;s downtown, street parking was a no-go, which left us to garage parking. If you played your cards right though, it would only be $8 overnight which was still way cheaper than what we had paid before at Waikiki. Make sure you get food before you head back in for the night as well, considering a majority of the places within walking distance close really early- like 6 pm. All in all, the place was super nice, comfortable, and luxurious, we felt safe the entire time and we would definitely stay there again! &#39;),(&#39;b269ef4c-5c0c-415c-892d-6e301b121ed0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a16c7358-bf66-4802-8933-1616b5a322db&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;what a great experience.  Quinn &amp; Hayden were great.  their home was perfect for our needs and exactly as descirbed.  they were also willing to work with us and a few of our specific needs.  i won\&#39;t even look for other AIRbnb\&#39;s next time i\&#39;m in napa, ill just go straight back to Quinn &amp; Hayden.  Thanks!!!!&#39;),(&#39;b304c98d-f959-47a4-b92e-4e3e7bac25a2&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;be13aa0e-8da7-4943-be05-5fd89f4d18e6&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Reeva was friendly and the room was fine. Only stayed one night and arrived late but all went well!&lt;BR /&gt;&#39;),(&#39;b315a08e-e78b-49ff-85ee-20bbd26a0fa2&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;279b355e-ff9a-4b85-8114-6db7ad2a4cd2&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Great place for our visit to Tulane. The walk to campus was an easy one.  The house was clean and well kept. The bed was especially comfortable. &#39;),(&#39;b39cd939-e7e5-4e6f-8f45-83a7d04046ca&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;daa15c1b-9ca6-4042-85fd-bdb7a46d5862&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;This was a great place to stay! Located in a cool, walkable neighborhood. My only issue was the wireless internet would not connect with any of my devices. There is an Ethernet cable, but unfortunately none of my devices had a port, so it was not very helpful. I did end up exploring some nearby coffee shops as a result since this was a business trip. So this apartment would be ideal if you are looking to \&quot;unplug\&quot; for a little bit. &#39;),(&#39;b3b161b0-9ce5-462c-99ff-7d1803d76039&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4ae40c33-23c9-47a9-b867-0a6d8f25fd8c&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Awesome location! If you\&#39;re ever in Waikiki stay here! You can walk everywhere!!!! The views from the unit are amazing. &#39;),(&#39;b409a961-878c-42df-9cda-aef4392e8308&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4316efa3-0fb1-4aad-87c0-43ef8d3c0376&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;This was my first airbnb experience, and it was an excellent one. My boyfriend and I came here for a laid back anniversary weekend. The setting was lovely and the wine and chocolate was a great touch. The kitchen area was greatly appreciated, as we prefer to be able to cook our breakfasts. The kitchen was nicely stocked with a few pans and even spices (though we brought our own). We did not see the host, however we did see some of the other guests that were staying in different rooms. We were able to come and go as we pleased. The only notable discrepancy I had was the plumbing. The shower would sometimes shut off while in use. It\&#39;s a \&#39;cabin\&#39; of sorts so these types of things are to be expected I feel, so it didn\&#39;t bother me too much. &#39;),(&#39;b44b2000-fae1-45a7-99df-62555b9d2524&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;31568a3f-d5b1-47d1-b2ee-74339059e3a0&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;The cottage is just as it is pictured. If you are looking for a place to step back in time and relax and do some front porch sitting or spend time with your loved ones, this place is fantastic. &lt;BR /&gt;Sharon is very reachable and available to answer any questions.&#39;),(&#39;b455e0e4-1a3d-4190-b525-941c3add628d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7b8ecd06-c520-4adc-b2e4-bfaa7f8bab2e&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;Great place to stay! Very clean and comfy. &#39;),(&#39;b4a5cda2-961d-48a8-9b63-2de5cb8a13a1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6ebec357-8589-435b-a5cb-fcd99b638fae&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Elisa was an amazing host, the room was immaculate and very private, I felt right at home. I can\&#39;t say enough about this experience, she though about everything and went above and beyond. \n&lt;BR /&gt;Truly amazing! &#39;),(&#39;b577df3f-eca8-497e-a95a-bab815fc5860&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;695c0586-3345-4b15-bcf7-f5ecbae258e1&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;We really enjoyed our stay at Veronica\&#39;s space! We arrived at around midnight and found the place without any problem, thanks to the direction that she provided. The bedroom and bathroom was newly renovated, modern, and very clean. We stayed for 3 nights to visit the Universal Studio, and it was easy to get there using app-based transportation. There\&#39;s also bus stops right in front of the apartment complex, but we haven\&#39;t got a chance to try it. Such a great value for what we pay! Thank you Veronica!&#39;),(&#39;b5786b1f-b980-4224-a397-8a51f77d0858&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;98b1678d-d25c-476a-b6c3-c11978617e90&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Great stay&#39;),(&#39;b6648cc9-314f-4ed2-ad47-613a0ea1eacc&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;30e56424-c0f0-4e36-9523-f5e904bb3142&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;Tom and Judy were wonderful hosts! The silver cloud is a perfect place for a couple. They also have a couple additional units within their house! The chicken coop in back, covered seating area, and their sweet cat Jax really added to the experience. Definitely recommend and will be back soon! &lt;BR /&gt;&#39;),(&#39;b72b2fcf-0dc9-4aef-b2f0-733f3aee7f10&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;84f6227b-6c97-47ff-9ede-d4fbf4994d23&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;We really enjoyed our stay! We appreciated how quiet and cozy the cottage was. It was the perfect place to recharge before enjoying all that Eugene has to offer. The hosts were very responsive and helpful.&#39;),(&#39;b7383172-b0d3-4317-a4e7-b8d8dc06370d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;98b1678d-d25c-476a-b6c3-c11978617e90&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Staying with Chris was a great experience. He was flexible and communicative. &#39;),(&#39;b7643adf-91e3-4a87-986d-1146c4362045&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b4d6d884-e50d-41eb-9b97-6395a07a43f9&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39;This place is a great option next time you are staying in Napa. The hosts are friendly, knowledgeable, and recommended one of the best breakfast dinners ever. The room is comfy, clean, and a great attention to detail. They even have a flashlight next to the bed for emergencies. It was a great stay and we would definitely stay again.&#39;),(&#39;b7a56042-8f80-453d-b8c9-94e3903aa65c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;207f5bf6-d1de-4cca-a60d-c2c48e93debc&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;It was a great place to stay. Lots of room and Jim was very nice. Would stay here again without even thinking about it. &#39;),(&#39;b80530d3-6c71-4b6d-ab36-4f8e791fbc6e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;859a8a8f-9423-4bf6-b471-d9a7f39c9c2c&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Great hosts. Made our trip easy!&#39;),(&#39;b8e06e6a-a188-4230-bb02-d2df58ae83dc&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;dbdc349b-a195-474f-9856-dbe01d08c331&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Very accommodating host, room and amenities were clean and functional, would definitely stay again. &#39;),(&#39;b9593356-7fc6-4a30-96c4-30683557dece&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7ed82a23-cd4f-437b-be12-9c54e84281ef&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;I can\&#39;t say enough about this property. My husband and I are frequent airbnbers but only after in-depth study of our needs and hosts offers do I request a booking. Because of this careful matching I usually do tend to come away with favorable reviews.  However, Lynn\&#39;s home surpassed all our expectations in every category. \n&lt;BR /&gt;\n&lt;BR /&gt;Rather than the 2-bedroom I\&#39;d expected, there were actually 3-bedrooms, so perhaps a prior study has been converted, not sure. But all 3 bedrooms were comfortably decorated. The location was in a great part of town at the end of the drive.  A beautiful, thick wooded area looms beyond the back patio and expansive yard. Having left my TX home in a drought w/threat of wildfires, I was most excited on the evenings I could leave the window raised by my bedside to hear the rain and night sounds.\n&lt;BR /&gt;\n&lt;BR /&gt;The house was exceptionally clean and had every house appliance, spice, etc you could ever need. In fact, we found several items recently purchased in fridge and counter top &#39;),(&#39;b9ce1c05-d100-4fe9-8c06-b50f3b8cb7e6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d37d7e5a-d186-45a0-a190-c065ff5922e8&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Denise\&#39;s place was charming.  It was like a BandB. Everything that was needed was supplied.  Her neighbor was friendly and helpful.  We didn\&#39;t meet Denise as she was having fun in the Canary Islands. :)  She left great instructions and responded quickly to any questions.  Alice was there to take care of anything that needed the personal touch.  There were videos, internet, books, games, toys, extra linen, bathroom essentials. It was decorated in a bright cheerful whimsical style.  Bisbee is a fun town to visit and this place is priced great!&#39;),(&#39;b9e70de7-c11f-40dd-823f-bf0eecab1c59&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4316efa3-0fb1-4aad-87c0-43ef8d3c0376&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;It was a cool place. Had a nice kitchen and easy parking on the street. &#39;),(&#39;ba2023bd-0ac1-4a69-bf49-8faaa4ca1669&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e990e07f-1b6f-4bc5-a553-ddddad30211b&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Wonderful home that really helped make our trip. Especially enjoyed the porch! &#39;),(&#39;ba2e63d4-edcb-40d9-bc6c-c59bb80dcf2c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;96fcc267-3257-4260-a264-b3d80639b7c9&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;Susan is so thoughtful and accommodating that guests are made to feel welcome and at home. I would definitely recommend her house to fellow travelers. &#39;),(&#39;ba31fec1-a877-47cc-bac5-82eb5a8bfec7&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;df2548db-377d-422e-b805-4e8e0c794302&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Kevin is an awesome host. He is very accommodating and also has stuff ready for his guests to eat and drink. The welcome packet was a nice touch, especially for a first time airbnb user like myself. The view is unbelievable as well. I really recommend his place!&#39;),(&#39;ba8cc010-8a31-4bfe-8cff-97eeefb1cb3b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b33cae89-fe4f-4c6e-a1c5-0022450f2bf2&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Great place near Honolulu and Ko-Olina. Right next to the beach. Quiet residential neighborhood. Very thoughtful hosts, espcrially appreciated the cold water and beer in the fridge. Highly recommended to those who want to be away from the typical resort experience.&#39;),(&#39;bb4d9640-68a7-4ecf-ba6f-58188fdf3a37&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;dbdc349b-a195-474f-9856-dbe01d08c331&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Jimmy was a wonderful host and the place was comfortable and very close to public transport. &#39;),(&#39;bb5da52c-3936-473d-8d19-efebc743eade&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;60b77ea7-04c9-4b8a-b835-dc92c6aa196b&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;What a lovely little spot in the world! Perfect location shops, restaurants and beach all with in walking distance. Private and homely feeling with extra touches such as bikes, snorkel and beach gear all provided. Josey\&#39;s handy guide book is also very helpful.&#39;),(&#39;bbdb646a-3dc5-4ccf-b175-c96b3e1384d5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;328bd785-a91b-424c-afda-9e08e5155cfe&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;This is our 3rd or 4th time staying at at Bryan\&#39;s place, so obviously we think it\&#39;s great. Also, we found a new great burger place near the location (curbside burger) - it was awesome! &#39;),(&#39;bc155a0f-3076-4d84-addc-bb6ff52b42de&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b6ea25aa-f298-4f24-bc8c-526439f254d5&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;Great little gem in the Windy City! House is decievingly large! Lots of space to stretch out. Definitely feels like home. &#39;),(&#39;bc2461cf-ce95-41f2-a8ef-b03cefff2be3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;598218ba-5069-450d-afe1-1e3212c378d4&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;Berry &amp; Megan are one of the best Airbnb hosts by far during my booking, stay, and communication. I look forward to future visits!&#39;),(&#39;bcc23ff3-aa7c-4013-b36a-535e8e179cea&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;453b0b1c-6bf3-4e94-8265-082ef06ab85f&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;This cottage is great. Well furnished and extremely clean. Great communication with the owners throughout the whole booking process to check in and check out.&lt;BR /&gt;Thy even provided some snacks and breakfast items, which was great. I highly recommend this little cottage.  &#39;),(&#39;bd4c04f2-ab7e-4f8f-80ce-45d041f6fa32&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;47b9ca37-915d-405d-861d-7dbf74559441&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Carmenita\&#39;s house was tucked away into such a sweet neighborhood. She was perfect with communicating, warm and so friendly and open. Her space was extremely clean, comfortable and private. I hope when I return to Birmingham I can return to her house. I felt like I was with family. Thank you Carmenita! &#39;),(&#39;bd660157-68ea-4b27-8b5e-4a4087e34d87&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3290a4ef-4241-4fa5-843e-87926c74e384&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;We needed a place to stay for a quick trip and Carlos was great at communicating with us about our very late check-in time. The neighborhood is amazing and in a very convenient location and we were able to find the house easily as the lights were left on for us. We didn\&#39;t have time to meet Carlos or Beia but we had a very comfortable stay. I would recommend staying here.&#39;),(&#39;bde66dc5-3e42-4493-aded-246c92526147&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;453b0b1c-6bf3-4e94-8265-082ef06ab85f&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;I absolutely loved my stay here. Bruce was very friendly and the cottage was perfect. I couldn\&#39;t have asked for a better stay. It was so peaceful and the bed was extremely comfy!&#39;),(&#39;be39546a-d4ef-4870-acea-500ac27bead1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;52d726db-2427-40ca-a5f0-d5c117625d1c&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;This place was spectacular. Easy walking distance to southern end of downtown Napa. Ample parking near the home if you needed to drive. The home itself is nestled in the back end of the property and so very quiet. Also since it\&#39;s almost brand new, sound proofing and current design specs make the house very well thought-out in terms of features and amenities. I\&#39;m definitely considering staying here again when I come to Napa for the weekend. Mahalo Jay and Jessica for being such awesome guests with such a lovely little cottage. &#39;),(&#39;bee661d0-b53e-4e8b-bc3b-a27d6298d080&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;cb681375-76ad-41d4-ac03-7fe74df9aed3&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Beachwalk Bungalow was an ideal place for our trip to Oahu. Michelle and John were excellent hosts. The location was a quick walk to the beach, as well as other restaurants and shops. The Bungalow had all the amenities you would need (coffee maker, towels, beach chairs and even a baby crib). Kailua is definitely a great laid back town!&#39;),(&#39;bf6bda2c-1c72-44fe-8fab-7754824cf4f8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d991f849-0f2f-41cb-b6d7-41feee6bc943&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;It was a good trip &#39;),(&#39;bf7f6758-190e-4d2c-b3d9-c64b32f6d25e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ad124633-a610-483f-862a-6f54dda19c6e&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;I\&#39;ve stayed here twice.  Solid location, comfortable, friendly hosts.&#39;),(&#39;bff75b8e-e4cf-4400-90ea-3d0ac0819058&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8835ba11-7757-45c6-9138-f7e2e4b5f80f&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Jordan\&#39;s place was exactly what I was looking for in my stay in Kailua. Having a bicycle was great for getting around town.&#39;),(&#39;c0311a61-4337-4c33-a9d9-b7a139afeb16&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;38e38612-a626-47a9-a699-05efa178e155&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39; War ok&lt;BR /&gt;&#39;),(&#39;c10068e3-c90e-4be8-aaf3-74756f877ed3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;c29b5191-ac68-4e9b-a68f-aa42ea1dcb01&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;This place is enjoyably eclectic with the owner\&#39;s art adorning the walls. The house was clean and the bed was comfortable. The location is close to good eating and a variety of clubs in downtown Lafayette. I was in town for a travel seminar after which I walked the few blocks to a really cool beer garden. This place is a gem!&#39;),(&#39;c102485d-59a0-4a3d-814b-ef0335fb8e1d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9c7d3ecd-9592-4910-bd04-91c59e8350f1&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Very cute cottage off of a main house in downtown Tupelo. Great location if you want to be near to the downtown and arena. &#39;),(&#39;c13c8f6a-d86e-451a-925e-93cd7c8ed9d0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;817bcb43-ba39-4925-aed6-76be4bed946b&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;JJs place did the job. He\&#39;s a great communicator and we had no issues with the reservation, finding the place or getting in. Warm and cozy room, right next to the bathroom. 10/10 would recommend.&#39;),(&#39;c18dfc28-d7d4-48b5-a789-694fd80eefc1&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;38f1bc75-713e-4f09-b02f-d26a4c43ac63&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;It\&#39;s always a pleasure to stay at this house.&#39;),(&#39;c2334a6d-801b-4d04-828d-da93960540e5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;453b0b1c-6bf3-4e94-8265-082ef06ab85f&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Wonderful experience. Would highly recommend. &#39;),(&#39;c23df279-1d36-4b0f-81f7-fbb9a51c68af&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;921cd471-9e69-4214-a1f0-014a0a378327&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;Will definitely keep this option in mind for the next trip to the area.&#39;),(&#39;c2791d90-4c55-4d32-b821-7ec07819a4a0&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e58517c1-3214-465f-a982-78208a3266c0&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Great homey place!  We will come again!&#39;),(&#39;c32c330b-87d1-4b86-9b06-4d1ff77c9aaf&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9c7d3ecd-9592-4910-bd04-91c59e8350f1&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Quaint little pool house in a quiet, historic neighborhood. Very close to restaurants and shopping. Chris was responsive to messages and made sure we had an enjoyable stay!&#39;),(&#39;c35f29e3-c808-4eb7-97b4-b4af1a5aaca6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bcda6018-7286-4d8c-abfa-dda1026adf88&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;The cottage was a perfect hidden gem! Half-way between Sonoma Plaza and Glen Ellen, the location was great! We appreciated that the home was tucked away from the street providing some privacy. Winnie provided great local recommendations and the home is exactly as pictured and described. We would definitely recommend it to friends!&#39;),(&#39;c38e224a-1bf9-4ccd-a521-dcc8a1631283&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3c702a05-81f1-450e-b07f-386ae8a3b124&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Great location very convenient location close to the heart of Downtown Napa&#39;),(&#39;c4173657-5395-4c84-b0e5-de4ef984d9db&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;598218ba-5069-450d-afe1-1e3212c378d4&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;Both Berry and Megan are nice, friendly people. Their home is absolutely lovely and we had a very comfortable stay.&#39;),(&#39;c4580172-13c1-46e2-91e0-f904348f4cf4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;31568a3f-d5b1-47d1-b2ee-74339059e3a0&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;This is a great house in a really quiet location and it is 