#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7a958fb6-a203-441c-9f8f-3440523fed14&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;The host canceled this reservation 44 days before arrival. This is an automated posting.&#39;),(&#39;c865cec7-9e40-4f29-9687-992f34ebfbaa&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d991f849-0f2f-41cb-b6d7-41feee6bc943&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Parking was not great limited space.  &#39;),(&#39;c86edab4-a60e-4075-8fc6-408739d5d0e5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ffcc9c22-759e-4418-b788-81eda89c2865&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;I recommend this place a lot! The bed is wonderful and the hosts are super nice and easy going! They making you feel like home right away! A quiet area for being in a great location in New Orleans :D totally awesome &#39;),(&#39;c8855762-7d62-40ec-8f48-b6c531143a35&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Emily was a great host! She was very accommodating and always prompt to answer any questions we had. Thank you for making us feel right at home! Look forward to staying again in the future!&#39;),(&#39;c89b3636-393e-46df-81ad-1469ed364000&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d27f17eb-3ddd-44c0-9e8a-f3c21d933b3b&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;We had a great stay at Sandra\&#39;s and Val\&#39;s place. They\&#39;re great hosts. Everything was very clean and nice. It was easy to get to the Universal Studios from there. I can just recommend to stay there. Thanks Sandra &amp; Val for the great stay! &#39;),(&#39;c8c844e2-bc3f-4f55-8b87-7051c7880036&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3c7eb6bc-a146-4186-bfbf-9de857286e68&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;Bisbee and the night at Naomi and Frank\&#39;s was the serendipitous high-light of our Arizona trip.  We were driving for home in NM and stopped in Tombstone (interesting, kitchsy, don\&#39;t need to do it again) and on the advice of our tour guide decided to swing into Bisbee.  &lt;BR /&gt;&lt;BR /&gt;Boy, are we glad we did.  We will come back.  &lt;BR /&gt;&lt;BR /&gt;Some Airbnb research yielded Naomi and Franks place.  Had everything we were looking for and some we didn\&#39;t know about.  &lt;BR /&gt;&lt;BR /&gt;Space for three, wi-fi, a beautiful Bisbee view.  &lt;BR /&gt;&lt;BR /&gt;What we didn\&#39;t know was how great it was that it had convenient off street parking. &lt;BR /&gt;&lt;BR /&gt;Naomi called just minutes after our booking went through and gave us check-in information.  &lt;BR /&gt;&lt;BR /&gt;Frank met us at the turn in to the house and escorted us to their lovely space.  &lt;BR /&gt;&lt;BR /&gt;The place was just perfect.  Well furnished, spotlessly clean. Beds comfortable (with extra pillows that we appreciate).&#39;),(&#39;c8e07ad6-da02-46a7-9d3f-cd11dee25965&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;acd9cdca-855e-484b-baf9-ffda99d945f2&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;The house was amazing! We arrived later than expected but I was able to get in the house with just a code. Cindy and don were very helpful and I will definitely make this trip happen again. &#39;),(&#39;ca018781-aaa7-48e1-a03c-be521311d8c8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7a958fb6-a203-441c-9f8f-3440523fed14&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Good location to mass transit, affordable&#39;),(&#39;ca72c975-f4b1-4960-a331-326fc49ed42e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b33cae89-fe4f-4c6e-a1c5-0022450f2bf2&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Michelle\&#39;s place was excellent. The location is in a local area without the tourist noise. The beach you have access to is perfect for watching the sunrise or a quick swim. Michelle herself is very friendly and clearly takes pride in being an Airbnb host. Lots of little extras are available in the space (water, snacks coal for the BBQ etc), we really enjoyed the banana pancake mix provided :)&lt;BR /&gt;&lt;BR /&gt;So glad we stayed and got to experience a quiet local neighborhood! Highly recommended!&#39;),(&#39;cb4b40c3-b6bc-44d8-8331-c9a3d7c7a77c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;be13aa0e-8da7-4943-be05-5fd89f4d18e6&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Very welcoming and good communication. Good place to just come and rest.&#39;),(&#39;cc627078-548e-43c8-b0b4-78d5f0c05b45&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e6c33577-5de3-4481-9147-47ef4710b986&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Joanna and family were terrific hosts - they made us feel right at home! Mahalo!&#39;),(&#39;cd05876a-b853-4d67-a060-01738a10d93c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;02d9a2b5-7dca-423f-8406-707bc76abf7e&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;My boyfriend and I had a wonderful stay at Irene\&#39;s place. Her house is so uniquely beautiful and she makes you feel right at home as soon as you walk through the door. Her house was clean, tidy, filled with art, equipped with comfortable beds and couches, and she even provides a delicious breakfast for you in the morning. We are already looking forward to planning a trip back!&#39;),(&#39;cd5d8465-f19e-42db-b9d2-66910f4083b6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9684e0c7-0f21-4a00-9334-1a974e13dbc3&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;The super quaint vintage Airstream was a lot of fun to stay in and way bigger than I expected (Two of us comfortably stayed here). If the weather is good be sure to open the windows and enjoy the fresh air (They and the door have bug screens!). The local beer in the fridge was a nice touch! The location is super close to downtown and easy to get about Lafayette. BUT the biggest asset here is our host, Jason. He is friendly, helpful, very responsive, and overall a fantastic host. He also knows the city quite well if you need a recommendation, is a professional photog, and a musician (He\&#39;s probably got more skills but we were only there two nights). All in all, a very positive experience/trip.&#39;),(&#39;cd66bb7c-0539-4740-94b7-528115a151dd&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a16c7358-bf66-4802-8933-1616b5a322db&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Great little spot for 1-2 people in Napa! Cozy studio was clean and looked just like the photos. It\&#39;s tiny but just what you need for a weekend in Napa! The hosts were great and left a bottle of wine which was wonderful upon arrival. &#39;),(&#39;cd76125f-f66e-4f31-9c01-b92f0e6a7297&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;f19fa153-154e-440b-9f4b-debee403b0d2&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;Wonderful experience staying here! Her home was beautifully decorated and i especially loved her bathroom! We will definitely be back if we are back in chicago again soon. &#39;),(&#39;cdebafc1-7837-4aa5-8a4f-0e53dd44b34e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;dce54621-9083-4cd9-9335-a9e8861289d8&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;It is an easy place, if you want to be close to the central area and you need only a small Uber to go everywhere. The price was my main reason. to choose. It was really clean the room and I would go there again.&#39;),(&#39;cedc6b48-f999-49ba-b920-a6c38ac309f6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1ff1963c-7afa-470c-bc05-562b01549b09&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#