 home is in a beautiful upmarket neighborhood and is very nice. I would definitely recommend staying here.&#39;),(&#39;d3ce5820-b74a-48de-a483-033341c3f9df&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d27f17eb-3ddd-44c0-9e8a-f3c21d933b3b&#39;,&#39;3fda0d5c-fea4-4920-bc91-6e6c6663d161&#39;,&#39;Home is clean, good facilities, comfortable bed and hosts are friendly. It is treated like a hostel, so the hosts are not around aside from check-in or to clean. Strange having a full service kitchen but being unable to use it, although this is mentioned in the listing. The location, although most likely safe, is very residential and not confidence inspiring for tourists, especially those reliant on public transport. Paper is also requested to not be flushed down the toilet and to be placed in a bin instead in the shared bathroom, which is both strange and uncomfortable.&#39;),(&#39;d405b479-8895-4dca-a9b7-5fb00654c4e5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;52d726db-2427-40ca-a5f0-d5c117625d1c&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Just as listed. Jay was a great host to my in-laws and they had a fantastic time. &#39;),(&#39;d41ea0a5-32a3-49c9-819b-2e20de71bcca&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;207f5bf6-d1de-4cca-a60d-c2c48e93debc&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;Beautiful old southern home, very spacious accommodations including private lounge, separate bedroom large bath and kitchenette.  Close to downtown, private &amp; secure.  &#39;),(&#39;d458ae89-2c7e-4007-a7e2-df6c8e4a1b5e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;52cc10db-af9b-499c-aa8e-670056611a7c&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;This place is a great place to stay at a fantastic value! &#39;),(&#39;d51a0d8c-b860-4d08-8f17-3074a3754e17&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9247dcc1-711a-4ab2-b99a-f2808