cess. The neighbourhood was great and only 10min walk to the beautiful \&#39;river walk\&#39;.&lt;BR /&gt;&lt;BR /&gt;If I am in Naperville again, I will most definitely book here again.&#39;),(&#39;d7d788ff-a1f0-4580-b259-254d9cb3cc09&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b6692019-ac4a-47aa-a671-89cd79c9e11f&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Great place, would stay again!&#39;),(&#39;d81e9dc5-7789-43e9-825a-baf283efd646&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;7354ea6c-3c0e-4800-aad8-708c29a6c067&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;This is a good place for students and backpackers as there are other guests who stayed there as well. The room has a bed and bathroom is separate which is common to other guests. Location is away from main tourists area. &#39;),(&#39;d84c1288-b717-4e7b-bd83-5e993a7442bb&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;695c0586-3345-4b15-bcf7-f5ecbae258e1&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Great customer service. &#39;),(&#39;d85b26d0-d8b7-4eea-9d45-76d0dd9f6f69&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6f59f0c7-f3f6-419f-9a8c-9d998a3b681c&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Beautiful place that I wish we could\&#39;ve enjoyed a little longer. Daniel is friendly and hospitable. Took great care of my husband and I. &#39;),(&#39;d8a9a980-f01d-4bc6-aa29-4f3cf72cb559&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;19ae5055-f503-499d-a64f-2bf7d92eff5b&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Great location. Comfortable. Just what we needed. &#39;),(&#39;d8fdde05-202c-4ce8-8661-4a768f424f79&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b2c8a4cd-6e80-48c3-a1fc-07f129ee2875&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;Good place and great host.&#39;),(&#39;d9b78c3b-ab7a-4476-a5aa-