are spectacular.  Just as a heads up, the bathroom does not close completely and the shower head is low.  For me it was fine, but difficult for my taller friend to shower comfortably.  &#39;),(&#39;dcbf7676-46fc-4261-8f24-99202312bd9d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d37d7e5a-d186-45a0-a190-c065ff5922e8&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;Wow, where to begin.....First of all, we had an wonderful stay at a spot - on place to stay. I am pretty picky and realistic when it comes to experiences like this and I can say with sincere conviction that I felt as if this was a custom-made house stay for me, my wife and our beloved pooch. The house is funky, upbeat, colorful as advertised in a unique town in a unique spot accessible to all that we desired. Surprisingly quiet, tranquil, a genuinely friendly neighbor Linda, we loved the fenced in front and back yards for our dog (he is very picky too and seemed at home immediately!). The bed was comfy, the shower nice and hot (important for me!), after all our adventures we were able to relax in the living room as if it was our own and watch an obscure movie on Netflix, great wifi, great cell phone reception (who would think in the middle of a copper mine??). We didn\&#39;t do any cooking, but were tempted by the gas stove, and did enjoy the comfort of fresh ground coffee because how did t&#39;),(&#39;dcc77ae5-fb82-4314-bc4b-3db267bd5ac6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;daa15c1b-9ca6-4042-85fd-bdb7a46d5862&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;Mike\&#39;s place was perfect for our short trip to the cities. Clean, comfortable, and the perfect distance to restaurants and the Xcel Energy Center!&#39;),(&#39;dd4f2ff1-1385-4fec-8d32-f0b11d85bb49&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;43803445-1874-4a3c-94e9-955fcb25089b&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;This place is so 