476a-b6c3-c11978617e90&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;Chris was wonderful and a very gracious host. &#39;),(&#39;e04394ac-b7c2-49d8-b4d7-5e73a531e497&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d37d7e5a-d186-45a0-a190-c065ff5922e8&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;We stayed here for the weekend so we could explore both Bisbee and Tombstone. We chose Bisbee as there were more vegetarian dining options for us, than in Tombstone. Glad we did as Bisbee is a fun and friendly little place and was the perfect base. We were also glad we stayed outside of Old Bisbee, as it can be fairly noisy in the evening. Denise\&#39;s place is a short drive away and offered us a quiet spot to leave our crated dog while we ate out and enjoyed tours that were not dog-friendly. We also had no qualms about walking our dog around the neighborhood in the dark. The house itself is quirky and well-equipped, plus we appreciated the private little fenced patio area directly outside the back door. Linda, who lives across the street, greeted us when we arrived and showed us where to park (off-street, alongside the house). She told us that if we needed anything to let her know, but since everything had been taken care of, we just settled in and enjoyed our weekend. If you prefer a qui&#39;),(&#39;e0770c00-988d-4c04-9b7c-5ec68fd704aa&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;32945f6e-5a96-4233-b8ae-048d51323d7b&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;The hotel outside looks a little older, the room was cute, though.  Had great shower pressure, AC worked wonderfully, room was clean, and had all the toiletries.  Beds were also very comfortable. &#39;),(&#39;e0c8454d-591f-4365-af19-a76c4d2f6b9e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;859a8a8f-9423-4bf6-b471-d9a7f39c9c2c&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;The pool house was a very nice place to stay. Brent and Cindy are very accommodating. Highly recommended!&#39;),(&#39;e2baf0b9-3bc9-4525-8616-323d01178256&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;aaf389be-c794-4fb4-a6cf-619ca956898f&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;The cottage was beautiful and was stocked with everything anyone could possibly need for a comfortable stay. The neighborhood was quiet and away from busy streets and at the same time a conveniently short distance from many great restaurants, markets, and wineries. This is a great place to stay if you are traveling solo or with a significant other; the cottage is very intimate.&#39;),(&#39;e327d2a5-651c-4ba8-8dea-2098483e481d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;df2548db-377d-422e-b805-4e8e0c794302&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;Very nice. Such a cute place to stay. Kevin was great! Was quite and has a beautiful view of the city at night. We loved it. &#39;),(&#39;e32a3a30-4565-4628-8d9f-6def81f7f97c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e979e012-bcb1-47ea-bb39-140cdfe0f917&#39;,&#39;30a890e4-a62c-44f9-abc0-07e2c74021da&#39;,&#39;Clean and comfortable! &#39;),(&#39;e3552d9e-a604-462d-98c2-3b1b84411efa&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b4a927e4-9715-4cd2-9918-47491f97df3e&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Great place and great people!  &#39;),(&#39;e3fbbb5f-e399-4b2f-afa5-7ec6bf9040c3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ef3f56b8-c024-471e-b7ba-be1a72c6cbec&#39;,&#39;00a11245-12fa-436e-9ccc-967417f8c30a&#39;,&#39;Good place to stay for a night or two. 4 minute drive from downtown Tempe. &#39;),(&#39;e44002aa-aec6-4409-ac16-056e32f2e7b6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d27f17eb-3ddd-44c0-9e8a-f3c21d933b3b&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;I communicated with Sandra throughout my trip and was very flexible by the fact that I wasn\&#39;t sure exactly what time I would be reaching because I was doing a road trip. The room is clean and the bathroom is very nice! The host also provides netflix in the living room!&#39;),(&#39;e50771ef-090e-4ca0-8771-db5eb18ad3fc&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;47b9ca37-915d-405d-861d-7dbf74559441&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;The hot tub is awesome. Take note that there\&#39;s no place to prepare food, but there is a small fridge (think of this as a hotel room). Check in is very simple. &#39;),(&#39;e5384b00-9cd1-436a-92b9-3d2a6dedddea&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;279b355e-ff9a-4b85-8114-6db7ad2a4cd2&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Great place! Nice and clean and super comfy linens. Would recommend!&#39;),(&#39;e55b4562-17db-4f65-8c66-9f41e9f32137&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e3f28357-a476-4032-8726-4ac7262cbc72&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;I had an excellent stay at Jane\&#39;s while in Napa on business. It\&#39;s centrally located and just a five minute drive from some great food and stores. The house is a lovely place and the room was one of the best Air BnB experiences I\&#39;ve had yet - she thought of everything one may need during a stay. I highly recommend!&#39;),(&#39;e5be7970-868c-47e9-9ffd-6c0b32590470&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6a78ec0c-8410-4cbf-a915-e697a3aa798d&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;Will definitely come back here when in the area! Fantastic place, highly recommended! Don\&#39;t forget your swimsuit - great pool, lake and jacuzzi. Very private and beautiful gardens.&#39;),(&#39;e5c48592-18f1-4739-9d72-bcf781c48dec&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;4703b2d8-e417-4243-a6f3-044fc06f020e&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;I felt right at home here, Amelia was so welcoming! I was lucky enough to be invited to join a delicious home cooked dinner with her and her other guest. It was a great environment to hang out with new people and also have some quiet time. Amelia is great to talk to and to learn from about what\&#39;s going on in the area. Close to Birmingham which I unfortunately didn\&#39;t get to explore this time around.&#39;),(&#39;e62d302a-2bc0-4381-8a28-08503d9aac01&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e6c33577-5de3-4481-9147-47ef4710b986&#39;,&#39;00e93fc3-53ff-4da4-8e72-faa5216f81bb&#39;,&#39;Joanna and her family are beautiful people. They are eager to share their stories of their lives, travels, Hawaii past and current, and the rich Hawaiian culture with you. I honestly felt like one of there family members while staying with them. They even fed me a delicious BBQ dinner. This is a great way to experience the loving nature of the Hawaiian people. &#39;),(&#39;e66c3e16-571b-4200-8c02-cfce1103db33&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;817bcb43-ba39-4925-aed6-76be4bed946b&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Tom was a great host, super friendly! Plus his dog Coby is so sweet. Good place for the price! Everything offered was there! &#39;),(&#39;e6cfc956-c5a7-47a7-9aa6-454f22341af4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3827c1d1-14d5-4643-a24b-3dca656192fa&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;Very clear place.&#39;),(&#39;e6d47691-f4be-4f26-989b-bf99c3b853e4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0675a2d6-f64c-4be7-9a8a-f55341f09d4b&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Cozy place, great host. &#39;),(&#39;e744bff1-cc32-4a8b-ab38-8545bdbdf8fc&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;aaf389be-c794-4fb4-a6cf-619ca956898f&#39;,&#39;7771bbe9-92ab-46d1-a636-864526361d7d&#39;,&#39;This lovely little guest studio behind Melanie\&#39;s house was the perfect choice for our visit to Napa/Sonoma. As others have commented, it is cozy but very well-appointed with everything you could possibly need for a lovely stay. Bed was very comfortable. Melanie greeted us warmly with a smile and a hug and was very responsive to any inquiries we had.  The location was perfect for our jaunts to Napa for the wine train and a day trip to Calistoga. This is the epitome of an AirBnB stay......&#39;),(&#39;e7f4c843-1952-4d7d-ac87-866bedeb2bbb&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b13b1a74-3a12-4f00-8c19-273cbedc0eaa&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Very nice place,  but just couple notes-pretty serious stairclimb, good workout though! Smells smokey, smoker friendly. That\&#39;s the main thing our group didn\&#39;t care for. Other than that, nice place, well appointed. Great location and view, not loud. &#39;),(&#39;e8146cd3-2224-40d3-874e-94216e106514&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e979e012-bcb1-47ea-bb39-140cdfe0f917&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Great host.  Clean and super friendly.  Fun dog to love on.  Very thoughtful host.&#39;),(&#39;e8450beb-0727-4148-b9f9-a7460e2531c6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6ebec357-8589-435b-a5cb-fcd99b638fae&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;Elisa was kind and communicative. She left breakfast out which was an amazing detail! Also, Elisa has the most amazing pillows in the room! Highly recommend!&#39;),(&#39;e84e4ec9-64ec-4512-a27d-a7b590ada6ee&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6ebec357-8589-435b-a5cb-fcd99b638fae&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Staying at Elisa\&#39;s house was amazing! The large room and super comfortable bed made our big drive easy to recover from. &lt;BR /&gt;&lt;BR /&gt;The coffee and scones in the morning was a great bonus too! Thanks for a good stay!&#39;),(&#39;e88b2d64-c23d-4c1b-9776-211ab7235c91&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;18ff54e2-dc10-4e7f-bfdb-8a7591f7f009&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;There are two other rooms that get rented out so the share places feels a little untidy sometimes. But the room itself was clean and was fine. The house is on a busy street so there is a bit of traffic noise. It was nice being able to use a washer and dryer and a kitchen too. Travis was nice and checked whenever he did see us if things were fine. &#39;),(&#39;e914faa0-1813-4e47-82f1-2d6377938027&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;eb3c3877-39bc-4de3-8fc3-4f3895c5b2ba&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Great place! &#39;),(&#39;e93ec66a-f5d6-47bd-8a43-f7568ffdf026&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;98b1678d-d25c-476a-b6c3-c11978617e90&#39;,&#39;5e181cc6-cac7-49e9-a7a1-3095b0f9010b&#39;,&#39;Chris was very welcoming and easy-going. The room was clean and comfortable. Would definitely recommend! &#39;),(&#39;e99c015a-780a-463c-9bab-3efadb2e80a2&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;12ff7d06-9910-41cd-9eee-bdc21476d119&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;This place is all about location. It’s minutes from the beach and a short walk to Waikiki or Ft DeRussy beach, or easy bus ride to further sights (e.g., Iolani Palace, Diamonds Head).  As a bachelor suite, the room itself was the perfect size for a couple looking to explore Honolulu. Inside, the décor is pretty and modern and makes a nice private place to relax after a long day of adventure.  Though we didn\&#39;t get a chance to use the pool (we were too busy exploring Honolulu), it looked well maintained and like a great place to relax.  Outside, the building itself, which is both a hotel and condo buildling, is a bit dated. However, the staff are very friendly, and someone is always around – night or day - to help you in case your key card doesn’t work.  Dana was also a great host, and communication with her was quick and easy!   &#39;),(&#39;ea71f26f-3e10-460f-a7c7-587448c1fb52&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;d991f849-0f2f-41cb-b6d7-41feee6bc943&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;It was our first time booking a room in a shared home and it was a great experience.  The family was nice and generous.  The street parking was full so they offered their garage.  If I needed to go back to Fremont, I would book it again.&#39;),(&#39;ea8b5ac8-c518-4ac3-aca2-b73a9d774f20&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;78ca76e7-78dc-4867-8281-50ab3dc47cdd&#39;,&#39;f33e2624-520b-4bc2-b6a0-190ee1d41855&#39;,&#39;Small and relaxing. Cozy and comforting.&#39;),(&#39;ead4adc8-07ed-492e-8fed-a6421cce171e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;328bd785-a91b-424c-afda-9e08e5155cfe&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;Old house that is remodeled. Nice bedroom with comfortable bed. We enjoyed our stay. &#39;),(&#39;eb78caf9-de6a-4a18-8961-52bec8c4c320&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;836bea96-c22d-46d2-9335-b97cec4cc30a&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Ellen is a super hostesses. All the southern charm of Jackson with great art and atmosphere. Comfortable home in the heart of Jackson.&#39;),(&#39;eb7a2c08-d5b5-47f4-8f6b-58b9105dc94e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;52cc10db-af9b-499c-aa8e-670056611a7c&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Kelly\&#39;s place was very affordable, and was exactly as advertised! &#39;),(&#39;ec2750