 super host status for sure. &lt;BR /&gt;&lt;BR /&gt;The complimentary bottle of wine was a very welcomed gift. &#39;),(&#39;edf62f14-9c58-421e-af4b-af68ee5c8d9e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;314b188e-990b-423e-ae63-f0199b8c2b17&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;The cottage was comfortable and perfect for 2. Loved our stay, would definitely stay there again.&#39;),(&#39;ee814316-1e4d-42d9-851c-5fedc35d901e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b493f8ca-c5d2-414a-9441-6cd4dcebcd36&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Lots of steps; centrally located; beautiful house; couldn\&#39;t have asked for more.&#39;),(&#39;eeb78eb1-f8f1-4bfd-8812-d8256adf6c54&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6a78ec0c-8410-4cbf-a915-e697a3aa798d&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Rafael was a fantastic host!  He made the check in process easy and answered any questions prior to arrival.  He also recommended local places of interest - sites and restaurants.  The property is gorgeous - the private suite, the lake (including paddleboards and canoe), pool, Jacuzzi... we had an amazing stay and highly recommend to anyone traveling to the downtown Orlando area.  Will definitely stay here again - Thanks for accommodating us  us! :)&#39;),(&#39;eeea77e7-d25b-47fa-a2ab-3b04c138ec85&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9684e0c7-0f21-4a00-9334-1a974e13dbc3&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;Really cool vintage airstream with an lite porch!&#39;),(&#39;eeef1476-32d9-48b2-abdd-2aac45f95de8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bc227cc3-0ad7-4b9a-b72a-6c2a45e6a88a&#39;,&#39;b6160096-c503-4909-a674-7bfbddc8cc45&#39;,&#39;Check everything in front of host. &#39;),(&#39;efc9014d-fe4c-4fe2-b216-912264c3fc3a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ad124633-a610-483f-862a-6f54dda19c6e&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Nice and comfortable room in a nice neighborhood. Very close to UCF university.&#39;),(&#39;efd04321-816e-49f8-bc88-7e167197c177&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;62e75faa-d265-4ca1-a009-1e06f1d6ab14&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;loved it&#39;),(&#39;f11ddc3e-b304-4d91-8a9c-8cd2b7502512&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;f19fa153-154e-440b-9f4b-debee403b0d2&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;Kathy is a wonderful host. We felt comfortable from the moment we arrived and she was good at communicating prior to our stay. The pictures provide an accurate view of this lovely home. Also, we enjoyed walking the trail by the river and the River Walk to Downtown Naperville. The house is in a quiet neighborhood and we were able to walk to a great breakfast place (less than one mile), \&quot;The Lucky Penny Diner and Deli\&quot;. &#39;),(&#39;f1775aef-623f-4fa2-bfd3-387b858951e3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1014dfdf-fa7a-487c-bba8-2d3076d570dc&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Randall\&#39;s place was great! Beautiful location in a wooded neighborhood, with a lovely fenced backyard garden. The space felt like a separate apartment, and the jacuzzi/sauna were awesome. Randall was very helpful and provided us with more delicious snacks than we could have imagined. Would absolutely stay here next time I\&#39;m in Denver!&#39;),(&#39;f17cd286-e5e1-4b88-9e0a-b364e445f474&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b180ad52-fe00-4040-97f9-9efdfc3d406d&#39;,&#39;dfc6b9a5-6673-4f1b-83cd-0dfa800c0d08&#39;,&#39;Had a wonderful cozy time in the pod as my base to explore a bit of eugene. Very nice hosts, I\&#39;ll definitely be back again next time I come to Eugene.&#39;),