-4694-bbbe-002b1a5d02f3&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;645127dd-38b4-4fad-9950-57b3ce0a5301&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Super close to the UofI campus. Cameron and Sara\&#39;s place was very clean and basic, and provided me with everything I needed for a comfortable stay.&#39;),(&#39;f68432af-e81f-4703-b7fc-520cd09fa5e4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;78ca76e7-78dc-4867-8281-50ab3dc47cdd&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;Excellent, quiet accommodations. &#39;),(&#39;f694d9ce-2e60-44b1-95b0-2f4ebe2ed52d&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3ebfaf23-cede-4cf0-964d-8afc17b11d02&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Outstanding very cozy place!&#39;),(&#39;f6b0def6-2b71-4765-8c75-2991e61da486&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a302bce0-cb8e-4e54-ba2b-0822b0565303&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;Wow, first it was an economical rate, 22$ per night, and there were no cleaning fees or hidden nickle and dime additions - which has happened a few times in the past under the AirBnB system. It was a straight up rate.&lt;BR /&gt;&lt;BR /&gt;Bill is a straight up man of integrity. This is what made my stay so wonderful. &lt;BR /&gt;&lt;BR /&gt;I have stayed at many hostels around the world with similar rates, but you have to put up with a lot more crap, such as kitchens that are dirty, missing appliances, using a nasty dormitory room with snoring, and clothes around the floor, and there have been many other guests who are both well-mannered and ill-mannered. I also include the hostel staff in this smorgasbord. I also used Couchsurfing some years ago, and I met a few marvelous people through it, but lately the site, and the people running it have messed up its system. AirBnB has taken the slack and created a new way to visit new places - and it has marvelous gems like Bill\&#39;s place in Globe.&#39;),(&#39;f7220024-e952-4520-8559-2093cae28db4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;5463e312-5bf4-4764-8c06-e97c5548f712&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;The place is great, in a calm and quite area. Megan is awesome. She\&#39;s flexible and caring. &lt;BR /&gt;The room has everything you need and there\&#39;s also a fridge with small snacks in it. It\&#39;s clean and cozy...&lt;BR /&gt;I\&#39;ll know where to stay the next time I\&#39;m in Jackson.&lt;BR /&gt;&#39;),(&#39;f7261084-c0dd-4059-8370-a2e0985d4094&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;09b4888f-0e06-4ab1-abbc-05e9865634d0&#39;,&#39;f9b11370-f316-492c-92da-014d7bce7213&#39;,&#39;Great self contained comfortable room and bath that is well outfitted with TV, micro, and fridge in Spanish town neighborhood walkable to downtown and capitol.&#39;),(&#39;f827bdef-4c53-4138-9216-c59e0714caf6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;cff8a023-eacb-4a38-a24f-a01fe9ddde18&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Great location, helpful hosts. Perfect for a couple. Very convenient to a perfect beach. Relaxing. &#39;),(&#39;f854e0c4-52bd-49a8-a9d5-17a7603ca126&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;e58517c1-3214-465f-a982-78208a3266c0&#39;,&#39;d622edfa-fc35-4732-b5ec-a15d794267ec&#39;,&#39;Pam was a wonderful host, and the bunkhouse was perfect for our group! Beds were comfortable, the endless hot water was key, and the property was great. The wifi was posted inside the house but didn\&#39;t work. This wasn\&#39;t an issue for us though! We played cards downstairs and enjoyed having lots of space to hang out!&lt;BR /&gt;&lt;BR /&gt;Pam was great in helping us out with our needs. She was easy to reach even in late and early hours. Definitely would stay here again!&#39;),(&#39;f8a8690c-d5e9-42ec-8701-bb3d9ad1d48c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;b180ad52-fe00-4040-97f9-9efdfc3d406d&#39;,&#39;dfed3ea3-c133-47e8-8cfa-312eecbcc56d&#39;,&#39;Nice, clean comfortable spot. Host we\&#39;re helpful and answered all my questions! Perfect spot to rest our heads after a long day!&#39;),(&#39;f9520a31-5a2f-4c92-a13e-89110c4e4751&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a16c7358-bf66-4802-8933-1616b5a322db&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Quinn and Hayden\&#39;s place was absolutely wonderful! Very clean and charming. They were very easy to communicate with and their place had everything I needed. I would definitely stay here again!&#39;),(&#39;f9dfbb04-0da5-4994-af14-1470189f2f36&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ff46f903-411b-4a16-8e16-1aab7f00686c&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;As advertised. Prompt and clear communications. Thanks so much. &#39;),(&#39;f9e71a09-e04d-41f0-8368-be7eabecc244&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1ff1963c-7afa-470c-bc05-562b01549b09&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;Hanna\&#39;s place was clean, cozy, and right in the middle of downtown napa. The back patio was wonderful! Very comfy beds and a nice shower. It was perfect for the two nights we spent there :)&#39;),(&#39;fa64978b-9251-4b7d-ab85-8e5e10d24614&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;8c2f2c57-a172-4689-a070-cbb4cd456c5c&#39;,&#39;8394fd35-8a8a-479f-a398-48f53b4a6554&#39;,&#39;Michael\&#39;s place is located in a spot with great access to all may need or want.  The house is quiet and comfortable. Michael provides clear and timely communication.  &#39;),(&#39;faf11e27-78b9-43b1-b3f0-fb3877e2da8a&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;0a454f9a-eaac-488b-8443-23cf58f7ae37&#39;,&#39;cf1780e6-d294-4113-8749-1c728b9e3f81&#39;,&#39;We live in Kailua and we chose Pam\&#39;s place for overflow family visiting for a baby luau. So we already know the lay of the land. This is a great location with a big yard very close to the best family beach in Hawaii. Pam Is a terrific host. I highly recommend  this room in Pam\&#39;s home as a great place to stay for a couple or for a single traveler. Enjoy Kailua!  With aloha, Peter C&#39;),(&#39;fb4ef7ee-81e8-47a0-97a8-a4b73ba95dc6&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;1385324e-d727-475c-ad30-f7dcb5afea02&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Thomas was very helpful and family friendly, the property was clean, quite and comfortable, slept really good here&#39;),(&#39;fb7bc429-9e4f-4278-a1cd-2a7548cbd7b4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;60b77ea7-04c9-4b8a-b835-dc92c6aa196b&#39;,&#39;9e7b2291-3bff-43b9-9241-8ff685e7a6dd&#39;,&#39;This was a great location but definitely cozy. Small bathroom but very clean. The hosts were also great. Very communicative and helpful. &#39;),(&#39;fb978264-d7a8-4f39-b336-5430e35ff851&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;43803445-1874-4a3c-94e9-955fcb25089b&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;I only stayed one night but it was amazing! It\&#39;s a beautiful house in a beautiful street. The room is spacious and has everything you might need. Bed is super comfy! The bathroom was very clean and right next to the bedroom. Plus Valery and Spencer are super nice. Totally recomend it.&#39;),(&#39;fbec97dc-a67a-474c-ad2b-13941c2974f5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;19ae5055-f503-499d-a64f-2bf7d92eff5b&#39;,&#39;91e27a07-1f47-43c9-b851-60c6882abcd3&#39;,&#39;Great place, no issues. 10/10&#39;),(&#39;fc37a5ba-05c4-4b89-83e3-a163b7246172&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;836bea96-c22d-46d2-9335-b97cec4cc30a&#39;,&#39;32c11d3d-99a1-4406-ab41-7b6ccb7dd760&#39;,&#39;Beautiful home; excellent host with exceptional communication. &#39;),(&#39;fcbb4119-5be5-4d80-8446-ccd579fcf86c&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9247dcc1-711a-4ab2-b99a-f2808627d2f2&#39;,&#39;887dcd8d-d5ee-48de-9626-73ff4ea732fa&#39;,&#39;We had a fantastic one night stay at Plantation Mouton Bois Des Chenes enroute to New Orleans. We stayed in the Carriage House which was clean, comfy and had good WiFi. Ravi greeted us with wine and delicious cookies fresh out of the oven and John cooked us up a stellar breakfast feast the next day (fruit salad, crab omelette, jalapeno sausage and biscuits). Loved having a tour of the house and getting John\&#39;s run down on the area. Highly recommended (don\&#39;t forget to get the breakfast)!&#39;),(&#39;fcd4853a-b6a5-48b5-aa14-c0832f8b0e22&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2b6e6650-5f69-426d-a084-71f7ad30d1f1&#39;,&#39;c81d66a3-f0fe-44e9-9f31-cb3c6f27db4e&#39;,&#39;Beautiful home in beautiful Kailua. &#39;),(&#39;fdc5fa63-1ce0-4d36-bf98-99b259514ed8&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;be89d2ce-231e-4205-a8c1-e6bcf5990302&#39;,&#39;7231eaa1-400f-4cb5-a867-f5eba8adbb81&#39;,&#39;We had a perfect stay here. Great value and a home-y feel. Sequoia also made us delicious smoothies for breakfast. Highly recommended. &#39;),(&#39;fe1361da-3b8a-407f-aad8-e7f6f0de3cc4&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;a302bce0-cb8e-4e54-ba2b-0822b0565303&#39;,&#39;85651506-c13c-4c2f-9c79-8fbebc048e39&#39;,&#39;Bill is a great host and I had a wonderful time there, he was incredibly helpful and except for my bad back on the futon it would have been perfect but other than that it was good!&#39;),(&#39;fe389bf0-dba8-4343-81be-1b718b10b675&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;bcda6018-7286-4d8c-abfa-dda1026adf88&#39;,&#39;9eec6c06-5918-4867-833a-face490d4715&#39;,&#39;We loved the cottage. It was clean and cute. Nice shower! Bed is comfy. Private feel. It was nice to stay outside of downtown Sonoma a bit and meet the locals. Great value!&#39;),(&#39;fe521e87-3e45-41ee-a772-46df3840e9d5&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;ad124633-a610-483f-862a-6f54dda19c6e&#39;,&#39;aa92d1ff-f0ad-4ba3-9c20-2afef207bf70&#39;,&#39;I had a late arriving plane and Lida was very accommodating and able to have someone available to greet me when I arrived. The bedroom and bathroom are basic but towels were provided and everything was clean and comfortable. Great value!&#39;),(&#39;fef65853-3097-4eff-8925-2ae5f29fd70b&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;9247dcc1-711a-4ab2-b99a-f2808627d2f2&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;THE BEST airbnb experience from seasoned airbnbers!  From cocktails when you check in to cajun jam sessions to historical tours of the property, John and Ravi made us feel like family immediately.  This is a true bed and breakfast and a STEAL at the price they charge! The room was charming, private, and smelled great!  Don\&#39;t think twice about staying here because this place is an experience not to be missed when in Lafayette! Cant wait to come back!&#39;),(&#39;fefe550f-b651-4b36-ab19-d27d6529e5a7&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;6ebec357-8589-435b-a5cb-fcd99b638fae&#39;,&#39;fa44780d-ac48-41ab-9dd0-ac54a15755cf&#39;,&#39;Elisa has a beautiful home and a great system for welcoming visitors, even if you check-in after hours like we did. We had to rush out in the morning, but Elisa was kind enough to offer us breakfast as we were leaving. The room and bathroom were very clean and the towels were super-soft. It was a little bit of a drive back to her house, but it was a nice, quiet neighborhood.&#39;),(&#39;ff45e34c-5177-4817-8e6a-9f52cb34d06e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;314b188e-990b-423e-ae63-f0199b8c2b17&#39;,&#39;61302be9-4b31-4be0-92fc-d0dda253e167&#39;,&#39;We had a lovely stay at this cottage in Bisbee. Everything was beautiful, clean, and exactly as pictured and described. Everything was provided including coffee pods, wine glass, a wine bottle opener, etc. All of the little details were provided and made our stay even more wonderful. The deck has a gorgeous view. We were able to walk to everything in town. We\&#39;ll rent this place again any time we want to go back to Bisbee!&#39;),(&#39;ff54bd47-758d-41f1-a69f-704921d2eeaf&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;47b9ca37-915d-405d-861d-7dbf74559441&#39;,&#39;426624f6-84a9-4ec4-84f3-7655dc70e86e&#39;,&#39;Carmenita is a friendly person! Her place also clean and nice!&#39;),(&#39;ff7d29b2-1d11-4bed-8645-8ee5fc72a82e&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;89ddd0bc-2250-4094-8f6d-59b35c0f6891&#39;,&#39;150e591e-486b-48ee-be42-4aecba665020&#39;,&#39;Super comfortable and really convenient - all around a great spot! Not only was the place perfect but Jennifer was helpful with any questions/concerns. If you\&#39;re headed to Bisbee this place is a must book.&#39;),(&#39;ffaab65f-0491-4bbf-9b58-faad830acc73&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;3290a4ef-4241-4fa5-843e-87926c74e384&#39;,&#39;df668e22-e344-4c89-a050-e5ad211cbaa6&#39;,&#39;This was a superb catch- great value for the fee. It was the perfect place to relax. The neighborhood is beautiful and calm, and it is very easy to get around Tempe from this spot. Carlos has his hospitality game together - you would think he took a course.&#39;),(&#39;ffec053e-cc6a-4802-8bbf-1b5d078a0c92&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;2017-03-25 02:17:07&#39;,&#39;279b355e-ff9a-4b85-8114-6db7ad2a4cd2&#39;,&#39;70b18dcc-08ef-4040-91cf-4075973d320a&#39;,&#39;The location is great with mass transportation available within a short walking distance. The room is private and very cozy. Ryan was alway available for all the restaurant questions I had! &#39;);</td>
        </tr>
